return ['x-generator'=>'GlotPress/4.0.1','translation-revision-date'=>'2020-04-09 10:44:10+0000','plural-forms'=>'nplurals=2; plural=n != 1;','project-id-version'=>'WordPress - 5.4.x - Administration','language'=>'ur_PK','messages'=>['Capabilities'=>'صلاحیتیں','Retro (Generated)'=>'ریٹرو (پیدا کردہ)','%s post updated.'=>'%s پوسٹ اپڈیٹ کر دی گئی۔' . "\0" . '%s پوسٹیں اپڈیٹ کر دی گئیں۔','%s block not updated, somebody is editing it.'=>'%s بلاک اپ ڈیٹڈ نہیں ہے، کوئی اس میں ترمیم کر رہا ہے۔' . "\0" . '%s بلاکس اپ ڈیٹڈ نہیں ہیں، کوئی اس میں ترمیم کر رہا ہے۔','Export'=>'برآمد','When you click the button below WordPress will create an XML file for you to save to your computer.'=>'جب آپ نیچے دیا گیا بٹن دبائیں گے تو WordPress ایک ایکس ایم ایل فائل بنا دے گا تاکہ آپ اپنے کمپیوٹر میں محفوظ کر سکیں۔','This format, which we call WordPress eXtended RSS or WXR, will contain your posts, pages, comments, custom fields, categories, and tags.'=>'یہ فارمیٹ، جسے ہم WordPress eXtended آر ایس ایس یا ڈبلیو ایکس آر کہتے ہیں، یہ آپ کی پوسٹس، صفحے، تبصرے، مرضی کی فیلڈز، زمرے اور ٹیگز بھی رکھے گا۔','Download Export File'=>'برآمدی فائل کو ڈاوٗن لوڈ کریں','To install the theme so you can preview it with your site&#8217;s content and customize its theme options, click the "Install" button at the top of the left-hand pane. The theme files will be downloaded to your website automatically. When this is complete, the theme is now available for activation, which you can do by clicking the "Activate" link, or by navigating to your Manage Themes screen and clicking the "Live Preview" link under any installed theme&#8217;s thumbnail image.'=>'تھیم کو انسٹال کرنے، تاکہ آپ اس کو اپنی سائٹ پر مواد کے ساتھ دیکھ سکیں اور اس میں تبدیلیاں کر سکیں، بائیں جانب موجود ہینڈ پین کے اوپر پر انسٹال بٹن پر کلک کریں۔ تھیم کی فائلیں آپ کی سائٹ پر خود بخود ڈاؤنلوڈ ہو جائیں گی۔ اور جب یہ مکمل ہو جائے گی، تو آپ تھیم کو اپنی سائٹ پر "فعال کریں" کے بٹن سے لگا سکتے ہیں۔ اس کے علاوہ آپ تھیم کے ٹیب میں جا کر براہ راست پیش م