د الفاظ جیسے ہوں گے، پس &#8220;press&#8221; سے &#8220;WordPress&#8221; میل کھاتا ہو۔','Avatars'=>'اوتارز','Avatar Display'=>'اوتار کی نمائش','Show Avatars'=>'اوتار دکھائیں','Maximum Rating'=>'زیادہ سے زیادہ درجہ بندی','G &#8212; Suitable for all audiences'=>'تمام ناظرین کے لیے مناسب G &#8212;','PG &#8212; Possibly offensive, usually for audiences 13 and above'=>'PG &#8212; ممکن ہے کہ یہ جارحانہ ہو، عموماً یہ 13 سال اور اس زیادہ کے افراد کے لوگوں کے لیے ہے','R &#8212; Intended for adult audiences above 17'=>'R &#8212; 17 سال کی عمر سے زیادہ بالغ افراد کے لیے','X &#8212; Even more mature than above'=>'X &#8212; اوپر سے بھی زیادہ بالغ ','Default Avatar'=>'طےشدہ اوتار ','For users without a custom avatar of their own, you can either display a generic logo or a generated one based on their email address.'=>'وہ صارف جنہوں نے اپنی مرضی کی تصویر نہیں لگائی ہوئی ان کے لیے آپ یا تو ایک مشترکہ لوگو استعمال کر سکتے ہیں یا ان کی ای میل کے مطابق ایک تصویر بنا سکتے ہیں۔','Blank'=>'خالی','Gravatar Logo'=>'Gravatar لوگو ','Identicon (Generated)'=>'Identicon (بنا دیا گیا)','Wavatar (Generated)'=>'Wavatar (بنا دیا گیا)','MonsterID (Generated)'=>'MonsterID (بنا دیا گیا)','Privacy Settings'=>'ذاتی ترتیبات','New Password'=>'نیا پاسورڈ','Type your new password again.'=>'نیا پاسورڈ دوبارہ ڈالیں','Additional Capabilities'=>'مزید اختیارات','Update Profile'=>'پروفائل اپڈیٹ کریں','Update User'=>'صارف کی تجدید کریں','Delete Users'=>'صارف کو حذف کریں','There are no valid users selected for deletion.'=>'حذف کرنے کے لیے کوئی صارف منتخب نہیں کیا۔','New user created.'=>'نیا صارف بنا دیا گیا۔','The current user&#8217;s role must have user editing capabilities.'=>'موجودہ صارف کے پاس صارف کے اختیارات میں ترمیم کا کردار ہونا چاہیے۔','Other user roles have been changed.'=>'دیگر صارف کے کردار کو تبدیل کر دیا گیا ہے۔','You can&#8217;t delete the current user.'=>'آپ موجودہ صارف کو حذف نہیں کر سکتے۔','Other users have been deleted.'=>'دیگر صارف حذف کیے جا چکے ہیں۔','Categories:'=>'زمرے:','Sorry, I need a %s file to work from. Please re-upload this file to your WordPress installation.'=>'معاف کیجیے گا، مجھے کام کرنے کے لیے %s فائل کی ضرورت ہے، براہ مہربانی اس کو WordPress انسٹالیشن میں دوبارہ اپلوڈ کریں۔','Go to Dashboard'=>'ڈیش بورڈ پر جائیں','You can refine the list to show only posts in a specific category or from a specific month by using the dropdown menus above the posts list. Click the Filter button after making your selection. You also can refine the list by clicking on the post author, category or tag in the posts list.'=>'آپ پوسٹ کی فہرست کے اوپر دیئے گئے ڈراپ ڈاون مینو کے استعمال سے کسی مخصوص ماہ یا قسم کی پوسٹس دو دکھانے کے لئے پوسٹ فہرست کو بہتر بنا سکتے ہیں۔ اپنی ضرورت کے مطابق انتخاب کے بعد فلٹر بٹن کو دبایئں۔ آپ پوسٹ فہرست کو ان کے اوپر دئیے گئے پوسٹ کے مالک کے نام، قسم یا ٹیگ وغیرہ پر کلک کر کے بھی بہتر بنا سکتے ہیں۔','You have specified these users for removal:'=>'آپ نے ان صارفین کو حذف کرنے کے لیے معین کیا ہے: ','<strong>Error</strong>: "Table Prefix" can only contain numbers, letters, and underscores.'=>'<strong>خرابی</strong>: "Table Prefix" میں صرف اعداد، الفاظ اور انڈر اسکور پر مشتمل ہونا چاہیے۔','User deletion is not allowed from this screen.'=>'اس صفحہ سے صارف کو حذف کرنے کی اجازت نہیں ہے۔','Confirm Removal'=>'حذف کرنے کی تصدیق','There are no valid users selected for removal.'=>'کوئی بھی درست صارفین نہیں جن کو حذف کرنے کے لیے منتخب کیا گیا ہو۔','You can\'t remove the current user.'=>'آپ موجودہ صارف کو حذف نہیں کر سکتے۔','Other users have been removed.'=>'دیگر صارفین حذف دیئے گئے ہیں۔','Remove Users from Site'=>'ویب سائٹ سے صارفین کو حذف کریں','You can hide/display columns based on your needs and decide how many posts to list per screen using the Screen Options tab.'=>'آپ اسکرین اختیارات کی مدد سے کالمز کو دکھا اور چھپا سکتے ہیں اور پوسٹس کی تعداد متعین کر سکتے ہیں۔','You can customize the display of this screen in a number of ways:'=>'آپ اس اسکرین کے ڈسپلے کو مختلف طریقوں سے ترتیب دے سکتے ہیں:','Start date:'=>'شروع کا دن:','Hovering over a row in the posts list will display action links that allow you to manage your post. You can perform the following actions:'=>'پوسٹوں کی فہرست میں اگر آپ کسی قطار کے اوپر ماؤس کا کرسر لے جائیں تو آپ کو وہ فعل نظر آئیں گے جو آپ پوسٹس پر ان کو نظم میں لانے کے لیے کر سکتے ہیں۔ آپ درج ذیل کام کر سکتے ہیں:','You can Upload a theme manually if you have already downloaded its ZIP archive onto your computer (make sure it is from a trusted and original source). You can also do it the old-fashioned way and copy a downloaded theme&#8217;s folder via FTP into your %s directory.'=>'آپ خود ایک تھیم اپلوڈ کرسکتے ہیں اگر آپ اسکی زپ آرکائیو اپنے کمپیوٹر پر ڈاؤن لوڈ کر چکے ہیں (اس بات کی یقین دہانی کرلیں کہ پراعتماد اور اصلی مصدر سے تھیم ڈاؤن لوڈ کی گئی ہے)۔ آپ تھیم کو پرانے رائج کردہ طریقے سے بھی اپلوڈ کرسکتے ہیں اور وہ اس طرح کہ ڈاؤن لوڈ شدہ تھیم کے فولڈر کو FTP کے ذریعے %s ڈائریکٹری میں کاپی کر لیں۔','Once generated, your WXR file can be imported by another WordPress site or by another blogging platform able to access this format.'=>'ایک دفعہ جب آپکی WXR کی فائل بن جائے تو یہ دوسرے WordPress میں درآمد کی جا سکتی ہے، یا کسی اور پلیٹ فارم میں جو اس فارمیٹ کے ساتھ معاون ہے۔','To add a new user for your site, click the Add New button at the top of the screen or Add New in the Users menu section.'=>'اپنی سائٹ پہ نیا صارف شامل کرنے کے لیے، اسکرین کے اوپر نیا صارف شامل کرنے کا بٹن کلک کریں یا صارف کے مینو کے حصے سے شامل کریں۔','(Signup has been disabled. Only members of this site can comment.)'=>'(سائن اپ فعال نہیں ہے۔ صرف اس سائٹ کے ارکان تبصرہ کر سکتے ہیں۔)','Apply Filters'=>'فلٹرز لگائیں','Date range:'=>'تاریخ کی حد:','This will contain all of your posts, pages, comments, custom fields, terms, navigation menus, and custom posts.'=>'یہ آپ کی تمام پوسٹس، صفحات، تبصرے، مرضی کے خانوں، ٹرمز، نیویگیشن مینوز اور مرضی کی پوسٹس پر مشتمل ہوگا۔','Choose what to export'=>'برآمد کرنے کے لیے منتخب کریں','%s &#8212; WordPress'=>'%s &#8212; WordPress','Authors:'=>'مصنفین:','All content'=>'تمام مواد','One or more database tables are unavailable. To allow WordPress to attempt to repair these tables, press the &#8220;Repair Database&#8221; button. Repairing can take a while, so please be patient.'=>'ایک یا ایک سے زیادہ ڈیٹا بیس ٹیبل دستیاب نہیں ہیں۔ WordPress کو ان ٹیبلوں کی مرمت کرنے کے لیے&#8220;ڈیٹا بیس ریئپر&#8221; کا بٹن دبائیں۔ مرمت کے لیے وقت لگ سکتا ہے اس لیے انتظار کیجیے۔','This screen lists all the existing users for your site. Each user has one of five defined roles as set by the site admin: Site Administrator, Editor, Author, Contributor, or Subscriber. Users with roles other than Administrator will see fewer options in the dashboard navigation when they are logged in, based on their role.'=>'یہ اسکرین آپ کی سائٹ کے تمام صارفین کو دکھائے دے گی۔ ہر صارف ایڈمن کے متعین کردہ پانچ میں سے کسی ایک کردار کا حامل ہے: سائٹ منتظم، ایڈیٹر، شراکت دار یا سبسکرائبر۔ منتظم کے علاوہ لاگ اِن ہونے والے صارف اپنے کردارکی بنیاد پر ڈیش بورڈ میں کم اختیارات کے مالک ہونگے۔','You have specified these users for deletion:'=>'آپ نے مندرجہ ذیل صارفین کو حذف کرنے کے لیے مخصوص کیا ہے:','You have specified this user for deletion:'=>'آپ نے یہ صارف حذف کرنے کے  لیے مختص کیا ہے:','All Comments'=>'تمام تبصرے','Available Tools'=>'دستیاب ٹولز','Network Setup'=>'نیٹ ورک سیٹ اپ','You can find additional themes for your site by using the Theme Browser/Installer on this screen, which will display themes from the <a href="%s">WordPress Theme Directory</a>. These themes are designed and developed by third parties, are available free of charge, and are compatible with the license WordPress uses.'=>'آپ اپنی سائٹ کے لیے مزید تھیم اس اسکرین پر موجود تھیم براؤزر/انسٹالر کے ذریعے تلاش کر سکتے ہیں، جوکہ آپ کو <a href="%s">WordPress تھیم ڈکشنری</a> سے تھیم دکھائے گا۔ یہ تھیم تھرڈ پارٹیز کی بنائی ہوئی ہیں اور بلا معاوضہ استعمال کے لیے موجود ہیں اور لائسنس WordPress صارفین کے لیے موجود ہیں۔','Attempt to notify any blogs linked to from the post'=>'پوسٹ سے منسلک تمام بلاگ کو مطلع کرنے کی کوشش کریں','Updates %s'=>'اپڈیٹس %s','Successfully repaired the %s table.'=>'%s ٹیبل کی کامیابی سے مرمت کر دی گئی ہے۔','Installed Plugins'=>'اطلاق شدہ پلگ انز','You can&#8217;t remove users.'=>'آپ صارفین کو حذف نہیں کر سکتے۔','Changed roles.'=>'تبدیل شدہ کردار۔','User removed from this site.'=>'صارف کو اس سائٹ سے حذف کر دیا گیا۔','The %s table is already optimized.'=>'%s ٹیبل کی کارکردگی پہلے ہی ٹھیک ہے','All Users'=>'تمام صارفین','Plugins %s'=>'پلگ انز %s','Delete Site'=>'ویب سائٹ حذف کریں','The %s table is okay.'=>'%s ٹیبل ٹھیک ہے۔','Once you&#8217;ve saved the download file, you can use the Import function in another WordPress installation to import the content from this site.'=>'جب آپ ڈاؤن لوڈ فائل کو محفوظ کریں، آپ اس سائٹ سے مواد کی درآمد کے لیے ایک اور WordPress انسٹالیشن میں درآمد کی سہولت کا استعمال کر سکتے ہیں۔','<strong>Version %1$s</strong> addressed a security issue and fixed %2$s bug.'=>'<strong>ورژن%1$s</strong> میں سیکورٹی سے متعلقہ مسائل ٹھیک کیے گئے اور %2$s بگ بھی ٹھیک کیے گئے۔' . "\0" . '<strong>ورژن%1$s</strong>  میں سیکورٹی سے متعلقہ مسائل ٹھیک کیے گئے اور %2$s بگس بھی ٹھیک کیے گئے۔','For more information, see <a href="%s">the release notes</a>.'=>'مزید معلومات کے لیے، <a href="%s">ریلیز نوٹس</a> دیکھیں۔','<strong>Drag and drop</strong> your files into the area below. Multiple files are allowed.'=>'اپنی فائلوں کو نیچے جگہ پر <strong>ڈریگ اور ڈراپ</strong> کریں، ایک سے زیادہ فائلوں کی اجازت ہے۔','Clicking <strong>Select Files</strong> opens a navigation window showing you files in your operating system. Selecting <strong>Open</strong> after clicking on the file you want activates a progress bar on the uploader screen.'=>'<strong>فائل منتخب کریں</strong> کے اختیار پر کلک کرنے سے ایک ونڈو اوپن ہو جاتی ہے جس میں آپکو اپنے سسٹم کی فائلز نظر آتی ہیں۔ اپنی مرضی کی فائل منتخب کرنے کے بعد <strong>اوپن</strong> پر کلک کر کے آپ اس کو اپلوڈ کر سکتے ہیں اور اپلوڈ کارکردگی بھی دیکھ سکتے ہیں۔','When using Bulk Edit, you can change the metadata (categories, author, etc.) for all selected posts at once. To remove a post from the grouping, just click the x next to its name in the Bulk Edit area that appears.'=>'اجتماعی ترمیم کو استعمال کرتے ہوئی آپ میٹا ڈیٹا (زمرے، مصنف، وغیرہ) کو تمام پوسٹس کے لیے بیک وقت تبدیل کر سکتے ہیں۔ اس گروپ میں سے کسی پوسٹ کو حذف کے لیے اس کے نام کے سامنے موجود x پر کلک کریں۔','Return to Updates'=>'اپڈیٹس پر واپس جائیں','Maintenance and Security Release'=>'مرمتی اور سیکیورٹی ریلیز','Managing pages is very similar to managing posts, and the screens can be customized in the same way.'=>'صفحات کو منطم کرنا پوسٹ کو منطم کرنے کی طرح ہے، اور اسکرین کو اسی طرح کسٹمائز کیا جا سکتا ہے۔','You can also perform the same types of actions, including narrowing the list by using the filters, acting on a page using the action links that appear when you hover over a row, or using the Bulk Actions menu to edit the metadata for multiple pages at once.'=>'پوسٹس کی طرح آپ صفحات کو بھی بلک ایکشن سے تبدیل کر سکتے ہیں، ان پر مختلف قسم کے امور سر انجام دے سکتے ہیں، ان کی فہرست کو فلٹر کر سکتے ہیں، اور ان پر کرسر لے جا کر موجود مختلف اختیار دیکھ سکتے ہیں۔','This screen provides access to all of your posts. You can customize the display of this screen to suit your workflow.'=>'یہ اسکرین آپکی تمام پوسٹس تک رسائی دیتی ہے، آپ اس اسکرین کی نمائش کو اپنی مرضی کے مطابق بنا سکتے ہیں۔','You can also edit or move multiple posts to the Trash at once. Select the posts you want to act on using the checkboxes, then select the action you want to take from the Bulk Actions menu and click Apply.'=>'ایک ہی وقت میں آپ ایک سے زادہ پوسٹوں میں ترمیم اور ردی کی ٹوکری میں ڈال سکتے ہیں۔ چیک باکسز استعمال کرتے ہوئے وہ پوسٹس منتخب کریں جن پر آپ کاروائی کرنا چاہتے ہیں، پھر بلک کاروائی کے مینو سے وہ عمل منتخب کریں جو آپ کرنا چاہتے ہیں اور \'لاگو کریں\' پر کلک کریں۔','Adding Plugins'=>'پلگ انز شامل کرنا','Screen Content'=>'اسکرین کا مواد','You can customize the display of this screen&#8217;s contents in a number of ways:'=>'آپ بہت سارے طریقوں سے اس اسکرین کے مواد کو اپنی مرضی کے مطابق ڈھال سکتے ہیں:','Managing Pages'=>'صفحات کا انتظام','You can hide/display columns based on your needs and decide how many users to list per screen using the Screen Options tab.'=>'آپ اپنی ضرورت کے مطابق کالم کو چھپا/دکھا سکتے ہیں۔ آپ اپنی ضرورت کے مطابق کالم کو چھپا یا دکھا سکتے ہیں اور اسکرین اختیارات کو استعمال کر کے یہ بھی فیصلہ کر سکتے ہیں کہ ایک اسکرین پر کتنے صارفین نظر آئیں۔','<strong>Preview</strong> will show you what your draft post will look like if you publish it. View will take you to your live site to view the post. Which link is available depends on your post&#8217;s status.'=>'<strong>پیش منظر</strong> آپ کو دکھائے گا کہ آپ اس پوسٹ کو شائع کر دیں تو یہ کس طرح دکھائی دے گی۔ ویو کا اختیار آپ کو براہ راست سائٹ پر لے جائے گا تاکہ آپ اپنی پوسٹ کو دیکھ سکیں۔ کونسا لنک دستیاب ہے یہ آپ کی پوسٹ کے اسٹیٹس پر منحصر ہے۔','<strong>Version %1$s</strong> addressed some security issues and fixed %2$s bug.'=>'<strong>ورژن %1$s</strong> میں سیکورٹی سے متعلقہ مسائل ٹھیک کیے گئے اور %2$s بگ بھی ٹھیک کیے گئے۔' . "\0" . '<strong>ورژن %1$s</strong> میں سیکورٹی سے متعلقہ مسائل ٹھیک کیے گئے اور %2$s بگس بھی ٹھیک کیے گئے۔','Go to Dashboard &rarr; Home'=>'ڈیش بورڈ پر جائیں &rarr; سرورق','Return to Dashboard &rarr; Updates'=>'ڈیش بورڈ  پر واپس جائیں &rarr; اپڈیٹس','<strong>Version %1$s</strong> addressed %2$s bug.'=>'<strong>ورژن %1$s</strong> نامزد %2$s بگ۔' . "\0" . '<strong>ورژن %1$s</strong> نامزد %2$s بگس۔','Security Release'=>'سیکورٹی ریلیز','Maintenance Release'=>'مرمتی ریلیز','You can upload media files here without creating a post first. This allows you to upload files to use with posts and pages later and/or to get a web link for a particular file that you can share. There are three options for uploading files:'=>'یہاں پر آپ ذرائع ابلاغ فائلز کو اپ لوڈ کرسکتے ہیں بغیر پہلی پوسٹ بنائے۔ یہ آپ کو فائلز اپ لوڈ کرنے کی اجازت دیتا ہے تاکہ پوسٹس اور صفحات میں استعمال ہو سکیں بعد میں اور/یا اس مخصوس فائل کا لنک بھی لیا جا سکتا ہے جو آپ شیئر کر سکتے ہیں۔ وہاں پر فائلز اپ لوڈ کرنے کے تین طریقے ہیں:','Hovering over a row in the users list will display action links that allow you to manage users. You can perform the following actions:'=>'اگر آپ صارفین کی فہرست کے اوپر ماؤس کرسر لے جائیں تو یہ آپ کو ان اختیارات کے لنک دکھائے گا جن کے ذریعے سے آپ صارفین کو منظم کر سکتے ہیں۔ آپ مندرجہ ذیل کام کر سکتے ہیں:','<strong>Trash</strong> removes your post from this list and places it in the Trash, from which you can permanently delete it.'=>'<strong>ردی کی ٹوکری</strong> آپ کی پوسٹوں کو یہاں سے حذف کر کے ردی کی ٹوکری میں ڈالتا ہے، جہاں سے آپ ان کو مستقل حذف کر سکتے ہیں۔','I\'m sure I want to permanently disable my site, and I am aware I can never get it back or use %s again.'=>'مجھے اطمینان ہے کہ میں اپنی سائٹ کو ہمیشہ کے لیے غیر فعال کرنا چاہتا ہوں، اور میں جانتا ہوں کہ میں اسے دوبارہ حاصل نہیں کر سکتا اور نہ %s کو استمعال کر سکتا ہوں۔','Delete My Site Permanently'=>'میری سائٹ ہمیشہ کے لیے حذف کریں','<strong>Quick Edit</strong> provides inline access to the metadata of your post, allowing you to update post details without leaving this screen.'=>'<strong>فوری ترمیم</strong> آپ کی پوسٹ کے مٹا ڈیٹا تک اسی جگہ رسائی دیتی ہے، آپ یہ اسکرین چھوڑے بغیر پوسٹ کی تفصیلات میں ترمیم کر سکتے ہیں۔','<strong>Edit</strong> takes you to the editing screen for that post. You can also reach that screen by clicking on the post title.'=>'<strong>ترمیم</strong> آپ کو اُس پوسٹ میں ترمیم کرنے والی سکرین پر لے جائے گی۔ آپ اُس پوسٹ کے عنوان پہ کلک کر کے بھی اُس اسکرین پر جا سکتے ہیں۔','admin menuAll Links'=>'تمام لنکس','<strong>Edit</strong> takes you to the editable profile screen for that user. You can also reach that screen by clicking on the username.'=>'ترمیم آپ کو اُس صارف کی پروفائل میں ترمیم کرنے والی اسکرین پر لے جائے گی۔ آپ اسم رکنیت پر کلک کر کے بھی اُس اسکرین پر جا سکتے ہیں۔','<strong>Version %s</strong> addressed some security issues.'=>' <strong>ورژن %s نے</strong>نے سیکیورٹی کے کچھ مسائل حل کیے۔','Welcome to WordPress %s.'=>'WordPress پر خوش آمدید %s۔','You can view all posts made by a user by clicking on the number under the Posts column.'=>'پوسٹ کے کالم کے نیچے لکھی گئی تعداد پر کلک کر کے آپ اُس صارف کی تمام پوسٹس کو دیکھ سکتے ہیں۔','Successfully optimized the %s table.'=>'%s ٹیبل کی کارکردگی بہتر کر دی گئی','Failed to optimize the %1$s table. Error: %2$s'=>'%1$s ٹیبل کی کارکردگی بہتر کرنے میں ناکامی۔ خرابی : %2$s','This screen provides many options for controlling the management and display of comments and links to your posts/pages. So many, in fact, they won&#8217;t all fit here! :) Use the documentation links to get information on what each discussion setting does.'=>'اس اسکرین میں بہت سے اختیار موجود ہیں جن کی مدد سے آپ اپنی پوسٹوں اور صفحات کے لنکس اور تبصروں کی نمائش کو تبدیل کر سکتے ہیں اور ان کو منظم کر سکتے ہیں۔ اتنے زیادہ کہ وہ یہاں فٹ نہیں آئیں گے۔ اس کے متعلق مزید معلومات کے لیے دستاویزات کا مطالعہ کریں۔','The %1$s table is not okay. It is reporting the following error: %2$s. WordPress will attempt to repair this table&hellip;'=>'%1$s ٹیبل صحیح نہیں ہے۔ یہ درج ذیل خرابی دکھا رہا ہے: %2$s۔ WordPress اس ٹیبل کو ٹھیک کرنے کی کوشش کرے گا&hellip;','You can filter the list of users by User Role using the text links above the users list to show All, Administrator, Editor, Author, Contributor, or Subscriber. The default view is to show all users. Unused User Roles are not listed.'=>'آپ صارفین کی فہرست کو ان کے کردار کے مطابق فلٹر کر سکتے ہیں: تمام صارفین، ایڈمن، ایڈیٹر، ،مصنف، شراکت دار، یا سبسکرائبر۔ اس کے لیے اوپر دئیے گئے ٹیکسٹ لنکس کا استعمال کریں۔ پہلے سے طے شدہ طریقے کے مطابق تمام صارفین دکھائے جاتے ہیں۔','Repairs complete. Please remove the following line from wp-config.php to prevent this page from being used by unauthorized users.'=>'مرمت مکمل ہے۔ براہ مہربانی درج ذیل لائن حذف کریں تاکہ غیر مجاز صارفین wp-config.php فائل کو استعمال نہ کر سکیں۔','WordPress can automatically look for some common database problems and repair them. Repairing can take a while, so please be patient.'=>'WordPress خودکار طور پر ڈیٹا بیس کے عام مسائل کو دیکھ سکتا ہے اور ان کو حل کر سکتا ہے۔ مرمت میں وقت لگ سکتا ہے۔ آپ اطمینان سے رہیں۔','WordPress can also attempt to optimize the database. This improves performance in some situations. Repairing and optimizing the database can take a long time and the database will be locked while optimizing.'=>'WordPress بھی اس ڈیٹا بیس کی کارکردگی بہتر بنانے کی کوشش کر سکتا ہے۔ کچھ حالات میں یہ کارکردگی کو بہتر کرتا ہے۔ ڈیٹا بیس کی مرمت اور تصیح کافی وقت لے سکتی یے اور اس دوران ڈیٹا بیس استعمال نہیں ہو سکے گا۔','An avatar is an image that follows you from weblog to weblog appearing beside your name when you comment on avatar enabled sites. Here you can enable the display of avatars for people who comment on your site.'=>'اوتار وہ تصویر ہے جو ہر بلاگ پر آپ کے نام کے ساتھ ظاہر ہوتی ہے، جب آپ ایک ایسی سائٹ پر تبصرہ کرتے ہیں، جہاں تبصرہ کرنے کے اجازت ہو۔  یہاں آپ ان لوگو ں کے اواتار کو فعال بنا سکتے ہیں جو آپ کی سائٹ پر تبصرہ کریں۔','This theme has not been rated yet.'=>'ابھی تک اس تھیم کی درجہ بندی نہیں کی گئی۔','You can export a file of your site&#8217;s content in order to import it into another installation or platform. The export file will be an XML file format called WXR. Posts, pages, comments, custom fields, categories, and tags can be included. You can choose for the WXR file to include only certain posts or pages by setting the dropdown filters to limit the export by category, author, date range by month, or publishing status.'=>'آپ اپنی سائٹ کے مواد کو دوسری سائٹ یا پلیٹ فارم پر استعمال کرنے کے لیے ایک فائل بھی درآمد کر سکتے ہیں۔ ایکسپورٹ کردہ فائل XML  فارمیٹ میں ہو گی، جسے WXR کہا جاتا ہے۔ پوسٹس، صفحات، تبصرے، کسٹم فیلڈ، زمرے، اور ٹیگ بھی شامل کیے جا سکتے ہیں۔ آپ منتخب کر سکتے ہیں WXR فائل میں کونسی مخصوص پوسٹس یا پیج شامل ہوں اور اس کے لیے آپ ایکسپورٹ کرتے ہوئے مختلف فلٹر بھی استعمال کر سکتے ہیں۔','Failed to repair the %1$s table. Error: %2$s'=>'%1$s ٹیبل کو مرمت کرنے میں ناکامی۔ خرابی: %2$s','The file %1$s already exists. If you need to reset any of the configuration items in this file, please delete it first. You may try <a href="%2$s">installing now</a>.'=>'%1$s فائل پہلے سے موجود ہے، اگر آپ کو اس فائل میں کسی کنفگریشن آئٹمز کو دوبارہ ترتیب دینے کی ضرورت ہے تو پہلے اسے حذف کریں۔ آپ <a href="%2$s">ابھی انسٹال کریں</a> سے کوشش کر سکتے ہیں۔','The file %1$s already exists one level above your WordPress installation. If you need to reset any of the configuration items in this file, please delete it first. You may try <a href="%2$s">installing now</a>.'=>'%1$s فائل آپ کے WordPress سے ایک درجہ اوپر پہلے سے موجود ہے، گر آپ کو اس فائل میں کسی کنفگریشن آئٹمز کو دوبارہ ترتیب دینے کی ضرورت ہے تو پہلے اسے حذف کریں۔ آپ <a href="%2$s">ابھی انسٹال کریں</a> سے کوشش کر سکتے ہیں۔','WordPress &rsaquo; Setup Configuration File'=>'WordPress سیٹ اپ کنفگریشن فائل','Welcome to WordPress. Before getting started, we need some information on the database. You will need to know the following items before proceeding.'=>'WordPress میں خوش آمدید، شروع کرنے سے پہلے ہمیں ڈیٹابیس کے بارے میں کچھ معلومات چاہیے، آپ کو آگے جانے سے پہلے مندرجہ ذیل چیزوں کا پتہ ہونا چاہیے۔','Database password'=>'ڈیٹا بیس کا پاسورڈ','Table prefix (if you want to run more than one WordPress in a single database)'=>'ٹیبل کا سابقہ (اگر آپ ایک سے زیادہ WordPress ایک ڈیٹابیس میں چلانا چاہتے ہیں)','Let&#8217;s go!'=>'چلیں!','Database Name'=>'ڈیٹا بیس کا نام','example usernameusername'=>'اسم رکنیت','example passwordpassword'=>'پاسورڈ','Database Host'=>'ڈیٹابیس ہوسٹ','Table Prefix'=>'ٹیبل کا سابقہ','If you want to run multiple WordPress installations in a single database, change this.'=>'اگر آپ ایک ڈیٹابیس میں ایک سے زیادہ WordPress کی انسٹالیشن رکھنا چاہتے ہیں، تو اسکو تبدیل کریں۔','To allow use of this page to automatically repair database problems, please add the following line to your %s file. Once this line is added to your config, reload this page.'=>'ڈیٹابیس کے مسائل کے خودکار حل کے لیے اس صفحے کے استعمال کی اجازت دیں، براہ مہربانی دی گئی سطر کو اپنی %s فائل میں شامل کریں۔ جب سطر آپ کی کنفگریشن میں شامل ہو جائے، صفحے کو دوبارہ لوڈ کریں۔','Remember, once deleted your site cannot be restored.'=>'یاد رکھیے، ایک دفعہ سائٹ حذف کی تو پھر اس کو واپس بحال نہیں کر سکتے۔','Sorry, the link you clicked is stale. Please select another option.'=>'معاف کیجیے گا، جس لنک پر آپ نے کلک کیا وہ بیکار ہے، براہ مہربانی کوئی دوسرا اختیار منتخب کریں۔','Thank you for using %s, your site has been deleted. Happy trails to you until we meet again.'=>'%s کو استعمال کرنے کا بہت شکریہ، آپ کی سائٹ حذف ہو چکی ہے۔ دوبارہ ملنے تک خوش رہیے۔','If you do not want to use your %s site any more, you can delete it using the form below. When you click <strong>Delete My Site Permanently</strong> you will be sent an email with a link in it. Click on this link to delete your site.'=>'اگر آپ اپنی سائٹ %s استعمال نہیں کرنا چاہتے تو نیچے فارم سے حذف کر سکتے ہیں۔ جب آپ <strong> میری سائٹ ہمیشہ کے لیے حذف کریں</strong> کو کلک کریں گے تو آپ کو ایک ای میل بھیجی جائے گی جس میں ایک لنک ہو گا۔ اپنی سائٹ کو حذف کرنے کے لیے اس لنک پر کلک کریں۔



','Thank you. Please check your email for a link to confirm your action. Your site will not be deleted until this link is clicked.'=>'شکریہ، اس فعل کی تصدیق کے لیے اپنی ای میل چیک کریں، آپ کی سائٹ حذف نہیں ہو گی جب تک آپ اس لنک پر کلک نہ کریں۔','In all likelihood, these items were supplied to you by your Web Host. If you don&#8217;t have this information, then you will need to contact them before you can continue. If you&#8217;re all ready&hellip;'=>'یہ چیزیں آپکو ویب ہوسٹ مہیا کرتی ہے، اگر آپ کے پاس یہ معلومات نہیں ہے تو جاری رکھنے سے پہلے ان سے رابطہ کریں، اگر آپ ہر طریقے سے تیار ہیں۔','User deleted.'=>'صارف حذف کیا جا چکا ہے۔','Revert to the <strong>Browser Uploader</strong> by clicking the link below the drag and drop box.'=>'<strong>براوزر اپ لوڈر</strong> پہ دوبارہ منتقل ہونے کے لیے نیچے دیئے گئے ڈریگ اور ڈراپ خانے کے لنک پر کلک کریں۔','Previewing and Installing'=>'پیش منظر دیکھیں اور انسٹال کریں','Once you have generated a list of themes, you can preview and install any of them. Click on the thumbnail of the theme you&#8217;re interested in previewing. It will open up in a full-screen Preview page to give you a better idea of how that theme will look.'=>'ایک بار آپ نے تھیمز کی فہرست بنا لی تو آپ کسی بھی تھیم کو دیکھ سکتے ہیں یا انسٹا ل کر سکتے ہیں۔ جس تھیم کو دیکھنے میں آپ کی دلچسبی ہے آپ اُس کے تھمب نیل پر کلک کریں۔ پھر یہ ایک صفحہ پر کھل جائے گا جو پوری اسکرین پر مشتمل ہو گا تاکہ آپ کواندازہ ہو سکے کہ تھیم کیسی دکھائی دے گی۔','If you know what you&#8217;re looking for, Search is your best bet. The Search screen has options to search the WordPress Plugin Directory for a particular Term, Author, or Tag. You can also search the directory by selecting popular tags. Tags in larger type mean more plugins have been labeled with that tag.'=>'تلاش بہترین ہتھیار ہے، اگر آپ کو پتہ ہے کہ آپ کیا دیکھنا چاہتے ہیں۔ تلاش کرنے کی اسکرین میں ایسے طریقے موجود ہیں کہ آپ مخصوص اصلاح، مصنف یا ٹیگ کے لحاظ سے پلگ اِن ڈائرکٹری تلاش کر سکتے ہیں۔ آپ کسی مشہور ٹیگ کا انتخاب کر کے اُس کے ذریعے بھی ڈائریکٹری میں تلاش کر سکتے ہیں۔ ٹیگ کی مشہوری کا مطلب ہے کہ بہت بڑی تعداد میں پلگ اِنز کو وُہ ٹیگ دیا گیا ہے۔','You can also browse a user&#8217;s favorite plugins, by using the Favorites link above the plugins list and entering their WordPress.org username.'=>'پلگ اِنز کی فہرست کے اوپر موجود پسندیدہ کے لنک کو استعمال کرتے ہوئے اوراُن کے WordPress.org اسم رکنیت درج کر کے آپ صارفین کے پسندیدہ پلگ اِنز بھی دیکھ سکتے ہیں۔','Below you should enter your database connection details. If you&#8217;re not sure about these, contact your host.'=>'آپ نیچے اپنے ڈیٹا بیس کنکشن کی تفصیلات دیں، اگر آپ اس بارے میں یقین نہیں ہے تو اپنے ہوسٹ سے رابطہ کریں۔','After you&#8217;ve done that, click &#8220;Run the installation&#8221;.'=>'جب آپ یہ کر چکیں تو &#8220;انسٹال کریں &#8221; پر کلک کریں۔','Please select an option.'=>'پرام مہربانی ایک اختیار منتخب کریں۔','If you want to install a plugin that you&#8217;ve downloaded elsewhere, click the Upload Plugin button above the plugins list. You will be prompted to upload the .zip package, and once uploaded, you can activate the new plugin.'=>'اگر آپ ایسا پلگ ان انسٹال کرنا چاہتے ہیں جو کسی اور جگہ پر ڈاون لوڈ ہے تو پلگ ان فہرست کے اوپر دیئے گئے اپ لوڈ پلگ ان بٹن پر کلک کریں۔ آپ سے زِپ پیکج کو اپلوڈ کرنے کا کہا جائے گا، جب پلگ ان اپلوڈ ہو جائے تو آپ اس نئے پلگ ان کو فعال کر سکتے ہیں۔','ID #%1$s: %2$s <strong>The current user will not be deleted.</strong>'=>'آئی ڈی #%1$s: %2$s <strong>موجودہ صارف حذف نہیں ہو گا۔</strong>','ID #%1$s: %2$s'=>'آئی ڈی #%1$s: %2$s','All right, sparky! You&#8217;ve made it through this part of the installation. WordPress can now communicate with your database. If you are ready, time now to&hellip;'=>'ٹھیک ہے! آپ انسٹالیشن کا یہ حصہ مکمل کر چکے ہیں، WordPress آپ کے ڈیٹا بیس کے ساتھ رابطہ کر سکتا ہے، اگر آپ تیار ہیں، یہ وقت ہے۔۔۔','Denied: %s'=>'تردید: %s','Repeat New Password'=>'نیا پاسورڈ دہرائیں','%s post not updated, somebody is editing it.'=>'%s پوسٹ کی اپڈیٹ نہیں ہو سکی، کوئی اور ترمیم کر رہا ہے۔ ' . "\0" . '%s پوسٹوں کی اپڈیٹ نہیں ہو سکی، کوئی اور ترمیم کر رہا ہے۔ ','%s post permanently deleted.'=>'%s پوسٹ مستقل طور پر حذف کر دی گئی۔' . "\0" . '%s پوسٹیں مستقل طور پر حذف کر دی گئیں۔','%s post moved to the Trash.'=>'%s پوسٹ ردی کی ٹوکری میں منتقل کر دی گئی۔' . "\0" . '%s پوسٹیں ردی کی ٹوکری میں منتقل کر دی گئیں۔','%s post restored from the Trash.'=>'%s پوسٹ ردی کی ٹوکری سے بحال کر دی گئی۔' . "\0" . '%s پوسٹیں ردی کی ٹوکری سے بحال کر دی گئی۔','%s page updated.'=>'%s صفحہ اپڈیٹ کر دیا گیا ہے۔' . "\0" . '%s صفحات کو اپڈیٹ کر دیئے گئے ہیں۔','%s page not updated, somebody is editing it.'=>'%s صفحہ کی تجدید نہیں ہو سکی، کوئی اور ترمیم کر رہا ہے۔' . "\0" . '%s صفحات کی تجدید نہیں ہو سکی، کوئی اور ان میں ترمیم کر رہا ہے۔','%s page permanently deleted.'=>'%s صفحہ مستقل طور پر حذف کر دیا گیا۔' . "\0" . '%s صفحات مستقل طور پر حذف کر دئیے گئے۔','%s page moved to the Trash.'=>'%s صفحہ ردی کی ٹوکری میں منتقل کر دیا گیا ہے۔' . "\0" . '%s صفحات ردی کی ٹوکری میں منتقل کر دیئے گئے ہیں۔','%s page restored from the Trash.'=>'%s صفحہ ردی کی ٹوکری سے بحال کر دیا گیا۔' . "\0" . '%s صفحات ردی کی ٹوکری سے بحال کر دئیے گئے۔','Comment must be manually approved'=>'تبصرہ کی دستی تصدیق ضروری ہے۔','Thank you for creating with <a href="%s">WordPress</a>.'=>'<a href="%s">WordPress</a> سے بنانے کے لیے آپ کا شکریہ۔','https://wordpress.org/support/forum/how-to-and-troubleshooting'=>'https://wordpress.org/support/forum/how-to-and-troubleshooting','Add Themes'=>'تھیمز شامل کریں','Search Themes'=>'تھیمز تلاش کریں','Search themes...'=>'تھیمز تلاش کریں۔۔۔۔','themeDetails &amp; Preview'=>'تفصیلات اور پیش منظر','<strong>Delete</strong> brings you to the Delete Users screen for confirmation, where you can permanently remove a user from your site and delete their content. You can also delete multiple users at once by using Bulk Actions.'=>'حذف آپ کو صارف کو حذف کرنے کی اسکرین پر لے جاتا ہے جہاں آپ ہمیشہ کے لیے صارف اور اس کے مواد  کو اپنی سائٹ سے حذف کر سکتے ہیں۔ آپ ایک دفعہ ہی ایک سے زیادہ صارفین کو اجتماعی ایکشنز سے بھی حذف کر سکتے ہیں۔','What should be done with content owned by this user?'=>'اس صارف کے مواد کے ساتھ کیا کیا جائے؟','What should be done with content owned by these users?'=>'ان صارفین کے مواد کے ساتھ کیا کیا جائے؟','themesPopular'=>'مقبول','Filtering by:'=>'فلٹرنگ برائے:','Alternately, you can browse the themes that are Featured, Popular, or Latest. When you find a theme you like, you can preview it or install it.'=>'متبادل طور پر، آپ  تهیمز ڈاؤن لوڈ کر سکتے ہیں، جو کہ فیچرڈ، مشہور یا تازہ ترین موضوعات کو براؤز کر سکتے ہیں۔ آپ کو اپنی پسند کی ایک تھیم کو تلاش کرتے ہیں، آپ اس کا پیش منظر دیکھ سکتے ہیں یا اسے انسٹال کر سکتے ہیں۔','You can Search for themes by keyword, author, or tag, or can get more specific and search by criteria listed in the feature filter.'=>'آپ تھیم کو بنیادی الفاظ ،مصنف،یا ٹیگ کے ذریعے تلاش کر سکتے ہیں یا فلٹر کے  استعمال سے مزید تخصیص کر سکتے ہیں۔','%s user deleted.'=>'%s صارف حذف کر دیا گیا۔' . "\0" . '%s صارفین حذف کر دئیے گئے۔','1 page not updated, somebody is editing it.'=>'1 صفحہ کی تجدید نہیں ہو سکی، کوئی اور ترمیم کر رہا ہے۔','1 post not updated, somebody is editing it.'=>'1 پوسٹ کی تجدید نہیں ہو سکی، کوئی اور ترمیم کر رہا ہے۔','Howdy ###USERNAME###,

You recently clicked the \'Delete Site\' link on your site and filled in a
form on that page.

If you really want to delete your site, click the link below. You will not
be asked to confirm again so only click this link if you are absolutely certain:
###URL_DELETE###

If you delete your site, please consider opening a new site here
some time in the future! (But remember your current site and username
are gone forever.)

Thanks for using the site,
Webmaster
