###SITE_NAME###','Add Plugins'=>'پلگ انز شامل کریں','Browse Plugins'=>'پلگ انز براؤز کریں','If you just want to get an idea of what&#8217;s available, you can browse Featured and Popular plugins by using the links above the plugins list. These sections rotate regularly.'=>'اگر آپ دیکھنا چاہتے ہیں کہ کیا دستیاب ہے آپ پلگ انز کے اوپر لنک سے مشھور اور نمایاں پلگ انز دیکھ سکتے ہیں۔ یہ حصے با قاعدگی سے تبدیل ہوتے رہتے ہیں۔','You are only logged in at this location.'=>'آپ صرف اس جگہ پر لاگ ان ہیں۔','Log Out Everywhere'=>'ہر جگہ سے لاگ آؤٹ کریں','Mystery Person'=>'پراسرار شخص','Comment status'=>'تبصرے کی حیثیت','In response to: %s'=>'تبصرہ برائے: %s','While you are editing your %1$s file, take a moment to make sure you have all 8 keys and that they are unique. You can generate these using the <a href="%2$s">WordPress.org secret key service</a>.'=>'جب آپ اپنی فائل %1$s کی ترمیم کر رہے ہوں تو اس بات کی یقین دہانی کر لیں کہ آپ کے پاس تمام 8 کیز موجود ہیں اور وہ سب کی سب منفرد ہوں۔ آپ یہ کیز <a href="%2$s">WordPress.org خفیہ کی سروس</a> کے ذریعے سے حاصل کر سکتے ہیں۔','You have specified this user for removal:'=>'آپ نے اس صارف کو حذف کرنے کا کہا ہے:','Log %s out of all locations.'=>'تمام مقامات سے %sلاگ آوٹ کریں۔','Did you lose your phone or leave your account logged in at a public computer? You can log out everywhere else, and stay logged in here.'=>'آپ کا فون گم ہو جائے یا آپ کے اکاؤنٹ عوامی کمپیوٹر پر لاگ ان چھوڑ دیا؟ آپ ہر جگہ اور لاگ آوٹ کر سکتے ہیں، اور یہاں لاگ ان رہ سکتے ہیں۔','Log Out Everywhere Else'=>'تمام جگہوں سے لاگ آؤٹ کریں','Sessions'=>'سیشنز','Account Management'=>'اکاؤنٹ کا انتظام','Generate Password'=>'پاسورڈ ترتیب دیں','commentPermalink:'=>'پرمالنک:','Submitted on: %s'=>'ارسال کیا گیا از: %s','You can view posts in a simple title list or with an excerpt using the Screen Options tab.'=>'آپ پوسٹوں کو سادہ عنوان کی فہرست میں یا اسکرین کے اختیارات کے ٹیب کا استعمال کرتے ہوئے ایک اقتباس کے ساتھ دیکھ سکتے ہیں۔','Content to export'=>'برآمد کرنے کا مواد','End date:'=>'تاریخ اختتام:','Filter themes list'=>'تھیمز کی فہرست فلٹر کریں','Themes list'=>'تھیمز کی فہرست','Filter users list'=>'صارفین کی فہرست کو فلٹر کریں','Users list navigation'=>'صارفین کی فہرست کی رہنمائی','Users list'=>'صارفین کی فہرست','One of the selected users is not a member of this site.'=>'منتخب شدہ صارفین میں کوئی ایک اس سائٹ کا رکن نہیں ہے۔','Check secret keys'=>'خفیہ کلیدیں چیک کریں','WordPress database repair'=>'WordPress ڈیٹا بیس کی مرمت','Before getting started'=>'شروع کرنے سے پہلے','Set up your database connection'=>'اپنے ڈیٹا بیس کنکشن کو قائم کریں','Successful database connection'=>'کامیاب ڈیٹا بیس کنکشن','Allow automatic database repair'=>'خود کار طریقے سے ڈیٹا بیس کی مرمت کی اجازت دیں','Database repair results'=>'ڈیٹا بیس کی مرمت کے نتائج','themesFavorites'=>'پسندیدہ','If you have marked themes as favorites on WordPress.org, you can browse them here.'=>'اگر آپ نے WordPress.org پر تھیمز کو پسندیدہ کے طور پر نشان زد کیا ہے، تو آپ انکو ادھر براؤز کر سکتے ہیں۔','We&#8217;re going to use this information to create a %s file.'=>'ہم یہ معلومات %s فائل بنانے کے لیے استمعال کرنیگے','Need more help? <a href="%s">We got it</a>.'=>'کیا مزید مدد کی ضرورت ہے؟<a href="%s">ہم کر سکتے ہیں</a>','You should be able to get this info from your web host, if %s doesn&#8217;t work.'=>' اگر %s  کام نہ کرے تو، یہ معلومات آپ کو اپنی ویب ہوسٹنگ کمپنی کی طرف سے حاصل کرنا چاہیے۔','You can create the %s file manually and paste the following text into it.'=>'آپ %s  کو بذات خود بنا سکتے ہیں اور اس میں مندرجہ ذیل متن پیسٹ کر سکتے ہیں۔','If for any reason this automatic file creation doesn&#8217;t work, don&#8217;t worry. All this does is fill in the database information to a configuration file. You may also simply open %1$s in a text editor, fill in your information, and save it as %2$s.'=>'اگر کسی وجہ سے خودکار فائل بننے کا عمل کامیاب نہیں ہو رہا تو پریشان مت ہوں۔ یہ خودکارعمل صرف کنفگریشن فائل میں ڈیٹابیس کی معلومات درج کرتا ہے۔ آپ یہ کرسکتے ہیں کہ %1$s کو کسی کوڈ یا ٹیکسٹ ایڈیٹر میں کھولیں، مطلوبہ معلومات درج کریں اور %2$s کے طور پر محفوظ کرلیں۔','Maintenance Releases'=>'بحالی اور مرمتی ریلیز','Security Releases'=>'سیکورٹی ریلیز','Maintenance and Security Releases'=>'دیکھ بھال اور سیکورٹی ریلیز','<strong>Version %s</strong> addressed one security issue.'=>'<strong>ورژن %s</strong> نے ایک سیکیورٹی کا مسئلہ حل کیا ہے۔','comment statusPending'=>'زیرالتوا','The name of the database you want to use with WordPress.'=>'ڈیٹا بیس کا نام جو آپ WordPress کے ساتھ استعمال کرنا چاہتے ہیں۔','Your database username.'=>'آپکے ڈیٹا بیس کا اسم رکنیت۔','Your database password.'=>'آپ کے ڈیٹا بیس کا پاسورڈ۔','Sorry, you are not allowed to delete that user.'=>'معاف کیجیے گا، آپ کو اس صارف کو حذف کرنے کی اجازت نہیں ہے۔','You can filter the list of posts by post status using the text links above the posts list to only show posts with that status. The default view is to show all posts.'=>'آپ پوسٹوں کو پوسٹ اسٹیٹس سے فلٹر کر سکتے ہیں، پوسٹس کے اوپر لنکس سے آپ صرف منتخب پوسٹیں دیکھ سکتے ہیں، عام طور یہ تمام پوسٹیں دکھاتا ہے۔','Sorry, you are not allowed to export the content of this site.'=>'معاف کیجیے گا، آپ کو اس ویب سائٹ کے مواد کو برآمد کرنے کی اجازت نہیں ہے۔','Sorry, you are not allowed to delete this site.'=>'معاف کیجیے گا، آپ کو اس سائٹ کو حذف کرنے کی اجازت نہیں ہے۔','<strong>Error</strong>: "Table Prefix" is invalid.'=>'<strong>خرابی</strong>: "ٹیبل کا سابقہ" غیر موثر ہے۔','The Theme Installer screen requires JavaScript.'=>'تھیم انسٹالر اسکرین کو جاوا اسکرپٹ کی ضرورت ہے۔','Confirm use of potentially weak password'=>'ممکنہ طور پر کمزور پاسورڈ کے استعمال کی تصدیق کیجیے','Sorry, you are not allowed to remove users.'=>'معاف کیجیے گا، آپ کو صارفین حذف کرنے کی اجازت نہیں ہے۔','Plugins hook into WordPress to extend its functionality with custom features. Plugins are developed independently from the core WordPress application by thousands of developers all over the world. All plugins in the official <a href="%s">WordPress Plugin Directory</a> are compatible with the license WordPress uses.'=>'WordPress پلگ انز کے ساتھ شامل ہو کر اس کی خصوصیات بڑھا دیتا ہے۔ دنیا بھر میں ہزاروں ڈیولپرز پلگ ان تیار کرتے ہیں۔ <a href="%s">WordPress پلگ ان ڈائریکٹری</a> میں موجود سب پلگ ان WordPress کے ساتھ استعمال کے اہل ہیں۔','You can find new plugins to install by searching or browsing the directory right here in your own Plugins section.'=>'آپ نئے پلگ انز تلاش کر کے انسٹال کر سکتے ہیں، یا اپنے پلگ ان کے حصے میں پوری ڈائریکٹری کا جائزہ لیں۔','Expand Sidebar'=>'سائیڈ بار کو وسیع کریں','Select one or more Theme features to filter by'=>'تھیم کی ایک یا ایک سے زیادہ خصوصیات کا انتخاب کریں جن کے لحاظ سے آپ فلٹر کرنا چاہتے ہیں','Clear current filters'=>'موجودہ فلٹرز ختم کریں','Edit Filters'=>'فلٹرز میں ترمیم کریں','ID #%1$s: %2$s <strong>Sorry, you are not allowed to remove this user.</strong>'=>'ID #%1$s: %2$s <strong> معاف کیجیے گا، آپ کے پاس اس صارف کو حذف کرنے کی اجازت نہیں ہے-</strong>','Sorry, you are not allowed to delete users.'=>'معاف کیجیے گا، آپ کے پاس صارفین کو حذف کرنے کے اختیارات نہیں ہیں۔','<strong>Error</strong>: "Table Prefix" must not be empty.'=>'<strong>خرابی</strong>: "Table Prefix" خالی نہیں ہونا چاہیے۔','Run the installation'=>'انسٹالیشن چلائیں','Add Data Export Request'=>'ڈیٹا ایکسپورٹ کی درخواست شامل کریں','Privacy Policy page setting updated successfully. Remember to <a href="%s">update your menus</a>!'=>'پرائیویسی پالیسی کا صفحہ تبدیل ہوگیا ہے۔ اپنے <a href="%s">مینیو اپڈیٹ کرنا</a> مت بھولیے گا۔','Unable to create a Privacy Policy page.'=>' پرائیویسی پالیسی کا صفہ نہیں بنا سکے۔','The currently selected Privacy Policy page does not exist. Please create or select a new page.'=>'فی الحال منتخب کردہ پرائیویسی پالیسی کا صفحہ موجود نہیں ہے۔ براہ مہربانی نیا صفحہ بنائیں یا منتخب کریں۔','The currently selected Privacy Policy page is in the Trash. Please create or select a new Privacy Policy page or <a href="%s">restore the current page</a>.'=>'موجودہ منتخب کردہ پرائیویسی پالیسی کا صفحہ ردی کی ٹوکری میں ہے۔ براہ مہربانی یا تو نیا صفحہ بنائیں یا منتخب کریں یا <a href="%s">موجودہ صفحہ دوبارہ بحال کریں</a>۔','If you already have a Privacy Policy page, please select it below. If not, please create one.'=>'اگر آپ نے پہلے سے پرائیویسی پالیسی کا صفحہ بنایا ہوا ہے تو اس کو منتخب کریں۔ نہیں تو ایک نیا بنائیں۔','The new page will include help and suggestions for your Privacy Policy.'=>'نیا صفحہ آپ کی پرائیویسی پالیسی کے لیے مدد اور تجاویز شامل کرے گا۔','However, it is your responsibility to use those resources correctly, to provide the information that your Privacy Policy requires, and to keep that information current and accurate.'=>'تاہم، یہ آپ کی ذمہ داری ہے کہ ان وسائل کو صحیح طریقے سے استعمال کریں، اس معلومات کو فراہم کرنا جو آپ کی پرائیویسی پالیسی کی ضرورت ہیں اور ان معلومات کو صحیح اور درست رکھیں۔','We would also suggest reviewing your Privacy Policy from time to time, especially after installing or updating any themes or plugins. There may be changes or new suggested information for you to consider adding to your policy.'=>'ہم اس امر کا بھی مشورہ دیتے ہیں کہ آپ وقتاً فوقتاً اپنی پرائیویسی پالیسی کو دیکھتے رہیں، خصوصاً کسی بھی تھیم یا پلگ ان کو انسٹال کرنے یا اپڈیٹ کرنے کے بعد۔ آپ کی پالیسی میں تبدیلی یا تجدید کردہ نئی معلومات شامل ہوسکتی ہیں۔','<a href="%1$s">Edit</a> or <a href="%2$s">view</a> your Privacy Policy page content.'=>'اپنے  پرائیویسی پالیسی کے صفحے کے مواد کو <a href="%1$s">تبدیل کریں</a>  یا <a href="%2$s">ملاحظہ کریں</a>۔','Change your Privacy Policy page'=>'اپنی رازداری کی پالیسی کا صفحہ تبدیل کریں','Select a Privacy Policy page'=>'پرائیویسی پالیسی کا صفحہ منتخب کریں','Use This Page'=>'اس صفحے کو استمال کریں','Create New Page'=>'نیا صفحہ بنائیں','Sorry, you are not allowed to export personal data on this site.'=>'معاف کیجیے گا، آپ کو اس ویب سائٹ پر ذاتی ڈیٹا حاصل کرنے کی اجازت نہیں ہے۔','As a website owner, you may need to follow national or international privacy laws. For example, you may need to create and display a Privacy Policy.'=>'ویب سائٹ کے مالک ہونے کی حیثیت سے، آپ کو پر