rmation to fill out your profile. This may be shown publicly.'=>'اپنی پروفائل کو مکمل کرنے کے لیے تھوڑی بہت سوانح عمری کی معلومات دیں۔ ہو سکتا ھے یہ عوامی طور پہ شائع ہو۔','[%s] Joining Confirmation'=>'[%s] شمولیت کی تصدیق','Invitation email sent to new user. A confirmation link must be clicked before their account is created.'=>'دعوتی ای میل کو نئے صارف کو بھیجی دی گئی۔ اکاؤنٹ کے بنانے کے لیے ایک تصدیقی لنک پر کلک کیا جانا ضروری ہے۔','Skip Confirmation Email'=>'تصدیقی ای میل کو چھوڑیں','Inactive Widgets'=>'غیرفعال ویجٹس','Widget %s'=>'%s ویجٹس','Select both the sidebar for this widget and the position of the widget in that sidebar.'=>'اس ویجٹ کی دونوں سائیڈ بار منتخب کریں اور اس سائیڈ بار میں ویجٹ کی جگہ منتخب کریں۔','Position'=>'مقام','Save Widget'=>'ویجٹ کو محفوظ کریں','Error in displaying the widget settings form.'=>'ویجٹ کی ترتیبات کا فارم دکھانے میں مسئلہ درپیش ہے۔','Available Widgets'=>'دستیاب ویجٹس','Drag widgets here to remove them from the sidebar but keep their settings.'=>'سائیڈ بار سے حذف کرنے کے لیے ویجٹ کو یہاں ڈریگ کریں مگر اس کی ترتیبات موجود رہینگی۔','This comment is already approved.'=>'یہ تبصرہ پہلے ہی سے منظور شدہ ہے۔','Comments on &#8220;%s&#8221;'=>'&#8220;%s&#8221; پر تبصرے','You cannot install because <a href="%1$s">WordPress %2$s</a> requires PHP version %3$s or higher and MySQL version %4$s or higher. You are running PHP version %5$s and MySQL version %6$s.'=>'آپ انسٹال نہیں کر سکتے کیونکہ <a href="%1$s">WordPress %2$s</a> کا پی ایچ پی ورژن %3$s یا اس سے جدید اور MySQL ورژن %4$s یا اس سے جدید کی ضرورت ہے۔ آپ پی ایچ پی ورژن %5$s اور MySQL ورژن %6$s چلا رہے ہیں۔','You are about to remove the following plugin:'=>'آپ مندرجہ ذیل پلگ ان کوحذف کر رہے ہیں:','Delete Plugins'=>'پلگ انز حذف کریں','Delete Plugin'=>'پلگ ان حذف کریں','Are you sure you want to delete these files and data?'=>'کیا آپ کو یقین ہے کہ آپ ان فائلز اور اعدادوشمار کو حذف کرنا چاہتے ہیں؟','Yes, delete these files and data'=>'جی ہاں، ان فائلز اورڈیٹا کو حذف کریں','This comment is already in the Trash.'=>'یہ تبصرہ پہلے ہی ردی کی ٹوکری میں ہے۔','View Trash'=>'ردی کی ٹوکری دیکھیں','This comment is already marked as spam.'=>'یہ تبصرہ پہلے سے ہی غیر متعلقہ قرار دیا گیا۔','Please enter a valid menu name.'=>'براہ مہربانی درست مینو نام درج کریں۔','&mdash; No role for this site &mdash;'=>'&mdash; اس سائٹ کے لیے کوئی اصول نہیں &mdash;','Welcome to your WordPress Dashboard! This is the screen you will see when you log in to your site, and gives you access to all the site management features of WordPress. You can get help for any screen by clicking the Help tab above the screen title.'=>'WordPress ڈیش بورڈ میں خوش آمدید! یہ وہ اسکرین ہے جب آپ اپنی سائٹ پر لاگ ان کریں گے تو آپ کو سائٹ کی تمام انتظامی خصوصیات کی رسائی دے گی۔ آپ اسکرین کے عنوان کے اوپر ہیلپ ٹیب دبا کرکسی بھی اسکرین کے لیے مد د حاصل کر سکتے ہیں۔','WordPress Updates'=>'WordPress اپڈیٹس','Update WordPress'=>'WordPress اپڈیٹ کریں','Update Plugins'=>'پلگ انز اپڈیٹ کریں','You cannot update because <a href="%1$s">WordPress %2$s</a> requires PHP version %3$s or higher and MySQL version %4$s or higher. You are running PHP version %5$s and MySQL version %6$s.'=>'آپ اپڈیٹ نہیں کرسکتے کیونکہ <a href="%1$s">WordPress %2$s</a> کا پی ایچ پی ورژن %3$s یا اس سے جدید اور MySQL ورژن %4$s یا اس سے جدید کی ضرورت ہے۔ آپ پی ایچ پی ورژن %5$s اور MySQL ورژن %6$s چلا رہے ہیں۔','Get Shortlink'=>'مختصر لنک حاصل کریں','Save Menu'=>'مینو محفوظ کریں','That user is already a member of this site.'=>'یہ صارف پہلے سے ہی آپ کی سائٹ کا رکن ہے۔','Invitation email sent to user. A confirmation link must be clicked for them to be added to your site.'=>'صارف کو دعوت نامے کی ای میل بھیج دی گئی۔ جب وہ تصدیقی لنک پر کلک کریں گے تو سائٹ میں شامل ہو جائیں گے۔','You can set maximum sizes for images inserted into your written content; you can also insert an image as Full Size.'=>'آپ اپنے تحریری  مواد میں تصویر کی زیادہ سے زیادہ مقدار دے سکتے ہیں۔ آپ تصویر کو پورے سائز میں بھی ڈال سکتے ہیں۔','The following plugins have new versions available. Check the ones you want to update and then click &#8220;Update Plugins&#8221;.'=>'درج ذیل پلگ اِن کا نیا ورژن موجود ہے۔ جو آپ اپڈیٹ کرنا چاہتے ہیں اُن کو چیک کریں اور &#8220;پلگ اِن اپڈیٹ کریں&#8221; پر کلک کریں۔','The menu item has been successfully deleted.'=>'مینو آئٹم کامیابی سے حذف کر دیا گیا۔','Error in restoring from Trash.'=>'ردی کی ٹوکری سے واپس بحال کرتے ہوئے خرابی۔','Usernames cannot be changed.'=>'اسماء رکنیت بدلے نہیں جا سکتے۔','Sorry, you are not allowed to restore this item from the Trash.'=>'معاف کیجیے گا، آپ کو اس آئٹم کو ردی کی ٹوکری سے بحال کرنے کی اجازت نہیں ہےَ۔','Your theme does not support navigation menus or widgets.'=>'آپ کی تھیم نیویگیشن مینو یا ویجٹ کے لیے نہیں بنی۔','Error in moving to Trash.'=>'ردی کی ٹوکری میں ڈالتے ہوئے خرابی۔','Page saved.'=>'صفحہ محفوظ۔ کر دیا گیا۔','The menu has been successfully deleted.'=>'مینو کامیابی سے حذف کر دیا گیا۔','Grant this user super admin privileges for the Network.'=>'نیٹ ورک کے لیے اس صارف  کو سپر ایڈمن کی مراعات دیں۔','Important:'=>'اہم:','This user has super admin privileges.'=>'اس صارف کے پاس ایڈمن اختیارات ہیں۔','The following themes have new versions available. Check the ones you want to update and then click &#8220;Update Themes&#8221;.'=>'مندرجہ ذیل تھمیز کے نئے ورژن دستیاب ہیں۔ جن کو آپ اپڈیٹ کرنا چاہتے ہیں ان کو منتخب کریں اور &#8220;تھیمز اپڈیٹ کریں&#8221; دبائیں۔','%s comment restored from the Trash.'=>'%s تبصرہ ردی کی ٹوکری سے دوبارہ بحال کر دیا گیا۔' . "\0" . '%s تبصرے ردی کی ٹوکری سے دوبارہ بحال کر دیئے گئے۔','%s comment moved to the Trash.'=>'%s  تبصرہ ردی کی ٹوکری میں منتقل کر دیا گیا۔' . "\0" . '%s تبصرے ردی کی ٹوکری میں منتقل کر دیئے گئے۔','Sorry, you are not allowed to move this item to the Trash.'=>'معاف کیجیے گا، آپ کو اس آئٹم کو ردی کی ٹوکری میں منتقل کرنے کی اجازت نہیں ہے۔','Error in deleting.'=>'حذف کرنے میں خرابی۔','If you have posts or comments in another system, WordPress can import those into this site. To get started, choose a system to import from below:'=>'اگر آپکے پوسٹ یا تبصرے دوسرے سسٹم پر ہوں تو WordPress آپ کے لیے یہاں درآمد کر سکتا ہے .  شروع کرنے کے لیے  نیچے فہرست سے سسٹم کا انتخاب کریں:','Search Installed Plugins'=>'انسٹال شدہ پلگ انز تلاش کریں','<strong>%s</strong> &mdash; This allows you to associate an image with your post without inserting it. This is usually useful only if your theme makes use of the image as a post thumbnail on the home page, a custom header, etc.'=>'<strong>%s</strong> &mdash; یہ آپ کو آپکی پوسٹ کے ساتھ بغیر اپ لوڈ کیے تصویر منسلک کرنے کی اجازت دیتا ہے۔ عمومی طور پر یہ صرف اس صورت میں کارآمد ہوتا ہے اگر آپ کا تھیم اس تصویر کا استعمال اپ کے سرورق پر پوسٹ تھمب نیل کے طور پر یا مرضی کی تصویر وغیرہ کے طور پر استعمال ہو۔','You have version %1$s installed. Update to %2$s.'=>'آپ کے پاس %1$s  ورژن انسٹال ہے۔ اسے %2$s پر اپڈیٹ کریں۔','Choose a plugin to edit from the dropdown menu and click the Select button. Click once on any file name to load it in the editor, and make your changes. Don&#8217;t forget to save your changes (Update File) when you&#8217;re finished.'=>'کسی پلگ ان میں ترمیم کرنے کے لیے ڈراپ ڈاؤن مینو سے اس کا انتخاب کریں اور \'منتخب کریں\' کے بٹن پر کلک کریں۔ کسی بھی فائل کو لوڈ کرنے کے لیے ایک بار اس کے نام پر کلک کریں اور اس میں تبدیلیاں کر لیں۔ اور تبدیلیاں کرنے کے بعد اپنی فائل کو اپڈیٹ کرنا مت بھولیں۔','Widgets may be used multiple times. You can give each widget a title, to display on your site, but it&#8217;s not required.'=>'ویجٹ ایک سے زیادہ دفعہ استمعال ہو سکتا ہے، آپ ہر ویجٹ سائٹ پر دکھانے کے لیے عنوان دے سکتے ہیں، مگر یہ ضروری نہیں۔','Contributors can write and manage their posts but not publish posts or upload media files.'=>'شراکت دار اپنی پوسٹیں لکھ  سکتے ہیں لیکن انکو شائع نہیں کر سکتے اور میڈیا فائلز اپلوڈ نہیں کر سکتے۔','Administrators have access to all the administration features.'=>'منتظم کو تمام انتظامی خصوصیات تک رسائی حاصل ہوتی ہے۔','Enabling Accessibility Mode, via Screen Options, allows you to use Add and Edit buttons instead of using drag and drop.'=>'اسکرین اختیارات کے ذریعے سے رسائی کے آپشن کو فعال بنا کر آپ ڈریگ اور ڈراپ کی بجائے شامل اور ترمیم کا بٹن استعمال کر سکتے ہیں۔','<strong>Title</strong> &mdash; Enter a title for your post. After you enter a title, you&#8217;ll see the permalink below, which you can edit.'=>'<strong>عنوان</strong> اپنی پوسٹ کو عنوان دیں، عنوان دینے کے بعد آپ نیچے پرمالنک دیکھ سکیں گے جس میں آپ ترمیم کر سکتے ہیں۔','While your site is being updated, it will be in maintenance mode. As soon as your updates are complete, your site will return to normal.'=>'آپ کی ویب سائٹ کی تجدید کی جا رہی ہے، اور یہ تعمیری موڈ میں ہو گی۔ جیسے ہی آپ کی تجدید مکمل یو گی، آپ کی ویب سائٹ معمول پر واپس آ جائے گی۔','Your theme supports one menu. Select which menu you would like to use.'=>'آپکی تھیم صرف ایک مینو کو سپورٹ کرتی ہے۔ آپ کونسا مینو چننا پسند کریں گے۔','Your theme supports %s menu. Select which menu appears in each location.'=>'آپکی تھیم %s مینو کو سپورٹ کرتی ہے۔ منتخب کیجیے کہ کونسا مینو کہاں نظر آئے۔' . "\0" . 'آپکی تھیم %s مینو کو سپورٹ کرتی ہے۔ منتخب کیجیے کہ کونسا مینو کہاں نظر آئے۔','Widgets are independent sections of content that can be placed into any widgetized area provided by your theme (commonly called sidebars). To populate your sidebars/widget areas with individual widgets, drag and drop the title bars into the desired area. By default, only the first widget area is expanded. To populate additional widget areas, click on their title bars to expand them.'=>'ویجٹس مواد کا وہ حصہ ہوتے ہیں جو کسی پر منحصر نہیں ہوتے۔ ان کو آپ کے تھیم کی طرف سے مخصوص کیے گئے کسی بھی حصے میں استعمال کیا جا سکتا ہے، یہ حصے عموما سائیڈبار کہلاتے ہیں۔ اپنی سائیڈبار میں ویجٹس استعمال کرنے کے لیے ٹائٹل پارکو ڈریگ کر کے سائیڈ بار میں ڈراپ کریں۔ پہلے سے طے شدہ طریقے کے مطابق، صرف پہلے ویجٹ کا ایریا کھل جاتا ہے۔ دوسرے ویجٹس کے ساتھ ایسا کرنے کے لیے ان کی ٹائٹل بار پر کلک کرنا پڑتا ہے۔','<strong>Discussion</strong> &mdash; You can turn comments and pings on or off, and if there are comments on the post, you can see them here and moderate them.'=>'<strong>بحث</strong> آپ تبصرے اور پِنگز بند یا جاری کر سکتے ہیں، اور اگر پوسٹ پر تبصرے موجود ہیں، آپ انکو یہاں دیکھ بھی سکتے ہیں اور منظور بھی کرسکتے ہیں۔','Most of the time, plugins play nicely with the core of WordPress and with other plugins. Sometimes, though, a plugin&#8217;s code will get in the way of another plugin, causing compatibility issues. If your site starts doing strange things, this may be the problem. Try deactivating all your plugins and re-activating them in various combinations until you isolate which one(s) caused the issue.'=>'اکثراوقات پلگ ان WordPress کی کور اور دوسری پلگ ان کے ساتھ مل کر بہت اچھی پرفارمنس دیتی ہیں۔ مگر بعض اوقات ایسا ہوتا ہے کہ کسی پلگ ان کا کوڈ دوسرے پلگ ان کے کوڈ کے لحاظ سے موزوں نہیں ہوتا اور ہمیں بہت سے مسائل کا سامنا کرنا پڑتا ہے۔ آپ کی سائٹ اگر نارمل طورپر کام نہیں کر رہی تو اس کی ایک وجہ یہ ہو سکتی ہے۔ اس صورت میں اپنی تمام پلگ ان کو غیر موثر بنائیں اور پھر باری باری موثر کرتے جائیں جب تک کہ مسئلہ حل نہیں ہو جاتا۔','You can use the plugin editor to make changes to any of your plugins&#8217; individual PHP files. Be aware that if you make changes, plugins updates will overwrite your customizations.'=>'آپ کسی بھی پلگ ان کی انفرادی پی ایچ پی فائلز میں تبدیلی کرنے کے لیے پلگ ان ایڈیٹر کو استعمال کرسکتے ہیں۔ خیال رکھیے گا اگر آپ  پلگ ان کے کوڈ میں تبدیلی کرتے ہیں تو اس پلگ ان کی اپڈیٹ آپ کی تبدیلیوں کو ضائع کر دے گی۔','Your plugins are all up to date.'=>'آپ کے تمام پلگ انز اپڈیٹڈ ہیں۔','You have the latest version of WordPress.'=>'آپ WordPress کا تازہ ترین ورژن رکھتے ہیں۔','Your themes are all up to date.'=>'آپ کے تمام تھیمز اپڈیٹڈ ہیں۔','<strong>Template</strong> &mdash; Some themes have custom templates you can use for certain pages that might have additional features or custom layouts. If so, you&#8217;ll see them in this dropdown menu.'=>'<strong>ٹمپلیٹ</strong> کچھ تھیمز میں کسٹم ٹمپلیٹ ہوتے ہیں جو آپ مختلف صفحات کے لئے استمعال کر سکتے ہیں جس میں مختلف خصوصیات ہو سکتے ہیں یا الگ لے آوٹ ہو سکتا ہے۔ آپ اس کو اس ڈراپ ڈاؤن میں دیکھ سکتے ہیں۔','<strong>Parent</strong> &mdash; You can arrange your pages in hierarchies. For example, you could have an &#8220;About&#8221; page that has &#8220;Life Story&#8221; and &#8220;My Dog&#8221; pages under it. There are no limits to how many levels you can nest pages.'=>'<strong>بنیادی</strong> &mdash; آپ اپنے صفحات کو یہاں ترتیب دے سکتے ہیں۔ مثال کے طور پر آپ کا ایک &#8220;ہمارے متعلق&#8221; صفحہ ہوسکتا ہے جس میں  &#8220;آپ بیتی&#8221; اور &#8220;میرا کتا&#8221; کے ذیلی صفحات ہو سکتے ہیں۔ اس بات پر کوئی پابندی نہیں ہے کہ آپ کے کتنے ذیلی صفحات ہوں۔','An updated version of WordPress is available.'=>'WordPress کا اپڈیٹڈ ورژن دستیاب ہے۔','This screen lists links to plugins to import data from blogging/content management platforms. Choose the platform you want to import from, and click Install Now when you are prompted in the popup window. If your platform is not listed, click the link to search the plugin directory for other importer plugins to see if there is one for your platform.'=>'اس اسکرین پر ان تمام پلگ ان کے لنک موجود ہیں جن کی مدد سے آپ دوسرے بلاگنگ، یا سی ایم اس سے ڈیٹا لے سکتے ہیں۔ اس پلیٹ فارم کا انتخاب کریں جس سے آپ ڈیٹا لینا چاہتے ہیں، اور انسٹال پر کلک کریں۔ اگر آپ کے پلیٹ فارم کا نام یہاں موجود نہیں ہے تو، اس کا نام لکھ کر تلاش کریں اور دیکھیں کہ اگر کوئی اور پلگ ان اس کام کے لیے موجود ہے۔','The Optional fields let you customize the &#8220;category&#8221; and &#8220;tag&#8221; base names that will appear in archive URLs. For example, the page listing all posts in the &#8220;Uncategorized&#8221; category could be <code>/topics/uncategorized</code> instead of <code>/category/uncategorized</code>.'=>'اختیاری فیلڈ کے ذریعے سے آپ  &#8220;زمرے&#8221; اور &#8220;ٹیگ&#8221; کے بیس نیم تبدیل کر سکتے ہیں جو کہ آرکائیو کے لنکس میں ظاہر ہو تے ہیں۔ مثآل کے طور پر وہ صفحہ جس پر  &#8220;کوئی زمرہ نہیں &#8221; زمرے کی تمام پوسٹیں ہوں وہ <code>/category/uncategorized</code> کی بجائے  <code>/topics/uncategorized</code> ہو سکتا ہے۔','You can add or edit links on this screen by entering information in each of the boxes. Only the link&#8217;s web address and name (the text you want to display on your site as the link) are required fields.'=>'آپ اس اسکرین پر دیئے گئے ہر باکس میں معلومات ڈال کر نئے لنک شامل اور موجودہ کو تبدیل کر سکتے ہیں۔ ضروری فیلڈز صرف لنک کا ویب ایڈریس اور نام (الفاظ جو آپ لنک کے طور پر اپنی سائٹ پر دیکھانا چاہتے ہیں) ہیں۔','The boxes for link name, web address, and description have fixed positions, while the others may be repositioned using drag and drop. You can also hide boxes you don&#8217;t use in the Screen Options tab, or minimize boxes by clicking on the title bar of the box.'=>'لنک کے نام، ویب ایڈریس اور وضاحتی عبارات کی پوزیشن فکسڈ ہوتی ہے جبکہ دیگر عناصر کی جگہ ڈریگ اور ڈراپ کے عمل کے تحت بدلی جا سکتی ہے۔ آپ اسکرین اختیارات کے ٹیب سے آپ کے لیے غیر ضروری عناصر کو ختم کر سکتے ہیں یا ہر خانے کے اوپری حصہ پر کلک کر کے اس کے حجم کو محدود سکتے ہیں۔','Your username cannot be changed, but you can use other fields to enter your real name or a nickname, and change which name to display on your posts.'=>'آپ کا اسم رکنیت تبدیل نہیں ہو سکتا، لیکن آپ دیگر خانوں میں اپنا اصلی نام، عرفیت اور جو نام آپ اپنی پوسٹوں میں دکھانا چاہتے ہیں، تبدیل کر سکتے ہیں۔','Required fields are indicated; the rest are optional. Profile information will only be displayed if your theme is set up to do so.'=>'ضروری خانوں کی نشاندہی کی گئی ہے؛ باقی تمام اختیاری ہے، پروفائل کی معلومات جبھی دکھائی جائیگی اگر آپ کی تھیم میں یہ صلاحیت موجود ہو۔','Remember to click the Update Profile button when you are finished.'=>'ختم ہونے پر اپڈیٹ پروفائل بٹن پر کلک کرنا یاد رکھیں۔','Editors can publish posts, manage posts as well as manage other people&#8217;s posts, etc.'=>'ایڈیٹر پوسٹ کو شائع کر سکتے ہیں، اپنے اور دوسرے لوگوں کی پوسٹوں کو منظم کر سکتے ہیں۔','If you want to remove the widget but save its setting for possible future use, just drag it into the Inactive Widgets area. You can add them back anytime from there. This is especially helpful when you switch to a theme with fewer or different widget areas.'=>'اگر آپ کوئی ویجٹ حذف کرتے ہیں مگر اس کی ترتیبات محفوظ کرنا چاہتے ہیں تو اس کو محض غیر فعال ویجٹ کے ایریا میں ڈریگ کریں۔ آپ کسی بھی وقت ان کو وہاں سے واپس شامل کر سکتے ہیں۔ یہ خاص طور پر اس وقت مفید ہوتا ہے جب آپ ایسا تھیم لاگو کرتے ہیں جس میں کم ویجٹ کی جگہ ہو۔','When you assign multiple categories or tags to a post, only one can show up in the permalink: the lowest numbered category. This applies if your custom structure includes %1$s or %2$s.'=>'جب آپ کسی پوسٹ کو ایک سے زائد ٹیگ یا زمرے تفویض کرتے ہیں تو پرمالنک میں صرف ایک ہی ظاہر ہوتی ہے: سب سے کم نمبر والا زمرہ۔ یہ اسی صورت ممکن ہوتا ہے جب آپ کی مرضی کے اسٹرکچر میں %1$s یا %2$s موجود ہو۔','Your profile contains information about you (your &#8220;account&#8221;) as well as some personal options related to using WordPress.'=>'آپ کی پروفائل میں آپ کے بارے (your &#8220;account&#8221;) میں معلومات اور WordPress کے استعمال کے متعلق چند ذاتی اختیار موجود ہیں۔','<strong>Order</strong> &mdash; Pages are usually ordered alphabetically, but you can choose your own order by entering a number (1 for first, etc.) in this field.'=>'صفحات کو حروف تہجی کی بنیاد پر <strong>ترتیب </strong> کیا جاتا ہے، لیکن آپ اس خانے میں نمبر (پہلے کے لیے 1) دے کر اپنی مرضی کی ترتیب دے سکتے ہیں۔','<strong>Send Trackbacks</strong> &mdash; Trackbacks are a way to notify legacy blog systems that you&#8217;ve linked to them. Enter the URL(s) you want to send trackbacks. If you link to other WordPress sites they&#8217;ll be notified automatically using pingbacks, and this field is unnecessary.'=>'<strong>ٹریک بیکس بھیجنا</strong> &mdash; ٹریک بیکس ایک طریقہ ہے جس کے ذریعے سے آپ اس بلاگ کو نوٹیفیکیشن بھیج سکتے ہیں جس کا لنک آپ نے اپنی پوسٹ یا سائٹ میں کہیں استعمال کیا ہے۔ وہ لنک درج کریں جن کو آپ ٹریک بیکس بھیجنا چاہتے ہیں۔ اگر آپ کسی اور WordPress بلاگ کو لنک کرنا چاہتے ہیں تو ان کو پنگ بیک کے ذریعے سے خود بخود اطلاع چلی جائے گی اور اس خانے کی کوئی ضرورت نہیں۔','If you pick an option other than Plain, your general URL path with structure tags (terms surrounded by %s) will also appear in the custom structure field and your path can be further modified there.'=>'اگر آپ پلین کے علاوہ کوئی اور اختیار منتخب کریں گے توآپ کے لنک کا جنرل پاتھ اسٹریکچر ٹیگ کے ساتھ (ٹرمز %s سے گھری ہوئی ہوںگی) کسٹم اسٹریکچر کے خانے میں ظاہر ہو گا اور آپ کا پاتھ مزید وہاں پر تبدیل کیا جا سکتا ہے۔','You can also create posts with the <a href="%s">Press This bookmarklet</a>.'=>'آپ اس کے ساتھ پوسٹ بھی بنا سکتے ہیں <a href="%s">اس بک مارکلیٹ کو دبائیں</a>۔','Many themes show some sidebar widgets by default until you edit your sidebars, but they are not automatically displayed in your sidebar management tool. After you make your first widget change, you can re-add the default widgets by adding them from the Available Widgets area.'=>'بہت ساری تھیم طےشدہ طور پر سائیڈ بار کے ویجٹ ظاہر کرتی ہیں جب تک آپ اپنی سائیڈ بارمیں ترمیم نہیں کرتے، مگر یہ خود بخود سائیڈ بار مینیجمنٹ ٹول میں ظاہر نہیں ہوتے۔ جب آپ اپنی ویجٹ میں پہلی بار تبدیلی کرتے ہیں، تو آپ اپنے طےشدہ ویجٹ کو "موجودہ ویجٹ ایریا" سے دوبارہ شامل کر کے استعمال کر سکتے ہیں۔','XFN stands for <a href="http://gmpg.org/xfn/">XHTML Friends Network</a>, which is optional. WordPress allows the generation of XFN attributes to show how you are related to the authors/owners of the site to which you are linking.'=>'XFN کا مطلب ہے <a href="http://gmpg.org/xfn/">XHTML Friends Network</a>، جو کہ اختیاری ہے۔  WordPress آپ کو XFN ایٹریبیوٹس بنانے کی اجازت دیتا ہے جو کہ یہ ظاہر کرتا ہے کہ آپ جس سائٹ کو لنک کر رہے ہیں وہ اس سے کس طرح منسلک ہے۔','<strong>Please Note:</strong> Any customizations you have made to theme files will be lost. Please consider using <a href="%s">child themes</a> for modifications.'=>'<strong>توجہ فرمائیں:</strong> آپ کے کوئی بھی کیے گئے ردوبدل کھو جائیں گے۔ براہ مہربانی اپنی تبدیلیوں کے لیے <a href="%s">چائلڈ تھیم</a> کے استعمال کو مد نظر رکھیں۔','Please select one or more plugins to update.'=>'پراہ مہربانی اپڈیٹ کرنے کے لیے ایک یا ایک سے زیادہ پلگ انز منتخب کریں۔','Please select one or more themes to update.'=>'پراہ مہربانی اپڈیٹ کرنے کے لیے ایک یا ایک سے زیادہ تھیمز منتخب کریں۔','Last checked on %1$s at %2$s.'=>'%1$s کو %2$s بجے آخری بار چیک کیا۔','Check Again'=>'دوبارہ چیک کریں','Search Installed Themes'=>'انسٹال شدہ تھیمز میں تلاش','Search installed themes...'=>'اسٹال شدہ تھیمز تلاش کریں۔۔۔','Update WordPress Database'=>'WordPress کا ڈیٹا بیس اپڈیٹ کریں','You are about to install WordPress %s <strong>in English (US).</strong> There is a chance this update will break your translation. You may prefer to wait for the localized version to be released.'=>'آپ WordPress کو %s <strong>English (US)۔</strong> میں انسٹال کرنے جا رہے ہیں۔ خطرہ ہے کہ اس سے آپ کا ترجمہ خراب ہو جائے گا۔ آپ کے لیے بہتر ہوگا کہ آپ لوکلائزڈ ورژن کے ریلیز ہونے کا انتظار کر لیں۔','The Available Widgets section contains all the widgets you can choose from. Once you drag a widget into a sidebar, it will open to allow you to configure its settings. When you are happy with the widget settings, click the Save button and the widget will go live on your site. If you click Delete, it will remove the widget.'=>'دستیاب ویجٹ کے حصے میں وہ تمام ویجٹ موجود ہیں جن کو آپ استعمال کر سکتے ہیں۔ جیسے ہی آپ ویجٹ کو ڈریگ کر کے سائڈ بار پر رکھتے ہیں تو اس میں ترمیم کرنے کے آپشن ظاہر ہوجاتے ہیں۔ جب آپ ترتیب کر لیں تو محفوظ کے بٹن پر کلک کریں اور آپ کا ویجٹ براہ راست ہو جائے گا۔ اگر آپ حذف پر کلک کریں گے تو آپ کا ویجٹ حذف ہو جائے گا۔','This child theme inherits templates from a parent theme, %s.'=>'چائلڈ تھیم بنیادی تھیم کے ٹیمپلیٹ کو لیتی ہے، %s۔','The database update process may take a little while, so please be patient.'=>'ڈیٹا بیس کواپڈیٹ کرنے کے عمل کو تھوڑا وقت لگ سکتا ہے، لہذا صبر کریں۔','WordPress &rsaquo; Update'=>'WordPress &rsaquo; اپڈیٹ','Super admin privileges cannot be removed because this user has the network admin email.'=>'سپر ایڈمن کے اختیارات کو ختم نہیں کیا جا سکتا کیونکہ یہ صارف نیٹ ورک ایڈمن کی ای میل رکھتا ہے۔','Update Complete'=>'اپڈیٹ مکمل ہو گئی','Email or Username'=>'ای میل یا اسم رکنیت','Remember to click Update Media to save metadata entered or changed.'=>'اگر آپ نے میٹا ڈیٹا نیا بنایا ہے یا تبدیل کیا ہے تو اپڈیٹ میٹا ڈیٹا پہ کلک کرنا نہ بھولیں۔','Note that you crop the image by clicking on it (the Crop icon is already selected) and dragging the cropping frame to select the desired part. Then click Save to retain the cropping.'=>'نوٹ کریں کہ آپ تصویر پرکلک کر کے اس کو کراپ کر سکتے ہیں، کراپ کا اختیار پہلے ہی منتخب شدہ ہے، اور آپ کراپنگ فریم کے کونوں سے اس کو ڈریگ کرکے تصویر اپنی ضرورت کے مطابق کراپ کر سکتے ہیں۔ پھر محفوظ کرنے کے آپشن پر کلک کریں اور اپنی کراپنگ کو محفوظ کریں۔','This screen allows you to edit fields for metadata in a file within the media library.'=>'اس اسکرین میں آپ میڈیا لائبریری کے فائلز کے خانوں کے میٹا ڈیٹا میں ترمیم کر سکتے ہیں۔','For images only, you can click on Edit Image under the thumbnail to expand out an inline image editor with icons for cropping, rotating, or flipping the image as well as for undoing and redoing. The boxes on the right give you more options for scaling the image, for cropping it, and for cropping the thumbnail in a different way than you crop the original image. You can click on Help in those boxes to get more information.'=>'تصویر میں ترمیم کرنے کے لیے اس کے تھمب نیل کے نیچے دئیے گئے تصویر میں ترمیم کے لنک پر کلک کریں اس صورت میں آپ کو تصویر میں ترمیم کرنے ، کراپ کرنے اور گھما، پلٹ وغیرہ کرنے کے اختیارات ملیں گے۔ دائیں طرف موجود باکس آپ کو تصویرکو بڑا/ چھوٹا کرنے اور تھمب نیل کو کراپ کرنے کے مزید اختیار دے گا۔ آپ مزید معلومات کے لیے ان باکس پر موجود مدد کے بٹن پر کلک کر سکتے ہیں۔','Database Update Required'=>'ڈیٹا بیس اپڈیٹ کی ضرورت ہے','WordPress has been updated! Before we send you on your way, we have to update your database to the newest version.'=>'WordPress اپڈیٹ کر دیا گیا ہے! آپ کو آگے لے جانے سے پہلے ہمیں ڈیٹا بیس کو نئے ورژن پر اپڈیٹ کرنا ہے۔','The boxes on your Dashboard screen are:'=>'آپ کے ڈیش بورڈ پر جو خانے ہیں:','No Update Required'=>' اپڈیٹ کی ضرورت نہیں ہے','This is a file in your current parent theme.'=>'یہ وہ فائل ہے جو آپ کی موجودہ بنیادی تھیم میں ہے۔','HowdyWelcome'=>'خوش آمدید','If you want to make changes but don&#8217;t want them to be overwritten when the plugin is updated, you may be ready to think about writing your own plugin. For information on how to edit plugins, write your own from scratch, or just better understand their anatomy, check out the links below.'=>'اگر آپ پلگ ان کو اپڈیٹ کرنا چاہتے ہیں لیکن چاہتے ہیں کہ آپ کی ترتیب  ختم نہ ہو تو شاید آپ کو اپنی پلگ ان بنانے کے بارے سوچنا چاہیے۔ یہ جاننے کے لیے کہ پلگ کو کس طرح ایڈٹ کیا جائے، آپ کو اسکریچ سے پلگ ان لکھنا ہونگے، یا صرف ان کے طریقہ کار کو سمجھنا ہوگا، نیچے دیئے گئے کو لنک چیک کریں۔','This plugin may be active on other sites in the network.'=>'یہ پلگ ان نیٹ ورک کی دوسری سائٹ پہ فعال ہو سکتا ہے۔','userAdd Existing'=>'موجودہ شامل کریں','&larr; Back to Users'=>'&larr; واپس صارفین پر جائیں','Main menu'=>'مرکزی مینو','This importer is not installed. Please install importers from <a href="%s">the main site</a>.'=>'یہ برآمد کنندہ انسٹال نہیں ہے۔ براہ مہربانی <a href="%s">مرکزی سائٹ</a> سے برآمد کنندہ انسٹال کریں۔','WordPress grows when people like you tell their friends about it, and the thousands of businesses and services that are built on and around WordPress share that fact with their users. We&#8217;re flattered every time someone spreads the good word, just make sure to <a href="%s">check out our trademark guidelines</a> first.'=>'WordPress صرف اُسی وقت مشہور ہو سکتا ہے جب آپ جیسے لوگ اپنے دوستوں کو اس کے متعلق بتائیں، اور اُن ہزاروں کاروباری سائٹس جو WordPress میں یا اس کو استعمال کر کے بنی ہیں اس بارے میں صارفین کو بتایا جائے۔ ہمیں بہت خوشی ہوتی ہے جب اچھے الفاظ پھیلائے جاتے ہیں بس پہلے ایک نظر ہمارے <a href="%s">ٹریڈ مارک کی راہنمائی کے طریقے</a> دیکھ لیں۔','removing-widgetDeactivate'=>'غیر فعال','Collapse menu'=>'مینو بند کریں','Don&#8217;t you wish all software came with these freedoms? So do we! For more information, check out the <a href="https://www.fsf.org/">Free Software Foundation</a>.'=>'کیا آپ نہیں چاہتے کے تمام سافٹ وئیر اسی آزادی سے آئیں؟ ہم بھی یہی چاہتے ھیں! مزید جاننے کے لیے <a href="https://www.fsf.org/">فری سافٹ وئیر فاوٌنڈیشن</a> کو چیک کریں۔','Every plugin and theme in WordPress.org&#8217;s directory is 100%% GPL or a similarly free and compatible license, so you can feel safe finding <a href="%1$s">plugins</a> and <a href="%2$s">themes</a> there. If you get a plugin or theme from another source, make sure to <a href="%3$s">ask them if it&#8217;s GPL</a> first. If they don&#8217;t respect the WordPress license, we don&#8217;t recommend them.'=>'ہر پلگ ان یا تھیم جو WordPress کی ڈائریکٹری میں موجود ہیں ان کا لائسنس 100%% GPL  یا اس سے ملتا جلتا ہے، پس آپ بے فکر ہو کر وہاں سے <a href="%1$s">پلگ انز</a> اور <a href="%2$s">تھیمز</a> استعمال کر سکتے ہیں۔ اگر آپ کہیں اور سے تھیم لیں تو یقین دہانی کر لیں کہ وہ <a href="%3$s"> لائسنسGPL</a> کا حامل ہے۔ اگر ایسا نہیں ہے تو WordPress لائسنس کا احترام کریں اور انہیں استعمال نہ کریں۔','WordPress is Free and open source software, built by a distributed community of mostly volunteer developers from around the world. WordPress comes with some awesome, worldview-changing rights courtesy of its <a href="%s">license</a>, the GPL.'=>'WordPress مفت اور اوپن سورس سافٹ ویئر ہے، دنیا بھر سے زیادہ تر رضاکار ڈویلپرز کی ایک پھیلی ہوئی کمیونٹی کی طرف سے بنایا گیا۔ WordPress زبردست بین الاقوامی ترمیمی اختیارات کے ساتھ آتا ہے جی پی ایل <a href="%s">لائسنس</a> کے ساتھ۔','Re-install Now'=>'اب دوبارہ انسٹال کریں','theme nameName'=>'نام','If you would like to see more plugins to choose from, click on the &#8220;Add New&#8221; button and you will be able to browse or search for additional plugins from the <a href="%s">WordPress Plugin Directory</a>. Plugins in the WordPress Plugin Directory are designed and developed by third parties, and are compatible with the license WordPress uses. Oh, and they&#8217;re free!'=>'اگر آپ مزید پلگ انز دیکھتا چاہتے ہیں تو &#8220;Add New&#8221;  کے بٹن پر کلک کریں اور آپ<a href="%s">WordPress پلگ ان ڈائریکٹری</a> سے بہت سی پلگ انز ڈاؤنلوڈ کر کے استعمال کر سکتے ہیں۔ یہ بلگ انز تھرڈ پارٹی ڈویلپرز نے بنائی ہیں، اور WordPress کے ساتھ استعمال کی جا سکتی ہیں۔ اور ہاں! یہ بالکل مفت ہیں۔  ','The left-hand navigation menu provides links to all of the WordPress administration screens, with submenu items displayed on hover. You can minimize this menu to a narrow icon strip by clicking on the Collapse Menu arrow at the bottom.'=>'بائیں جانب موجود مینو WordPress ایڈمن سکرین کے لیے تمام لنک مہیا کرتی ہے، اس کے سب مینو اس پر کرسر لے جانے سے عیاں ہو جاتے ہیں۔ آپ اس مینو کو چھوٹا کرکے آئیکنز تک بھی محدود کر سکتے ہیں، اس کے لیے نیچے دیئے گئے مختصر کرنے کے آپشن کا استعمال کریں۔','Navigation'=>'نیویگیشن ','Post name'=>'پوسٹ کا نام','sample permalink structuresample-post'=>'نمونہ-پوسٹ','sample permalink basearchives'=>'محفوظات','Add New User'=>'نیا صارف شامل کریں','About Pages'=>'صفحات برائے تعارف','<strong>Drag and Drop</strong> &mdash; To rearrange the boxes, drag and drop by clicking on the title bar of the selected box and releasing when you see a gray dotted-line rectangle appear in the location you want to place the box.'=>'<strong>ڈریگ اور ڈراپ</strong> &mdash; خانوں کو ترتیب دینے کے لیے ان کے ٹائٹل بار پر کلک کر کے ان کو ڈریگ کریں اور وہاں لے جائیں جہاں آپ اس کو مقرر کرنا چاہتے ہیں، اور جب وہاں سرمئی رنگ کا ڈاٹڈ خانہ عیاں ہو تو اس کے ڈراپ کر دیں۔','View version %s details.'=>'%s ورژن کی تفصیلات دیکھیں۔','You can use the following controls to arrange your Dashboard screen to suit your workflow. This is true on most other administration screens as well.'=>'آپ مندرجہ ذیل کنٹرولز کے ذریعے ڈیش بورڈ کو اپنے ورک فلو کے مطابق ترتیب دے سکتے ہیں، یہ دیگر ایڈمنسٹریشن اسکرینز کے لیے بھی ہیں۔','User added.'=>'صارف کو شامل کر دیا۔','Add Existing User'=>'پہلے سے موجود صارف شامل کریں','Customizing This Display'=>'اس اسکرین کو کسٹمائز کریں','Title and Post Editor'=>'عنوان اور پوسٹ ایڈیٹر','userAdd New'=>'نیا شامل کریں','Uploading Files allows you to choose the folder and path for storing your uploaded files.'=>'فائلیں اپ لوڈ کرنا آپ کو فولڈر اور اپ لوڈ کی گئی فائلوں کے پاتھ کا انتخاب کرنے کی اجازت دیتا ہے۔','Installing themes on Multisite can only be done from the Network Admin section.'=>'ملٹی سائٹ پر تھیم صرف نیٹ ورک کے ایڈمن سیکشن سے اپلوڈ کی جا سکتی ہے۔','Permalinks are the permanent URLs to your individual pages and blog posts, as well as your category and tag archives. A permalink is the web address used to link to your content. The URL to each post should be permanent, and never change &#8212; hence the name permalink.'=>'پرمالنکس آپ کے زمرے، ٹیگ آرکائیو اور بلاگ پوسٹوں کے مستقل لنک ہوتے ہیں۔ پرمالنک آپ کے مواد کا ویب ایڈریس ہوتا ہے۔ ہر پوسٹ کا پرمالنک مستقل ہونا چاہیے اور کبھی تبدیل نہیں ہونا چاہئے  &#8212; پس اس کو پرمالنک کا نام دیا گیا ہے۔','If you want to convert your categories to tags (or vice versa), use the <a href="%s">Categories and Tags Converter</a> available from the Import screen.'=>'اگر آپ اپنی زمروں کو ٹیگز میں (یا اس کے برعکس) تبدیل کرنا چاہتے ہیں تو <a href="%s">زمرے اور ٹیگز کنورٹر</a> کا استعمال کریں جو کے درآمد اسکرین میں موجود ہے۔','Remember to click the Add New User button at the bottom of this screen when you are finished.'=>'نیا صارف شامل کرنے کا بٹن کلک کریں جب آپکا کام مکمل ہو جائے۔','Inactive Sidebar (not used)'=>'غیر فعال سائیڈ بار','This sidebar is no longer available and does not show anywhere on your site. Remove each of the widgets below to fully remove this inactive sidebar.'=>'یہ سائیڈ بار مزید دستیاب نہیں اور آپ کی سائٹ پر کہیں استمعال نہیں ہوتا یہ سائیڈ بار مکمل طور پر حذف کرنے کے لیے تمام ویجٹس حذف کریں۔','This screen allows you to choose your permalink structure. You can choose from common settings or create custom URL structures.'=>'اس اسکرین میں آپ پرمالنک کی شکل کا انتخاب کر سکتے ہیں، آپ عام ترتیبات میں سے انتخاب کر سکتے ہیں یا اپنی مرضی کا یوآرایل بنا سکتے ہیں۔','Attaching Files'=>'فائلیں منسلک ہو رہی ہیں','Here is a basic overview of the different user roles and the permissions associated with each one:'=>'یہ صارف کے مختلف کرداروں کا خلاصہ ہے اورہر  کردار کے لیے متعین اجازتیں ہیں:','User Roles'=>'صارف کے کردار','You can manage comments made on your site similar to the way you manage posts and other content. This screen is customizable in the same ways as other management screens, and you can act on comments using the on-hover action links or the Bulk Actions.'=>'جس طرح آپ اپنی سائٹ کی پوسٹس اور دوسرا مواد منظم کرتے ہیں اسی طرح سے آپ تبصرے بھی منظم کر سکتے ہیں۔ اس اسکرین کو بھی آپ اسکرین اختیار کے ذریعے سے تبدیل کر سکتے ہیں اور تبصروں پر بھی آپ بلک ایکشن اور دیگر کام کر سکتے ہیں۔','You can change your password, turn on keyboard shortcuts, change the color scheme of your WordPress administration screens, and turn off the WYSIWYG (Visual) editor, among other things. You can hide the Toolbar (formerly called the Admin Bar) from the front end of your site, however it cannot be disabled on the admin screens.'=>'آپ اپنا پاسورڈ تبدیل کر سکتے ہیں، کی بورڈ کے شارٹ کٹ فعال کر سکتے ہیں، WordPress کی کلر اسکیم تبدیل کر سکتے ہیں اور اور ایڈیٹر بھی ختم کر سکتے ہیں۔ اس کے علاوہ آپ ٹول بار(جسے ایڈمن بار بھی کہا جاتا ہے) کو بھی ختم کر سکتے ہیں، تاہم اس کو ایڈمن اسکرین پر سے غیر فعال نہیں کیا جا سکتا۔','In the <strong>Author</strong> column, in addition to the author&#8217;s name, email address, and blog URL, the commenter&#8217;s IP address is shown. Clicking on this link will show you all the comments made from this IP address.'=>'<strong>مصنف</strong> کے کام میں، اس کے نام کے علاوہ ای میل ایڈریس، بلاگ کا لنک، تبصرہ کرنے والے کا آئی پی آیڈریس بھی ہوتا ہے۔ اس لنک پر کلک کر کے آپ وہ تمام تبصرے دیکھ سکتے ہیں جو اس آئی پی سے کیے گئے ہیں۔','To add a new user to your site, fill in the form on this screen and click the Add New User button at the bottom.'=>'اپنی سائٹ پہ نئے صارف شامل کرنے کے لیے اس اسکرین پر فارم پُر کریں اور نیچے نیا صارف شامل کرنے کے بٹن پر کلک کریں۔','Unable to submit this form, please refresh and try again.'=>'فارم جمع نہیں ہو سکا، براہ مہربانی صفحے کو ریفریش کریں اور دوبارہ کوشش کریں۔','<a href="%1$s">Learn more about WordPress %2$s</a>.'=>'<a href="%1$s"> آپ WordPress %2$s کے بارے میں مزید جانیے</a>۔','Moderating Comments'=>'تبصروں کو موڈریٹ کیا جا رہا ہے','Subscribers can read comments/comment/receive newsletters, etc. but cannot create regular site content.'=>'سبسکرائبرز تبصرہ/تبصرے پڑھ سکتے ہیں، نیوز لیٹرزوغیرہ وصول کر سکتے ہیں لیکن سائٹ پہ باقاعدہ مواد تخلیق نہیں کر سکتے۔','Removing and Reusing'=>'حذف کرنا اور دوبارہ استمعال  کرنا ','Links in the Toolbar at the top of the screen connect your dashboard and the front end of your site, and provide access to your profile and helpful WordPress information.'=>'اسکرین کے اوپر ٹول بار میں موجود لنکس آپ کی سائٹ کے اگلے حصہ اور ڈیش بورڈ کو آپس میں جوڑتے ہیں، آپ کی پروفائل تک رسائی فراہم کرتے ہیں اور WordPress سے متعلق مفید مواد فراہم کرتے ہیں۔','If the importer you need is not listed, <a href="%s">search the plugin directory</a> to see if an importer is available.'=>'جو درآمد کر آپ چاہتے ہیں اگر وہ اس فہرست میں نہیں ہے <a href="%s">پلگ ان کی ڈائریکٹری میں تلاش کریں</a> دیکھیں کہ درآمد کر موجود ہے۔','Available Actions'=>'دستیاب افعال','Authors can publish and manage their own posts, and are able to upload files.'=>'مصنف اپنی  پوسٹوں کو شائع اور منظم کر سکتا ہے، اور فائلز اپلوڈ کر سکتا ہے۔','How to Update'=>'کیسے اپڈیٹ کریں','Hovering over a row reveals action links: Edit, Delete Permanently, and View. Clicking Edit or on the media file&#8217;s name displays a simple screen to edit that individual file&#8217;s metadata. Clicking Delete Permanently will delete the file from the media library (as well as from any posts to which it is currently attached). View will take you to the display page for that file.'=>'اگر آپ میڈیا کی قطار پر کرسر کے جائیں تو آپ کو بہت سے امور دکھائی دیں گے جو آپ ان پرسر انجام دے سکتے ہیں: ترمیم کرنا، ہمیشہ کے لیے خارج کرنا، دیکھنا۔ اگر آپ ترمیم کے آپشن پر کلک کریں یا میٹیا فائل کے نام پر تو آپ اس سکرین پر چلے جائیں گے جہاں آپ انفرادی طور پر فائل کا میٹا ڈیٹا تبدیل کر سکتے ہیں۔ اور اگر آپ مستقل طور پر اس کو حذف کریں گے تو آپ کا اور میڈیا ہر جگہ سے ڈیلیٹ ہو جائے گا۔ اور اگر آپ ویو پر کلک کریں گے تو آپ اس میڈیا فائل کے ویو پیج پر چلے جائیں گے۔','Missing Widgets'=>'غیر موجود ویجٹس','If a media file has not been attached to any content, you will see that in the Uploaded To column, and can click on Attach to launch a small popup that will allow you to search for existing content and attach the file.'=>'اگر ایک میڈیا فائل کسی مواد کے ساتھ  منسلک نہیں ہے تو آپ اس کو اپلوڈ شدہ کے کالم میں دیکھ سکتے ہیں۔ منسک بٹن پر کلک کرنے پر ایک عدد چھوٹی پاپ اپ کھلے گی جس کی مدد سے آپ پہلے سے موجود مواد کو تلاش کر کے اس کے ساتھ یہ فائل منسلک کر سکتے ہیں۔','All the files you&#8217;ve uploaded are listed in the Media Library, with the most recent uploads listed first. You can use the Screen Options tab to customize the display of this screen.'=>'وہ تمام فائلز جو آپ اپلوڈ کے ہیں وہ میڈیا لائبریری میں موجود ہوتی ہیں، جن میں حالیہ اپلوڈ کی گئی فائلز اوپر اوپر ہوتی ہیں۔ آپ اسکرین اختیار کی ٹیب کے ذریعے سے اس اسکرین کی نمائش کو تبدیل بھی کر سکتے ہیں۔','Pages are similar to posts in that they have a title, body text, and associated metadata, but they are different in that they are not part of the chronological blog stream, kind of like permanent posts. Pages are not categorized or tagged, but can have a hierarchy. You can nest pages under other pages by making one the &#8220;Parent&#8221; of the other, creating a group of pages.'=>'صفحات، پوسٹس کی طرح ہی ہوتے ہیں سوائے اس کے کہ وہ بلاگ اسٹریم، جس میں ایک خاص ترتیب میں پوسٹس کی جاتی ہیں، کا حصہ نہیں ہو تے، بجائے اس کے ان کو مستقل پوسٹس کہا جا سکتا ہے۔ اس کے علاوہ صفحات کے زمرے یا ٹیگ نہیں ہوتے ، مگر ان کی ترتیب وجود ہو سکتی ہیں۔ اپ ایک صفحے کا سب صفحہ بھی بنا سکتے ہیں، اس مقصد کے لیے آپ کو &#8220;بنیادی&#8221; اور چائلڈ صفحات بنانا ہوں گے۔','Adding Themes'=>'تھیمز شامل کرنا','Because this is a multisite installation, you may add accounts that already exist on the Network by specifying a username or email, and defining a role. For more options, such as specifying a password, you have to be a Network Administrator and use the hover link under an existing user&#8217;s name to Edit the user profile under Network Admin > All Users.'=>'چونکہ یہ ایک سے زائد ویب سائٹس کی انسٹالیشن ہے اس لیے آپ ایسے اکاؤنٹس بھی بنا سکتے ہیں جو نیٹ ورک پر پہلے سے موجود ہوں، ایسا کرنے کے لیے آپ اسم رکنیت یا ای میل اور ان کے کردار کا اندراج کریں۔ مزید اختیارات کے لیے، جیسا کہ پاسورڈ کی وضاحت، آپ کا نیٹ ورک ایڈمن ہونا ضروری ہے اور موجودہ صارف کے نام کے نیچے موجود لنکس کو استعمال کرتے ہوئے آپ ان کی پروفائل میں ترمیم کر سکتے ہیں۔ صارفین کے حصے میں جانے کے لیے نیٹ ورک ایڈمن اور پر تمام صارفین پر کلک کریں۔ ','Common Settings'=>'عام ترتیبات','Troubleshooting'=>'خرابیوں کا سراغ','Many people take advantage of keyboard shortcuts to moderate their comments more quickly. Use the link to the side to learn more.'=>'بہت سے لوگ تیزی کے ساتھ تبصروں کو ڈِیل کرنے کے لیے کی بورڈ کی شارٹ کٹس کا استعما ل کرتے ہیں۔ مزید جاننے کے لیے سائیڈ پر دیئے گئے لنک پر کلک کریں۔','Custom Structures'=>'اپنی مرضی کی ساخت','Profile updated.'=>'پروفائل اپڈیٹ کر دی گئی۔','Show Toolbar when viewing site'=>'سائٹ دیکھتے وقت ٹول بار دکھائیں','Hi,

You\'ve been invited to join \'%1$s\' at
%2$s with the role of %3$s.

Please click the following link to confirm the invite:
%4$s'=>'سلام،

آپ کو %1$s میں %2$s پر
%3$s کردار کے طور پر شامل ہونے کے لیے مدعو کیا گیا ہے۔ 

دعوت کی تصدیق کے لیے نیچے دیئے گئے لنک پر کلک کریں:
%4$s','Profile Picture'=>'پروفائل کی تصویر','The active theme is broken. Reverting to the default theme.'=>'فعال تھیم ٹوٹی ہوئی ہے، طے شدہ تھیم لگا دی گئی۔','There is an autosave of this post that is more recent than the version below. <a href="%s">View the autosave</a>'=>'ایک خودبخود محفوظ شدہ پوسٹ بھی ہے جو کہ نیچے دکھائی دینے والے ورژن سے زیادہ نئی ہے <a href="%s">خودبخود محفوظ شدہ پوسٹ کو دیکھیں</a>','Enter the email address or username of an existing user on this network to invite them to this site. That person will be sent an email asking them to confirm the invite.'=>'اس نیٹ ورک پر موجودہ صارف کو سائٹ پر مدعو کرنے کے لیے ای میل یا اسم رکنیت درج کریں، اس کی تصدیق کرنے کے لیے ای میل بھیج دی جائے گی۔','New users will receive an email letting them know they&#8217;ve been added as a user for your site. This email will also contain their password. Check the box if you don&#8217;t want the user to receive a welcome email.'=>'نئے صارفین کو آپ کی ویب سائٹ میں بطور صارف شمولیت کی اطلاع کے طور پر ایک ای میل موصول ہو گی۔ پاس ورڈ بھی اس ای میل میں شامل ہو گا۔ اگر آپ نئے صارف کو ای میل نہیں بھیجنا چاہتے تو اس خانے کو چیک کر دیں۔','Enter the email address of an existing user on this network to invite them to this site. That person will be sent an email asking them to confirm the invite.'=>'اس نیٹ ورک پر موجودہ صارف کو سائٹ پر مدعو کرنے کے لیے ای میل یا اسم رکنیت درج کریں، اس کی تصدیق کرنے کے لیے ای میل بھیج دی جائے گی۔','In previous versions of WordPress, all importers were built-in. They have been turned into plugins since most people only use them once or infrequently.'=>'WordPress کے پچھلے ورژنز میں تمام امپوٹرز پہلے سے بنے ہوئے تھے۔ کیونکہ لوگ اُنہیں صرف ایک بار یا بہت کم استعمال کرتے ہیں اس لیے اب وہ پلگ اِن بنا دیے گئے ہیں۔','<strong>Welcome</strong> &mdash; Shows links for some of the most common tasks when setting up a new site.'=>'<strong>خوش آمدید</strong> نئی سائٹ بناتے وقت زیادہ مشترک کاموں کے لنکس دکھاتا ہے۔','Edit comment'=>'تبصرے میں ترمیم کریں','Word count: %s'=>'لفظوں کی تعداد: %s','(required)'=>'(ضروری) ','This theme is broken.'=>'یہ تھیم ٹوٹ پھوٹ کا شکار ہے۔','Configuration Error'=>'کنفیگریشن میں خرابی','Previewing and Customizing'=>'پیش منظر دیکھیں اور اپنی مرضی کے مطابق بنائیں','You attempted to edit an item that isn&#8217;t an attachment. Please go back and try again.'=>'آپ نے ایک ایسی شے میں ترمیم کرنے کی کوشش کی ہے جو کہ منسلکہ نہیں ہے۔ براہ مہربانی واپس جائیں اور دوبارہ کوشش کریں۔','Categories have hierarchy, meaning that you can nest sub-categories. Tags do not have hierarchy and cannot be nested. Sometimes people start out using one on their posts, then later realize that the other would work better for their content.'=>'زمروں میں ایک ترتیب ہوتی ہے، مطلب یہ کہ آپ ایک زمرے کے اندر دوسرے زمرے کو رکھ سکتے ہیں۔ جبکہ ٹیگ کے سلسلے میں ایسا نہیں ہو تا۔ بعض اوقات لوگ اپنی پوسٹوں کے لیے ایک ٹیگ  استعمال کرتے ہیں اور بعد میں احساس ہوتا ہے کہ وہ ایک سے زیادہ استعمال کر سکتے ہیں۔','The Categories and Tags Converter link on this screen will take you to the Import screen, where that Converter is one of the plugins you can install. Once that plugin is installed, the Activate Plugin &amp; Run Importer link will take you to a screen where you can choose to convert tags into categories or vice versa.'=>'زمرہ اور ٹیگ کنورٹر لنک جو کہ اس اسکرین پر موجود ہے وہ آپ کو برآمد اسکرین پر لے جائے گا، جہاں کنورٹر کی ایک پلگ ان آپ انسٹال کر سکتے ہیں۔ ایک مرتبہ وہ پلگ ان انسٹال ہو جائے، اس پلگ ان کو فعال بنائیں &amp; اور امپورٹر لنک کو چلائیں جو آپ کو ایک اسکرین پر لے جائے گا جہاں آپ ٹیگ کو زمرے اور زمرے کو ٹیگ میں منتقل کر سکتے ہیں۔','In the <strong>In Response To</strong> column, there are three elements. The text is the name of the post that inspired the comment, and links to the post editor for that entry. The View Post link leads to that post on your live site. The small bubble with the number in it shows the number of approved comments that post has received. If there are pending comments, a red notification circle with the number of pending comments is displayed. Clicking the notification circle will filter the comments screen to show only pending comments on that post.'=>'<strong>کے جواب میں</strong> کے کالم میں تین چیزیں ہیں۔ جو متن ہے وہ اس پوسٹ کا نام ہے جس پر تبصرہ کیا گیا اورلنکس پوسٹ ایڈیٹر کے ساتھ منسلک ہیں۔ پوسٹ دیکھیں کا لنک آپ کو براہ راست سائٹ پر پوسٹ پر لے جاتا ہے۔ چھوٹا سا دائرہ جس میں نمبر موجود ہیں یہ اس پوسٹ پر کیے گئے تبصروں کی تعداد کو ظاہر کرتا ہے۔ اگر تبصرے منظور نا کیے گئے ہوں تو ایک سرخ دائرے میں وہ ظاہر ہوتے ہیں۔ اس پر کلک کر کے آپ وہ تبصرہ دیکھ بھی سکتے ہیں۔','The title field and the big Post Editing Area are fixed in place, but you can reposition all the other boxes using drag and drop. You can also minimize or expand them by clicking the title bar of each box. Use the Screen Options tab to unhide more boxes (Excerpt, Send Trackbacks, Custom Fields, Discussion, Slug, Author) or to choose a 1- or 2-column layout for this screen.'=>'عنوان کا خانہ اور پوسٹ ایڈیٹنگ ایریا ایک جگہ پر مقرر ہوتے ہیں، مگر آپ ان کی جگہ تبدیل بھی کر سکتے ہیں۔ آپ اس کو وسیع اور مختصر بھی کر سکتے ہیں، یہ آپ پر منحصر ہے۔ اسکرین اختیارات کے ذریعے سے آپ خانے کو چھپا سکتے ہیں (ٹریک بیک بھیجنا، مرضی کے خانے، بحث ، سلگ، مصنف) یا اس اسکرین کے لیے ایک یا دو کالمی لے آؤٹ کا انتخاب کر سکتے ہیں۔','Inserting Media'=>'میڈیا شامل کیا جا رہا ہے','Several boxes on this screen contain settings for how your content will be published, including:'=>'اس اسکرین پر کئی خاںوں میں ترتیبات ہیں کہ آپ کا مواد کس طرح شائع ہو گا، بشمول:','When changing themes, there is often some variation in the number and setup of widget areas/sidebars and sometimes these conflicts make the transition a bit less smooth. If you changed themes and seem to be missing widgets, scroll down on this screen to the Inactive Widgets area, where all of your widgets and their settings will have been saved.'=>'اکثر اوقات تھیم تبدیل کرتے ہوئی ایسا ہوتا ہے کہ ویجٹ اور سائیڈ بار کی تعداد تبدیل ہوجاتی ہے جس سے ویب سائٹ کی تغیر میں مسئلہ ہوتا ہے۔ اگر آپ تھیم تبدیل کریں اور آپ کے ویجٹ کم ہوجائیں تو آپ اس اسکرین میں نیجے جائیں اور غیر فعال ویجٹ والی جگہ دیکھیں تو آپ کو وہ وہاں ملیں گے۔','The Documentation menu below the editor lists the PHP functions recognized in the plugin file. Clicking Look Up takes you to a web page about that particular function.'=>'ایڈیٹر کے نیچے دستاویزاتی مینو، پلگ ان فائل سے پہچانے گئے PHP فنکشنز کی فہرست دیتا ہے۔ لک اپ پر کلک کرنے سے وہ اس مخصوص فنکشن کے ایک ویب پیج پر لے جاتا ہے۔','Look Up'=>'اوپر دیکھیں','You can upload and insert media (images, audio, documents, etc.) by clicking the Add Media button. You can select from the images and files already uploaded to the Media Library, or upload new media to add to your page or post. To create an image gallery, select the images to add and click the &#8220;Create a new gallery&#8221; button.'=>'آپ "میڈیا شامل کریں" بٹن پر کلک کر کے میڈیا فائلز اپلوڈ اور استعمال کر سکتے ہیں، آپ وہ فائلز بھی استعمال کر سکتے ہیں جو آپ پہلے سے اپلوڈ کر چکے ہیں۔ تصویری گیلری بنانے کے لیے، ان تصاویر پر کلک کریں جو آپ شامل کرنا چاہتے ہیں اور &#8220;ایک نئی گیلری بنائیں&#8221;  کے بٹن پر کلک کریں۔','Selected menus have been successfully deleted.'=>'منتخب شدہ مینوز کامیابی سے حذف ہو چکے ہیں۔','Edit your default menu by adding or removing items. Drag the items into the order you prefer. Click Create Menu to save your changes.'=>'اپنی طے شدہ میںو میں چیزیں شامل کر یا حذف کر کے ترمیم کریں، اپنی پسند کی ترتیب کے لیے ڈریگ کریں۔ مینو محفوظ کرنے کے لیے مینو بنانے کا بٹن دبائیں۔','Give your menu a name, then click Create Menu.'=>'اپنے مینو کو نام دیں، پھر نئے مینو پر کلک کریں','Auto add pages'=>'صفحات خود کار طریقے سے شامل کریں','Select a menu to edit:'=>'ترمیم کرنے کے لیے ایک مینو کو منتخب کریں:','You cannot move this item to the Trash. %s is currently editing.'=>'آپ اس چیز کو ردی کی ٹوکری میں منتقل نہیں کر سکتے۔ %s اس وقت ترمیم کر رہے ہے۔','Menu structure'=>'مینو کی ساخت','Menu Settings'=>'مینو کی ترتیبات','This screen is used for managing your navigation menus.'=>'یہ اسکرین آپ کے مرضی کے نیویگیشن مینوز کو منظم کرنے کے لیے استعمال ہوتی ہے۔','From this screen you can:'=>'آپ اس اسکرین سے کر سکتے ہیں:','Create, edit, and delete menus'=>'مینوز شامل کریں، ترمیم کریں یا حذف کریں','Add, organize, and modify individual menu items'=>'انفرادی مینیو آئٹم کو شامل کریں، ترتیب دیں یا تبدیل کریں','The menu management box at the top of the screen is used to control which menu is opened in the editor below.'=>'اسکرین کے اوپر مینو کے انتظام کا خانہ نیچے ایڈیٹر میں میں کھولے گئے مینو کو کنٹرول کرنے کے لیے استمعال ہوتا ہے۔','To edit an existing menu, <strong>choose a menu from the drop down and click Select</strong>'=>'موجودہ مینو میں ترمیم کے لیے، <strong>ڈراپ ڈاؤن سے مینو منتخب کریں</strong>','You can assign theme locations to individual menus by <strong>selecting the desired settings</strong> at the bottom of the menu editor. To assign menus to all theme locations at once, <strong>visit the Manage Locations tab</strong> at the top of the screen.'=>'آپ مینو ایڈیٹر کے نیچے دی گئی <strong>مطلوبہ ترتیبات کو منتخب کر کے</strong> انفرادی طور پر مینو کو تھیم مقام دے سکتے ہیں۔ ایک بار ہی میں تمام تھیم مقام کو مینیو تقویض کرنے کے لیے، اسکرین کے اوپر موجود <strong>مقامات منطم کرنے کے ٹیب پر جائیں</strong>۔','Menu Management'=>'مینو کا انتظام','Each navigation menu may contain a mix of links to pages, categories, custom URLs or other content types. Menu links are added by selecting items from the expanding boxes in the left-hand column below.'=>'نیویگیشن مینو صفحات کے لنکس، اقسام، من پسند لنک یا کسی اور مواد کی اقسام پر مشتمل ہوسکتا ہے۔ نیچے دیئے ہوئے بائیں جانب والے کالم میں سے مزید اضافے والے ڈبوں میں موجود اشیاء کی مدد سے مینو لنکس شامل ہوتے ہیں۔','Add one or several items at once by <strong>selecting the checkbox next to each item and clicking Add to Menu</strong>'=>'ایک یا زیادہ آئٹم شامل کریں <strong>چیک باکس کے ذریعے انتخاب کریں اور مینو میں شامل کریں</strong>','To reorganize menu items, <strong>drag and drop items with your mouse or use your keyboard</strong>. Drag or move a menu item a little to the right to make it a submenu'=>'مینو آئٹمز کو ترتیب دینے کے لیے، <strong>آئٹمز کو اپنے ماؤس یا کی بورڈ سے ڈریگ اور ڈراپ کریں</strong>۔ سب مینو بنانے کے لیے مینو آئٹم کو ہلکا سا دائیں جانب ڈریگ یا منتقل کریں۔','Delete a menu item by <strong>expanding it and clicking the Remove link</strong>'=>'مینو آئٹم کو حذف کریں <strong>اسکو کھولیں اور حذف کرنے کے لنک پر کلک کریں</strong>','Editing Menus'=>'مینوز میں ترمیم کی جا رہی ہے','This screen is used for globally assigning menus to locations defined by your theme.'=>'یہ اسکرین آپ کے تھیم کی طرف سے مخصوص کردہ نشستوں پر مینو شامل کرنے کے لیے استعمال ہوتی ہے۔','To assign menus to one or more theme locations, <strong>select a menu from each location&#8217;s drop down.</strong> When you&#8217;re finished, <strong>click Save Changes</strong>'=>'مینوز کو ایک یا ایک سے زیادہ مقامات کو تفویض کرنے کے لیے <strong>تمام مقامات کے ڈراپ ڈاؤن سے ایک مینو کا انتخاب کریں</strong> جب یہ کر چکیں تو <strong>تبدیلیاں محفوظ کریں</strong> پر کلک کریں۔ ','To edit a menu currently assigned to a theme location, <strong>click the adjacent &#8217;Edit&#8217; link</strong>'=>'تھیم کے کسی حصے میں استعمال کیے گئے موجودہ مینو میں ترمیم کے لیے، ملحقہ <strong> &#8217;ترمیم کریں&#8217; کے لنک پر کلک کریں</strong>','To add a new menu instead of assigning an existing one, <strong>click the &#8217;Use new menu&#8217; link</strong>. Your new menu will be automatically assigned to that theme location'=>'موجودہ مینو کی بجائے نیا بنانے کے لیے <strong>click the &#8217;نیا مینو استعمال کریں&#8217; link</strong>۔ آپ کا نیا مینو خودبخود اس تھیم کے مقام پر تفویض ہو جائے گا۔','Edit Menus'=>'مینوز میں ترمیم کریں','Manage Locations'=>'مقامات منظم کریں','Theme Location'=>'تھیم کا مقام','Assigned Menu'=>'مقرر کردہ مینو','Select a Menu'=>'مینو کا انتخاب کریں','menuEdit'=>'ترمیم کریں','menuUse new menu'=>'اس مینو کو استعمال کریں','This screen is used for managing your content revisions.'=>'یہ اسکرین آپ کے مواد کی نظرثانی کے انتظام کے لیے استمال ہوتا ہے۔','Revisions are saved copies of your post or page, which are periodically created as you update your content. The red text on the left shows the content that was removed. The green text on the right shows the content that was added.'=>'نظرثانی آپ کی تحاریر یا صفحات کی محفوظ کاپی ہوتے ہیں، جو وقفے وقفے سے بنائے جاتے ہیں جب آپ اپنا مواد اپڈیٹ کرتے ہیں۔ بائیں جانب سرخ رنگ میں آپکا حذف کردہ مواد ہے، دائیں جانب سبز مواد وہ ہے جو نیا شامل کیا گیا ہے۔','From this screen you can review, compare, and restore revisions:'=>'اس اسکرین میں آپ نظرثانی کو دیکھ سکتے ہیں، موازنہ کر سکتے ہیں اور واپس لا سکتے ہیں:','To restore a revision, <strong>click Restore This Revision</strong>.'=>'نظرثانی کو واپس بحال کرنے کے لیے، <strong>اس نظرثانی کو دوبارہ بحال کریں</strong> پر کلک کریں۔','If you haven&#8217;t yet created any menus, <strong>click the &#8217;create a new menu&#8217; link</strong> to get started'=>'اگر آپ نے ابھی تک کوئی مینو نہیں بنایا تو<strong> نیا میئو بنانے والے لنک پر کلک کریں</strong> اور شروعات کریں','Drag the items into the order you prefer. Click the arrow on the right of the item to reveal additional configuration options.'=>'آئٹم کو اپنی مرضی کی ترتیب دینے کے لیے ڈریگ کریں، مزید کنفگریشن اختیارات ظاہر کرنے کے لیے دائیں طرف تیر کے نشان پر کلک کریں۔','The item you are trying to move to the Trash no longer exists.'=>'جو آئٹم آپ ردی کی ٹوکری میں ڈالنا چاہتے ہیں وہ اب موجود نہیں ہے۔','The item you are trying to restore from the Trash no longer exists.'=>'جو آئٹم آپ ردی کی ٹوکری سے واپس بحال کرنا چاہتے ہیں وہ اب موجود نہیں ہے۔','This item has already been deleted.'=>'یہ آئٹم پہلے ہی حذف کر دیا گیا ہے۔','To navigate between revisions, <strong>drag the slider handle left or right</strong> or <strong>use the Previous or Next buttons</strong>.'=>'نظرثانی میں ردوبدل کے لیے، <strong>سلائیڈر ہنڈل کو دائیں یا بائیں ڈریگ کریں، </strong>یا  <strong>آگے یا پچھے کا بٹن استعمال کریں</strong>۔','Repeat Password'=>'پاسورڈ دہرائیں','<strong>Connection lost.</strong> Saving has been disabled until you&#8217;re reconnected.'=>'<strong>رابطہ ٹوٹ گیا۔</strong> محفوظ کرنا غیر فعال کردیا گیا جب تک آپ کا دوبارہ رابطہ بحال نہیں ہو جاتا۔','We&#8217;re backing up this post in your browser, just in case.'=>'کسی مسئلے سے بچنے کے لیے، ہم اِس پوسٹ کو آپ کے براؤزر میں بھی محفوظ کر رہے ہیں۔','Compare two different revisions by <strong>selecting the &#8220;Compare any two revisions&#8221; box</strong> to the side.'=>'ایک جانب <strong>موجود &#8220;کسی بھی دو نظرثانی کا موازنہ کریں&#8221; خانے کو منتخب کر کے</strong> کوئی بھی دو مختلف نظرثانیوں کا موازنہ کریں۔','Please provide a valid username.'=>'درست اسم رکنیت فراہم کریں۔','The username you provided has invalid characters.'=>'آپ کے فراہم کردہ اسم رکنیت میں غلط حروف ہیں۔','Your passwords do not match. Please try again.'=>'آپ کا پاسورڈ میل نہیں کھاتا۔ براہ مہربانی دوبارہ کوشش کریں۔','You must provide an email address.'=>'آپ کو ایک ای میل ایڈریس فراہم کرنا چاہیے۔','Sorry, that isn&#8217;t a valid email address. Email addresses look like <code>username@example.com</code>.'=>'معاف کیجے گا، درج شدہ ای میل درست نہیں ہے۔ ای میل اس جیسا ہوتا ہے۔ <code>username@example.com</code>','Your theme does not natively support menus, but you can use them in sidebars by adding a &#8220;Navigation Menu&#8221; widget on the <a href="%s">Widgets</a> screen.'=>'آپ کی تھیم مینیو سپورٹ نہیں کرتی، مگر آپ ان کو سائیڈ بار میں &#8220;نیویگشن مینو&#8221; ویجٹ <a href="%s">ویجٹس</a> والی اسکرین سے شامل کر کے استعمال کر سکتے ہیں۔','Menus can be displayed in locations defined by your theme, even used in sidebars by adding a &#8220;Navigation Menu&#8221; widget on the <a href="%1$s">Widgets</a> screen. If your theme does not support the navigation menus feature (the default themes, %2$s and %3$s, do), you can learn about adding this support by following the Documentation link to the side.'=>'آپ تھیم کی مخصوص کردہ جگہوں پر مینو دکھا سکتے ہیں، اس کے علاوہ آپ سائیڈ بار میں بھی مینو دکھا سکتے ہیں، ایسا کرنے کے لیے آپ کو ایک  &#8220;نیویگیشن مینو&#8221; ویجٹ <a href="%1$s">ویجٹس</a> والی اسکرین سے شامل کرنا پڑتا ہے۔ اگر آپ کی تھیم مرضی کے مینو کے فنکشن کو سپورٹ نہیں کرتی (طےشدہ تھیم، %2$s  اور %3$s اس کو سپورٹ کرتے ہیں) اس کے متعلق مزید آپ دستاویزی لنک، جو کہ سائیڈ پر دیا گیا ہے، سے جان سکتے ہیں۔','The sizes listed below determine the maximum dimensions in pixels to use when adding an image to the Media Library.'=>'نیچے دی گئی سائز تصویر کو میڈیا لائبریری میں  شامل کرنے کے لیے پکسلز میں  زیادہ سے زیادہ مقدار کا تعین کرتے ہیں۔','Create a brand new user and add them to this site.'=>'ایک بالکل نیا صارف بنائیں اور اس سائٹ میں شامل کریں۔','<strong>Clicking the arrow to the right of any menu item</strong> in the editor will reveal a standard group of settings. Additional settings such as link target, CSS classes, link relationships, and link descriptions can be enabled and disabled via the Screen Options tab.'=>'ایڈیٹر میں <strong>مینو کی کسی بھی آئٹم کے سائڈ پر موجود تیر کے نشان پر کلک کرکے</strong> آپ اس کی ترتیبات دیکھ سکتے ہین۔ اضافی ترتیبات، جیسا کہ سی ایس ایس کلاس، ٹارگٹ لنک، لنک ریلشن شپ، لنک کی تفصیل، ان کو اسکرین اختیارات کے ٹیب میں جا کر فعال یا غیر فعال کیا جا سکتا ہے۔','Future security updates will be applied automatically.'=>'حفاظتی ترامیم مستقبل میں خود بخود لاگو ہو جائیں گی۔','Translations'=>'ترجمے','<strong>Screen Options</strong> &mdash; Use the Screen Options tab to choose which Dashboard boxes to show.'=>'<strong>اسکرین اختیارات</strong> &mdash; اِس بات کے انتخاب کے لیے کے ڈیش بورڈ پر کون سا خانہ نظر آنا چاییے، اسکرین اختیارات ٹیب کو استعمال کریں۔','<strong>Activity</strong> &mdash; Shows the upcoming scheduled posts, recently published posts, and the most recent comments on your posts and allows you to moderate them.'=>'<strong>سرگرمی</strong> &mdash; شیڈول پوسٹیں، تازہ ترین شائع کردہ پوسٹوں اور تبصرے  دکھاتا ہے جو آپ منظور کر سکتے ہیں۔','<strong>Quick Draft</strong> &mdash; Allows you to create a new post and save it as a draft. Also displays links to the 3 most recent draft posts you\'ve started.'=>'<strong>فوری ڈرافٹ</strong> &mdash; آپ کو نئی پوسٹ بنانے کی اجازت دیتا ہے۔ آپ کے شروع کردہ 3 تازہ ترین ڈرافٹ پوسٹس ساتھ بھی لنکس دکھاتا ہے۔','Are you sure you want to delete this theme?

Click \'Cancel\' to go back, \'OK\' to confirm the delete.'=>'کیا آپ واقعی یہ تھیم حذف کرنا چاہتے ہیں۔

واپس جانے کے لیے \'منسوخ کریں\' پر یا حذف کرنے کے لیے \'ٹھیک ہے\'  پر کلک کریں۔','Add New Theme'=>'نئی تھیم شامل کریں','Add Widget'=>'ویجٹ شامل کریں','To activate a widget drag it to a sidebar or click on it. To deactivate a widget and delete its settings, drag it back.'=>'ویجٹ کو فعال کرنے کے لیے اس کو سائیڈ بار میں ڈریگ کریں یا اس پر کلک کریں۔ ویجٹ کو غیر فعال کرنے اور اس کی ترتیبات حذف کرنے کے لیے اسکو واپس ڈریگ کریں۔','This screen is used for managing your installed themes. Aside from the default theme(s) included with your WordPress installation, themes are designed and developed by third parties.'=>'اس اسکرین میں آپ انسٹال کئے گئے تھیمز کو منظم کر سکتے ہیں، WordPress کے ساتھ انسٹال کئے گئے تھیمز کے علاوہ باقی تھیمز تھرڈ پارٹی بناتی ہیں۔','Hover or tap to see Activate and Live Preview buttons'=>'پیش منظر دیکهنے اور فعال کرنے کے لیے ہوور یا کلک کریں','Click on the theme to see the theme name, version, author, description, tags, and the Delete link'=>'تھیم کا نام، ورژن، مصنف، تفصیل، ٹیگ اور حذف کرنے کا لنک دیکھنے لیے تھیم کے نام پر کلک کریں','Click Customize for the current theme or Live Preview for any other theme to see a live preview'=>'موجودہ تھیم کا پیش منظر دیکنے کے لیے ترمیم کے بٹن کا استعمال کریں اور دیگر تھیم کے لیے براہ راست پیش منظر کا بٹن استعمال کریں۔','The current theme is displayed highlighted as the first theme.'=>'موجودہ تھیم پہلی تھیم کے طور پر نمایاں ہے۔','Tap or hover on any theme then click the Live Preview button to see a live preview of that theme and change theme options in a separate, full-screen view. You can also find a Live Preview button at the bottom of the theme details screen. Any installed theme can be previewed and customized in this way.'=>'کسی تھیم کا براہ راست پیش منظر دیکھنے کے لیے آپ کسی بھی تھیم کے نام پر کلک کریں یا اس کے نام پر کرسر لے جائیں اور براہ راست پیش منظر کے بٹن پر کلک کریں۔ آپ تھیم کے تفصیل والی اسکرین کے اختتام پر بھی براہ راست پیش منظر کا بٹن دیکھ سکتے ہیں۔ کوئی بھی انسٹال کی گئی تھیم اس طرح سے براہ راست دیکھی جا سکتی ہے اور اس میں مرضی کی ترمیم بھی کی جا سکتی ہے۔','The theme being previewed is fully interactive &mdash; navigate to different pages to see how the theme handles posts, archives, and other page templates. The settings may differ depending on what theme features the theme being previewed supports. To accept the new settings and activate the theme all in one step, click the Publish &amp; Activate button above the menu.'=>'جو تھیم آپ دیکھ رہے ہیں یہ مکمل طور پر متعامل ہے &mdash; یہ دیکھنے کے لیے کہ یہ تھیم پوسٹیں، محفوظات اور دوسرے صفحے کس طرح دکھاتا ہے، مختلف قسم کے صفحات پر جائیں۔ ترتیبات مختلف ہوسکتی ہیں تھیم کے سپورٹ کردہ پیش منظر تھیم کی خصوصیات پر منحصر ہے۔ نئی ترتیبات کو قبول کرنے اور تھیم کو ایک ہی مرحلے میں فعال کرنے کے لیے، شائع اور فعال کریں پر کلک کریں۔','When previewing on smaller monitors, you can use the collapse icon at the bottom of the left-hand pane. This will hide the pane, giving you more room to preview your site in the new theme. To bring the pane back, click on the collapse icon again.'=>'جب چھوٹے مانیٹر سے پیش منظر دیکھیں، نیچے بائیں جانب پین میں موجود مختصرکرنے والے آئیکن کو استعمال کرسکتے ہیں۔ اس سے پین چھپ جائے گا، آپ کی سائٹ کو نئی تھیم پر مزید پیش منظر دیکھنے کے لیے پین کو واپس لانے کے لیے مختصرکرنے والے آئیکن پر دوبارہ کلک کریں۔','If you would like to see more themes to choose from, click on the &#8220;Add New&#8221; button and you will be able to browse or search for additional themes from the <a href="%s">WordPress Theme Directory</a>. Themes in the WordPress Theme Directory are designed and developed by third parties, and are compatible with the license WordPress uses. Oh, and they&#8217;re free!'=>'اگر آپ مزید تھیمز دیکھنا چاہتے ہیں تو، &#8220;نئی تھیم شامل کریں&#8221; کے بٹن پر کلک کریں اور آپ مزید تھیم <a href="%s">WordPress  تھیم ڈائریکٹری</a> سے تلاش کر سکتے ہیں۔  یہ تھیمز تھرڈ پارٹی کے لوگوں کی طرف سے بنائے گئی ہیں، اور WordPress کے ساتھ استعمال ہو سکتے ہیں۔ اور ہاں، یہ سب مفت ہیں!','On this screen, you can update to the latest version of WordPress, as well as update your themes, plugins, and translations from the WordPress.org repositories.'=>'اِس اسکرین کے ذریعے آپ WordPress کے تازہ ترین ورژن پر اپڈیٹ ہو سکتے ہیں، اس کے علاوہ آپ اپنی تھیمز، پلگ انز اور تراجم کو بھی WordPress.org کے ذریعے اپڈیٹ کر سکتے ہیں۔','<strong>Themes and Plugins</strong> &mdash; To update individual themes or plugins from this screen, use the checkboxes to make your selection, then <strong>click on the appropriate &#8220;Update&#8221; button</strong>. To update all of your themes or plugins at once, you can check the box at the top of the section to select all before clicking the update button.'=>'<strong>تھیمز اور پلگ انز</strong> &mdash; انفرادی طور پر تھیم یا پلگ انز کو اس اسکرین سے اپڈیٹ کرنے کے لیے چیک باکس کے ذریعے سے اپنا انتخاب کریں اور پھر <strong>مطلقہ &#8220;اپڈیٹ کریں&#8221; بٹن پر کلک کریں</strong>۔ اپنی تمام تھیمز اور پلگ انز کو مشترکہ طور پر اپڈیٹ کرنے کے لیے آپ خانے کے اوپر موجود "تمام کو منتخب کریں" والا بٹن استعمال کر سکتے ہیں۔','If an update is available, you&#8127;ll see a notification appear in the Toolbar and navigation menu.'=>'اگر کوئی اپڈیٹ دستیاب ہوا تو، آپ کو اِس کی اطلاع ٹول بار اور نیویگیشن مینو میں ظاہر ہو جائے گی۔','<strong>WordPress</strong> &mdash; Updating your WordPress installation is a simple one-click procedure: just <strong>click on the &#8220;Update Now&#8221; button</strong> when you are notified that a new version is available.'=>'<strong>WordPress</strong> &mdash;  اپنے WordPress انسٹالیشن کو اپڈیٹ کرنا محض ایک کلک کا کام ہے: جب آپ کو WordPress کے نئے ورژن کی دستیابی کا پیغام موصول ہو تو <strong>صرف &#8220;ابھی اپڈیٹ کریں&#8221; کے بٹن پر کلک کریں</strong>۔','In most cases, WordPress will automatically apply maintenance and security updates in the background for you.'=>'زیادہ تر معاملات میں، پسِ منظر میں WordPress خود ہی حفاظت اور مرمت کی اپڈیٹس کو لاگو کرتا رہتا ہے۔','<strong>Translations</strong> &mdash; The files translating WordPress into your language are updated for you whenever any other updates occur. But if these files are out of date, you can <strong>click the &#8220;Update Translations&#8221;</strong> button.'=>'<strong>تراجم</strong> &mdash; ترجمے کی وہ فائلز جو WordPress کا آپ کی زبان میں ترجمہ کرتی ہیں اُسی وقت اپڈیٹ ہو جاتی ہیں جب کوئی بھی تبدیلی واقع ہوتی ہے۔ لیکن اگر یہ فائلیں پُرانی ہوں تو آپ <strong>تراجم کو اپڈیٹ کریں</strong> والے بٹن پر کلک کر سکتے ہیں۔ ','%s (The year of the post, four digits, for example 2004.)'=>'%s (پوسٹ کا سال، چار ہندسے، مثال کے طور پر 2004۔)','Sorry, you are not allowed to resume this theme.'=>'معاف کیجیے گا، آپ کو یہ آئٹم شامل کرنے کی اجازت نہیں ہے۔','<strong>Box Controls</strong> &mdash; Click the title bar of the box to expand or collapse it. Some boxes added by plugins may have configurable content, and will show a &#8220;Configure&#8221; link in the title bar if you hover over it.'=>'<strong>باکس کنٹرولز</strong> &mdash; باکس کے ٹائٹل بار پر کلک کر کے آپ اس کو وسیع یا مختصر کر سکتے ہیں۔ چند خانے جو کہ پلگ ان شامل کرتے ہیں، ان کے مواد کو تبدیل کیا جا سکتا ہے، اور ان پر &#8220;ترتیب دیں&#8221; کا لنک بھی ظاہر ہوتا ہے جب کبھی آپ اس کی ٹائٹل بار پر کرسر لے جاتے ہیں۔','<strong>At A Glance</strong> &mdash; Displays a summary of the content on your site and identifies which theme and version of WordPress you are using.'=>'<strong>ایک نظر میں</strong> &mdash; آپ کی سائٹ کے مواد کا خلاصہ دکھاتا ہے، آپ کی تھیم اور WordPress ورژن کے بارے میں بتاتا ہے۔','&larr; Return to editor'=>'&larr;  پوسٹ ایڈیٹر میں واپس جائیں','A red bar on the left means the comment is waiting for you to moderate it.'=>'بائیں جانب سرخ لکیر ہونے کا مطلب ہے آپ نے ابھی تبصرے کی موڈریشن کرنی ہے۔','Keyboard users: When you&#8217;re working in the visual editor, you can use <kbd>Alt + F10</kbd> to access the toolbar.'=>'کی بورڈ والے صارفین: جب آپ تصویری ایڈیٹر میں کام کر رہے ہوں تو ٹول بار تک رسائی حاصل کرنے لیے <kbd>Alt + F10</kbd> استعمال کر سکتے ہیں۔','<a href="https://codex.wordpress.org/Links_Add_New_Screen">Documentation on Creating Links</a>'=>'<a href="https://codex.wordpress.org/Links_Add_New_Screen">دستاویزات برائے تشکیل لنکس</a>','You can also embed media from many popular websites including Twitter, YouTube, Flickr and others by pasting the media URL on its own line into the content of your post/page. <a href="https://wordpress.org/support/article/embeds/">Learn more about embeds</a>.'=>'آپ بہت ساری مشہور ویب سائٹوں سے میڈیا کو بھی شامل کرسکتے ہیں جن میں ٹوئٹر، یوٹیوب، فلکر اور دیگر شامل ہیں جن کے میڈیا یوآرایل کو اپنی لائن پر اپنی پوسٹ/صفحے کے مواد میں پیسٹ کر کے شامل کرسکتے ہیں۔ <a href="https://wordpress.org/support/article/embeds/">ایمبیڈ کرنے کے بارے مزید جانیے</a>۔','The theme you are currently using isn&#8217;t widget-aware, meaning that it has no sidebars that you are able to change. For information on making your theme widget-aware, please <a href="https://developer.wordpress.org/themes/functionality/widgets/">follow these instructions</a>.'=>'آپکی موجودہ زیر استعمال تھیم \'وجٹ اویئر\' نہیں ہے، جسکا مطلب یہ ہے کہ اس میں کوئی سائیڈ بار موجود نہیں جسکو آپ تبدیل کر سکیں۔ اپنی تھیم کو وجٹ اویئر بنانے کے لیے براہ مہربانی <a href="https://developer.wordpress.org/themes/functionality/widgets/">ان ہدایات کو فالو کریں</a>۔','%1$s by %2$s (will also <strong>delete its data</strong>)'=>'%1$s از %2$s (اس کے علاوہ <strong>اس کے ڈیٹا کو بھی حذف</strong> کر دے گا)','The search for installed themes will search for terms in their name, description, author, or tag.'=>'انسٹال کی گئی تھیمز کو تلاش کرنے کے لیے الفاظ کو نام، تفصیل، مصنف اور ٹیگز سے تلاش کیا جائے گا۔','Number of Themes found: %d'=>'تھیمز کی تعداد: %d','You are about to remove the following plugins:'=>'آپ مندرجہ ذیل پلگ انز حذف کرنے والے ہیں:','These plugins may be active on other sites in the network.'=>'یہ پلگ انز نیٹ ورک میں دوسری سائٹس پر فعال ہو سکتے ہیں۔','New translations are available.'=>'نئے ترجمے دستیاب ہیں۔','You can log out of other devices, such as your phone or a public computer, by clicking the Log Out Everywhere Else button.'=>'ہر جگہ لاگ آؤٹ کے بٹن پر کلک کر کے آپ دیگر ڈیوائس سے لاگ آؤٹ کر سکتے ہیں، جیسا کہ آپ کا فون یا ایک عوامی کمپیوٹر۔','To add a custom link, <strong>expand the Custom Links section, enter a URL and link text, and click Add to Menu</strong>'=>'مرضی کا لنک شامل کرنے کے لیے، <strong>مرضی کے لنک کے حصے کو بڑھائیں، یوآرایل اور لنک متن دیں اور مینو میں شامل کریں پر کلک کریں</strong>','Welcome to the famous five-minute WordPress installation process! Just fill in the information below and you&#8217;ll be on your way to using the most extendable and powerful personal publishing platform in the world.'=>'مشہور 5 منٹ کی WordPress انسٹالیشن میں خوش آمدید! نیچے معلومات ڈالیں اور آپ دنیا کے سب سے طاقتور ترین اشاعتی پلیٹ فارم کو استعمال کریں۔','BETA TESTERS:'=>'بیٹا ٹیسٹرز:','This site is set up to install updates of future beta versions automatically.'=>'یہ سائٹ ایسے تیار کی گئی ہے کہ مستقبل کے بیٹا ورژنز کو خودبخود انسٹال کر سکے۔','The grid view for the Media Library requires JavaScript. <a href="%s">Switch to the list view</a>.'=>'میڈیا لائبریری کو گِرڈ کی شکل میں دیکھنے کے لیے جاوا اسکرپٹ کی ضرورت ہے۔ <a href="%s">فہرست کے منظر میں واپس جائیں</a>۔','Add the user without sending an email that requires their confirmation.'=>'تصدیقی ای میل بھیجے بغیر صارفین شامل کریں۔','All the files you&#8217;ve uploaded are listed in the Media Library, with the most recent uploads listed first.'=>'وہ تمام فائلیں جو آپ نے اپلوڈ کی ہیں میڈیا لائبریری میں ہوتی ہیں، آخر میں کی گئی اپلوڈ پہلے دکھائی جاتی ہے۔','You can view your media in a simple visual grid or a list with columns. Switch between these views using the icons to the left above the media.'=>'آپ میڈیا کو سادہ گرڈ میں دیکھ سکتے ہیں یا اسکو کالمز میں ترتیب دے سکتے ہیں، آپ میڈیا کے اوپر بائیں طرف کے آئیکن سے ان دونوں میں سے انتخاب کر سکتے ہیں۔','To delete media items, click the Bulk Select button at the top of the screen. Select any items you wish to delete, then click the Delete Selected button. Clicking the Cancel Selection button takes you back to viewing your media.'=>'میڈیا آئٹمز کو حذف کرنے کے لیے،اجتماعی منتخب کرنے کے بٹن پر کلک کریں۔ آپ کسی آئٹم کو ختم کرنے کے لیے منتخب کریں پهر ڈیلیٹ بٹن کو دبائیں۔ میڈیا کو دوبارہ دیکهنے کے لیے منسوخ کا بٹن دبائیں۔','Clicking an item will display an Attachment Details dialog, which allows you to preview media and make quick edits. Any changes you make to the attachment details will be automatically saved.'=>'کسی آئٹم پر کلک کرنے سے منسلکہ کا ڈائیلاگ ظاہر ہو گا، جو کہ میڈیا کا پیش منظردکهانے اور تیزی سے ترمیم کرنے کا  کی اجازت دیتا ہے۔ کوئی بهی منسلکہ میں تبدیلی خودبخود محفوظ ہو جاتی ہے۔','You can also delete individual items and access the extended edit screen from the details dialog.'=>'آپ انفرادی آئٹمز کو حذف اور تفصیلات کے ڈائیلاگ سے وسیع ترمیم کی اسکرین تک رسائی حاصل کر سکتے ہیں۔


','Use the arrow buttons at the top of the dialog, or the left and right arrow keys on your keyboard, to navigate between media items quickly.'=>'میڈیا آئٹمز میں آگے پیچھے جانے کے لیے کی بورڈ کے دائیں بائیں ایرو بٹن استمعال کریں یا ڈائیلاگ کے اوپر والا ایرو بٹن استمعال کریں۔','If you like, you may enter custom structures for your category and tag URLs here. For example, using <code>topics</code> as your category base would make your category links like <code>%s/topics/uncategorized/</code>. If you leave these blank the defaults will be used.'=>'اگر آپ چاہیں تو اپنے لنکس اور زمرہ جات کے لیے ایک مخصوص اسٹائل بھی رکھ سکتے ہیں۔ مثال کے طور پر <code>topics</code> کو اپنے زمرہ جات کی بیس کے طور پر استعمال کرنے سے آپ کے زمرہ جات کے لنک کچھ اس طرح سے ہو جائیں گے <code>%s/topics/uncategorized/</code> ۔ اگر آپ اس کو خالی چھوڑ دیں گے تو پہلے سے طے شدہ اصول استعمال ہوں گے۔','You cannot delete a theme while it has an active child theme.'=>'آپ کسی تھیم کو حذف نہیں کر سکتے جب تک اسکی ماتحت تھیم فعال ہو۔','You can enable distraction-free writing mode using the icon to the right. This feature is not available for old browsers or devices with small screens, and requires that the full-height editor be enabled in Screen Options.'=>'دائیں طرف دئیے گئے آئیکن کے استعمال سے آپ رکاوٹ سے پاک موڈ فعال کر سکتے ہیں۔ یہ صورت پرانے براؤزر اور چھوٹی اسکرین، یا وہ آلات جن پہ مکمل اونچائی کو اسکرین کے اختیارات سے فعال کرنا پڑے، ایسے آلات پر یہ صورت دستیاب نہیں ہے۔','Usernames can have only alphanumeric characters, spaces, underscores, hyphens, periods, and the @ symbol.'=>'اسم رکنیت میں صرف، حروفِ تحجی، گنتی کے حروف، اسپیس، انڈر اسکور، ہائفن، نقطہ اور @ کی علامت آ سکتی ہے۔','You can insert media files by clicking the button above the post editor and following the directions. You can align or edit images using the inline formatting toolbar available in Visual mode.'=>'پوسٹ ایڈیٹر کے اوپر والے آئیکن اور درج ذیل سمت سے آپ میڈیا فائلز شامل کر سکتے ہیں۔ بصری موڈ میں موجود ان لائن فارمیٹنگ ٹول بار استعمال کر کے تصاویر کو سيدھا یا ترمیم کر سکتے ہیں۔','<strong>Post editor</strong> &mdash; Enter the text for your post. There are two modes of editing: Visual and Text. Choose the mode by clicking on the appropriate tab.'=>'<strong>پوسٹ ایڈیٹر</strong> اپنی پوسٹ کے لیے الفاظ درج کریں، ترمیم کے دو ذریعے ہیں، لفظی اور بصری۔ دونوں میں سے کسی ایک پر کلک کریں۔','Confirm Password'=>'پاسورڈ کی تصدیق کریں','Cancel password change'=>'پاسورڈ تبدیل کریں','You will need this password to log&nbsp;in. Please store it in a secure location.'=>'آپکو اس پاسورڈ کی ضرورت پڑے گی۔ براہ مہربانی کسی محفوظ جگہ پرسنبھال کر رکھیں۔ ','Comments (%1$s) on &#8220;%2$s&#8221;'=>'&#8220;%2$s&#8221; پر تبصرے (%1$s)','In the <strong>Comment</strong> column, hovering over any comment gives you options to approve, reply (and approve), quick edit, edit, spam mark, or trash that comment.'=>'<strong>تبصرے</strong> والے کالم میں کسی بھی تبصرے پر آپ کرسر لے جائیں تو آپ کو وہ تمام امور دکھائی دیں گے جو آپ اس پر کر سکتے ہیں: تبصرہ (اور منظوری)، فوری ترمیم، ترمیم، غیرمتعلقہ کے طور پر نشان زد کرنااور اس تبصرے کو حذف کرنا۔','In the <strong>Submitted On</strong> column, the date and time the comment was left on your site appears. Clicking on the date/time link will take you to that comment on your live site.'=>'<strong>ارسال کیا گیا از</strong> والے کالم میں آپ تبصرے کے اندراج کی تاریخ اور ٹائم دیکھ سکتے ہیں۔ وقت/تاریخ کے لنک پر کلک کرنے سے آپ اس سائٹ میں براہ راست تبصرے والی جگہ پر پہنچ جائیں گے۔','Filter comments list'=>'تبصروں کی فہرست فلٹرکریں ','Comments list navigation'=>'تبصروں کی فہرست کی نیویگیشن','Comments list'=>'تبصروں کی فہرست','Preview post'=>'پوسٹ کا پیش منظر دیکھیں','Preview page'=>'صفحے کا پیش منظر دیکھیں','View page'=>'صفحہ دیکھیں','Post submitted.'=>'پوسٹ ارسال کر دی گئی۔','Post scheduled for: %s.'=>'پوسٹ شیڈول کر دی گئی برائے:  %s۔','Post draft updated.'=>'پوسٹ کے ڈرافٹ میں تبدیلی کر دی گئی۔','Page submitted.'=>'صفحہ ارسال کر دیا گیا۔','Page scheduled for: %s.'=>'صفحہ شیڈول کیا گیا برائے: %s۔','Page draft updated.'=>'صفحے کے ڈرافٹ میں تبدیلی کر دی گئی ہے۔','Editing %s (active)'=>'%s کی تبدیلی (فعال)','Browsing %s (active)'=>'%s کی براؤزنگ (فعال)','Editing %s (inactive)'=>'%s میں ترمیم (غیر فعال)','Browsing %s (inactive)'=>'%s کی براؤزنگ (غیر فعال)','Filter plugins list'=>'پلگ انز کی فہرست فلٹر کریں۔','Plugins list navigation'=>'پلگ انز کی فہرست کی نیویگیشن','Plugins list'=>'پلگ انز کی فہرست','All selected plugins are up to date.'=>'تمام منتخب پلگ انز اپڈیٹڈ ہیں۔','Install Parent Theme'=>'بنیادی تھیم انسٹال کریں','Filter media items list'=>'میڈیا آئٹمز کی فہرست فلٹرکریں ','Media items list navigation'=>'میڈیا آئٹمز کی فہرست نیویگیشن','Media items list'=>'میڈیا آئٹمزکی فہرست','Clear Inactive Widgets'=>'غیر فعال ویجٹس صاف کریں','This will clear all items from the inactive widgets list. You will not be able to restore any customizations.'=>'یہ  تمام اشیاء کو غیر فعال ویجٹ کی فہرست سے ہٹا دیں گے۔ آپ کسی کسٹمائزیشن کو بحال کرنے کے قابل نہیں ہو نگے۔','Default is %s'=>'%s طے شدہ ہے','Permalinks can contain useful information, such as the post date, title, or other elements. You can choose from any of the suggested permalink formats, or you can craft your own if you select Custom Structure.'=>'پرمالنک میں اہم معلومات ہو سکتی ہیں، جیسے کہ تحریر کی تاریخ، عنوان اور دوسری چیزیں۔ آپ کوئی بھی مجوزہ پر مالنک کی شکل منتخب کر سکتے ہیں یا آپ اپنی مرضی کے پرمالنک بنا سکتے ہیں اگر آپ مرضی کی ساخت منتخب کریں۔','WordPress offers you the ability to create a custom URL structure for your permalinks and archives. Custom URL structures can improve the aesthetics, usability, and forward-compatibility of your links. A <a href="%s">number of tags are available</a>, and here are some examples to get you started.'=>'WordPress آپ کو اپنے پرمالنکس اور محفوظات کے لئے مرضی کے یوآرایل ڈھانچے کی تخلیق کرنے کی صلاحیت دیتا ہے۔ حسب ضرورت یوآرایل ڈھانچے آپ کے لنکس کی جمالیاتی، استحکام، اور آگے کی مطابقت کو بہتر بنا سکتے ہیں۔ ایک <a href="%s">ٹیگز دستیاب ہیں</a>، اور آپ کے لیے یہاں شروعات کے لیے کچھ مثالیں ہیں۔','Plain'=>'صاف','https://en.gravatar.com/'=>'https://en.gravatar.com/','menu location(Currently set to: %s)'=>'(اسوقت %s پر مقرر ہے)','Send User Notification'=>'صارف کو اطلاع بھیجیں','Send the new user an email about their account.'=>'ان کے اکاؤنٹ کے بارے میں نئے صارف کو ایک ای میل ارسال کریں۔','The %s importer is invalid or is not installed.'=>'%s امپورٹر درست نہیں ہے یا انسٹال نہیں ہے۔','Dismiss the welcome panel'=>'خوش آمدید پینل کو برخاست کریں','Your %s file has an empty database table prefix, which is not supported.'=>'آپکے %s فائل میں ڈیٹا بیس ٹیبل کا سابقہ خالی ہے، جو درست نہیں ہے۔','The constant %s cannot be defined when installing WordPress.'=>'WordPress کو انسٹال کرنے کے دوران %s کونسٹنٹ کی وضاحت نہیں کی جا سکتی۔ ','WordPress has been installed. Thank you, and enjoy!'=>'WordPress انسٹال ہو چکا ہے، شکریہ اور اب اس کا لطف اٹھائیں!','plugin%1$s by %2$s'=>'%1$s از %2$s','https://wordpress.org/themes/'=>'https://ur.wordpress.org/themes/','Settings saved and theme activated.'=>'ترتیبات کو محفوظ اور تھیم فعال کر دی گئی ہے۔','New theme activated.'=>'نئی تھیم فعال کر دی گئی ہے۔','The following themes are installed but incomplete.'=>'مندرجہ ذیل تھیمز انسٹال ہیں مگر نا مکمل ہیں۔','You can narrow the list by file type/status or by date using the dropdown menus above the media table.'=>'آپ میڈیا ٹیبل کے اوپر ڈراپ ڈاؤن مینو کا استعمال کرتے ہوئے فائل کی قسم/حیثیت یا تاریخ کے ذریعے فہرست کو محدود کر سکتے ہیں۔','Error while saving the new email address. Please try again.'=>'نئے ای میل ایڈریس کو محفوظ کرنے میں مشکلات ہیں، براہ مہربانی دوبارہ کوشش کریں۔','There is a pending change of your email to %s.'=>'آپ کے ای میل کی تبدیلی %s زیر غور ہے۔','<strong>Publish</strong> &mdash; You can set the terms of publishing your post in the Publish box. For Status, Visibility, and Publish (immediately), click on the Edit link to reveal more options. Visibility includes options for password-protecting a post or making it stay at the top of your blog indefinitely (sticky). The Password protected option allows you to set an arbitrary password for each post. The Private option hides the post from everyone except editors and administrators. Publish (immediately) allows you to set a future or past date and time, so you can schedule a post to be published in the future or backdate a post.'=>'<strong>شائع کریں</strong> &mdash; آپ اپنی پوسٹ کو شائع کرنے کے لیے شائع کرنے والے خانے میں ٹرمز مقرر کر سکتے ہیں۔ اسٹیٹس، دیکھنے کے لیے، اور شائع کرنے کے لیے ترمیم کے بٹن پر کلک کریں۔ دیکھنے کے آپشن میں آپ اپنی پوسٹ پر پاسورڈ رکھ سکتے ہیں اور اس کو ہمیشہ کے لیے اپنے بلاگ کے اوپر فکس کر سکتے ہیں۔ آپ مختلف پوسٹس کے لیے مختلف پاسورڈ بھی سیٹ کر سکتے ہیں۔ نجی کا آپشن پوسٹ کو ایڈمن اور ایڈیٹر کے علاوہ سب سے چھپا دیتا ہے۔ شائع کرنے کا آپشن آپ کو اجازت دیتا ہے کہ آپ اپنی پوسٹ کے شائع ہونے کا وقت بھی مقرر کر سکیں۔','Media file updated.'=>'میڈیا فائل اپڈیٹ کر دی گئی۔','Media file attached.'=>'میڈیا فائل منسلک کر دی گئی۔','%s media file attached.'=>'%s میڈیا فائل ،منسلک کر دی گئی ہے۔' . "\0" . '%s میڈیا فائلیں منسلک کر دی گئیں ہیں۔','Media file detached.'=>'میڈیا فائل غیر منسلک کر دی گئی۔','%s media file detached.'=>'%s میڈیا فائل علیحدہ کر دی گئی ہے۔' . "\0" . '%s میڈیا فائلیں علیحدہ کر دی گئیں ہیں۔','%s media file permanently deleted.'=>'%s فائل مستقل طور پر حذف کر دی گئی ہے۔' . "\0" . '%s فائلیں مستقل طور پر حذف کر دی گئیں ہیں۔','%s media file moved to the Trash.'=>'%s میڈیا فائل ردی کی ٹوکری میں بھیج دی گئی ہے۔' . "\0" . '%s میڈیا فائلیں ردی کی ٹوکری میں بھیج دی گئیں ہیں۔','%s media file restored from the Trash.'=>'%s میڈیا فائل ردی کی ٹوکری سے دوبارہ بحال کر دی گئی ہے۔' . "\0" . '%s میڈیا فائلز ردی کی ٹوکری سے بحال کر دی گئیں ہیں۔','Error saving media file.'=>'میڈیا فائل محفوظ کرنے میں خرابی۔','Visual mode gives you an editor that is similar to a word processor. Click the Toolbar Toggle button to get a second row of controls.'=>'بصری موڈ آپ کو ایک ایڈیٹر دیتا ہے جو ورڈ پروسیسر کے جیسا ہے۔ ٹاگل ٹول بار بٹن سے کنٹرول کی دوسری قطار حاصل ہوتی ہے۔','The Text mode allows you to enter HTML along with your post text. Note that &lt;p&gt; and &lt;br&gt; tags are converted to line breaks when switching to the Text editor to make it less cluttered. When you type, a single line break can be used instead of typing &lt;br&gt;, and two line breaks instead of paragraph tags. The line breaks are converted back to tags automatically.'=>'ٹیکسٹ موڈ آپ کو پوسٹ ٹیکسٹ کے ساتھ ساتھ HTML کو بھی آپ کی پوسٹ میں داخل کرنے کی اجازت دیتا ہے ۔ نوٹ کریں &lt;p&gt;اور&lt;br&gt; اس کو کم بے ترتیب بنانے کے لیے ٹیگز کو لائن بریک میں تبدیل کیا جاتا ہے جب ٹیکسٹ ایڈیٹرمیں بدلا جا رہا ہو۔ جب آپ ٹائپ کریں، واحد لائن بریک ٹائپنگ کی بجائے &lt;br&gt; استعمال کیا جا سکتا ہے اور دو لائن  بریکس پیراگراف ٹیگز کی بجائے لائن بریکس کو واپس ٹیگز ميں تبدیل کردیا جا تا ہے۔','Close the Customizer and go back to the previous page'=>'کسٹمائزرکو بند کریں اور پچھلے صفحے پر واپس جائیں۔','Sorry, you are not allowed to manage privacy on this site.'=>'معاف کیجیے گا، آپ کو اس سائٹ پر پرائیویسی کا انتظام کرنے کی اجازت نہیں ہے۔','Sorry, you are not allowed to add links to this site.'=>'معاف کیجیے گا، آپ کو اس سائٹ میں لنکس شامل کرنے کی اجازت نہیں ہے۔','Manage with Live Preview'=>'براہ راست پیش منظر کے ساته منظم کریں','Sorry, you are not allowed to modify unregistered settings for this site.'=>'معاف کیجیے گا، آپ کو اس سائٹ کی ترتیبات میں ترمیم کرنے کی اجازت نہیں ہے۔','Sorry, you are not allowed to activate plugins for this site.'=>'معاف کیجیے گا، آپ کو اس سائٹ کے پلگ انز فعال کرنے کی اجازت نہیں ہے۔','Sorry, you are not allowed to deactivate plugins for this site.'=>'معاف کیجیے گا، آپ کو اس سائٹ کے لیے پلگ انز کو غیر فعال کرنے کی اجازت نہیں ہے۔','New version available. <button class="button-link" type="button">Update now</button>'=>'نیا ورژن دستیاب ہے۔ <button class="button-link" type="button">ابھی اپڈیٹ کریں</button>','Sorry, you are not allowed to update this site.'=>'معاف کیجیے گا، آپ کو اس سائٹ کو اپڈیٹ کرنے کی اجازت نہیں ہے۔','Sorry, you are not allowed to edit this changeset.'=>'معاف کیجیے گا، آپ ان تبدیلیوں میں ترمیم کرنے کے اہل نہیں ہیں۔','Sorry, you are not allowed to add users to this network.'=>'معاف کیجیے گا، آپ کو اس نیٹ ورک میں صارفین کو شامل کرنے کی اجازت نہیں ہے۔ ','The search for installed plugins will search for terms in their name, description, or author.'=>'تلاش پہلے سے انسٹال شدہ پلگ اِنز کو نام، تفصیل اور مصنف کے لحاظ سے تلاش کرے گی۔','Display location'=>'مقام دکھائیں','New users are automatically assigned a password, which they can change after logging in. You can view or edit the assigned password by clicking the Show Password button. The username cannot be changed once the user has been added.'=>'نئے صارفین کو پاسورڈ خودبخود مل جاتا ہے، جسے وہ لاگ اِن ہو کر تبدیل بھی کر سکتے ہیں۔ پاسورڈ دکھانے والا بٹن دبا کر آپ اپنا پاسورڈ دیکھ یا تبدیل کر سکتے ہیں۔ ایک بار اگر صارف شامل ہو جائے تو اسم رکنیت تبدیل نہیں ہو سکتا۔','By default, new users will receive an email letting them know they&#8217;ve been added as a user for your site. This email will also contain a password reset link. Uncheck the box if you don&#8217;t want to send the new user a welcome email.'=>'طے شدہ طریقے کے مطابق، نئے صارفین کو ایک ای میل موصول ہو گی جس میں انہیں بتایا جائے گا کہ ان کو آپ کی ویب سائٹ کے صارف کے طور پر شامل کیا جا چکا ہے۔ اس ای میل میں ایک پاسورڈ دوبارہ منتخب کرنے کا لنک بھی ہو گا۔ آپ نئے صارف کو خوش آمدید کی ای میل بھیجنا نہیں چاہتے تو خانے پر سے چیک کو ہٹا دیں۔','Customize New Changes'=>'تازہ ترین تبدیلیوں کو بہتر کریں','You are using a development version of WordPress. You can update to the latest nightly build automatically:'=>'آپ WordPress کا ڈویلپمنٹ ورژن استعمال کر رہے ہیں۔ آپ تازہ ترین شبانہ تعمیر پر خودکار طریقے سے اپڈیٹ کر سکتے ہیں۔','If you need to re-install version %s, you can do so here:'=>'اگر آپ کو ورژن %s دوبارہ انسٹال کرنے کی ضرورت ہے، تو آپ یہاں سے کر سکتے ہیں:','You can select the language you wish to use while using the WordPress administration screen without affecting the language site visitors see.'=>'آپ WordPress کی انتظامی اسکرین کے لیے اپنی پسندیدہ زبان کا انتخاب کر سکتے ہیں یہ آپ کی ویب سائٹ پر آنے والے صارفین کو نظر آنے والی زبان پر اثرانداز نہیں ہو گی۔','short (~12 characters) label for hide controls buttonHide Controls'=>'کنٹرولز کو چھپائیں','The Customizer allows you to preview changes to your site before publishing them. You can navigate to different pages on your site within the preview. Edit shortcuts are shown for some editable elements.'=>'کسٹمائزر آپ  کو تبدیلیاں شائع کرنے سے پہلے آپ کی  ویب سائٹ پر دیکھنے کی سہولت دیتا ہے. پیش منظر کے اندر رہتے ہوئے آپ سائٹ کے مختلف صفحات کو دیکھ سکتے ہیں۔ ترمیمی شارٹ کٹس کچھ قابل تبدیل چیزوں کے لیے ظاہر کیئے گئے ہیں۔','Sorry, you are not allowed to create users.'=>'معاف کیجیے گا، آپ کو صارفین بنانے کی اجازت نہیں ہے۔','Edit User %s'=>' صارف %s میں ترمیم کریں','Site HealthInfo'=>'معلومات','Did you know?'=>'کیا آپ جانتے ہیں؟','Your scheduled changes just published'=>'آپ کے طے کردہ تبدیلیاں ابھی شائع ہوئی ہیں','%s (Month of the year, for example 05.)'=>'%s (سال کا مہینہ، مثال کے طور پر 05۔)','%s (Day of the month, for example 28.)'=>'%s (مہینے کا دن، مثال کے طور پر 28۔)','%s (Hour of the day, for example 15.)'=>'%s (دن کا گھنٹہ، مثال کے طور پر 15۔)','%s (Minute of the hour, for example 43.)'=>'%s (گھنٹے کا منٹ، مثال کے طور پر 43۔)','%s (Second of the minute, for example 33.)'=>'%s (منٹ کا سیکنڈ، مثال کے طور پر 33۔)','%s (The unique ID of the post, for example 423.)'=>'%s (پوسٹ کی منفرد شناخت، مثال کے طور پر 423۔)','%s (The sanitized post title (slug).)'=>'%s (قابل قبول پوسٹ عنوان (سلگ)۔)','%s (Category slug. Nested sub-categories appear as nested directories in the URL.)'=>'%s (زمرہ سلگ۔ نیسٹڈ ذیلی زمرے یوآرایل میں نیسٹڈ ڈائریکٹریز کے طور پر ظاہر ہوتے ہیں۔)','%s (A sanitized version of the author name.)'=>'%s (مصنف کے نام کا قابل قبول ورژن.)','%s added to permalink structure'=>'%s کو پرمالنک اسٹریکچر میں شامل کر دیا','%s (already used in permalink structure)'=>'%s (پہلے سے ہی پرمالنک کی ساخت میں استعمال کیا جا رہا ہے)','Available tags:'=>'دستیاب ٹیگز:','There was an error while trying to update the file. You may need to fix something and try updating again.'=>'فائل اپڈیٹ کرنے کی کوشش کرتے وقت ایک خرابی درپیش تھی۔ آپ کو کچھ درست کرنے کی ضرورت ہو سکتی ہے اور پھر دوبارہ اپڈیٹ کرنے کی کوشش کریں۔','Selected file content:'=>'منتخب کردہ فائل کا مواد:','<strong>Warning:</strong> Making changes to active plugins is not recommended.'=>'<strong>انتباہ:</strong> فعال پلگ ان میں تبدیلیاں کرنے کی سفارش نہیں کی جاتی ہے۔','Heads up!'=>'پیشگی انتباہ!','I understand'=>'میں سمجھتا ہوں','Sorry, you are not allowed to activate this plugin.'=>'معاف کیجیے گا، آپ کو یہ پلگ ان فعال کرنے کی اجازت نہیں ہے۔','Sorry, you are not allowed to deactivate this plugin.'=>'معاف کیجیے گا، آپ کو یہ پلگ ان غیر فعال کرنے کی اجازت نہیں ہے۔','Syntax Highlighting'=>'سنٹیکس ہائی لائٹنگ','Disable syntax highlighting when editing code'=>'کوڈ میں ترمیم کرتے ہوئے سنٹیکس ہائی لائٹر کو غیر فعال کریں','That user could not be added to this site.'=>'اس صارف کو اس سائٹ میں شامل نہیں کیا جا سکا۔','User has been created, but could not be added to this site.'=>'صارف کو تخلیق کر دیا گیا، لیکن اس سائٹ میں شامل نہیں کیا جا سکا۔','Theme Files'=>'تھیم فائلز','https://wordpress.org/about/license/'=>'https://wordpress.org/about/license/','You appear to be making direct edits to your plugin in the WordPress dashboard. We recommend that you don&#8217;t! Editing plugins directly may introduce incompatibilities that break your site and your changes may be lost in future updates.'=>'آپ WordPress ڈیش بورڈ میں اپنے پلگ ان پر براہ راست ترمیم کر رہے ہیں۔ ہم سفارش کرتے ہیں کہ آپ کا پلگ ان میں براہ راست ترمیم کرنا آپ کی ویب سائٹ کو توڑ سکتا ہے اور مستقبل کے اپڈیٹس میں آپ کی تبدیلیاں ضائع ہو سکتی ہیں۔ ','If your %1$s file was <a href="%2$s">writable</a>, we could do this automatically, but it isn&#8217;t so this is the url rewrite rule you should have in your %1$s file. Click in the field and press %3$s to select all. Then insert this rule inside of the %4$s element in %1$s file.'=>'اگر آپ کی %1$s فائل <a href="%2$s">قابل تحریر</a> تھی، ہم خود کار طریقے سے ایسا کرسکتے ہیں،  لیکن یہ نہیں ہے لہذا یہ یو آر ایل دوبارہ لکھنے کا اصول ہے اس کو آپ کی %1$s فائل میں ہونا چاہیے۔ خانے میں کلک کریں اور تمام کو منتخب کرنے کے لیے %1$s دبائیں۔ پھر اس اصول کو %4$s ایلیمینٹ کے اندر%3$s فائل میں داخل کریں۔','If the root directory of your site was <a href="%1$s">writable</a>, we could do this automatically, but it isn&#8217;t so this is the url rewrite rule you should have in your %2$s file. Create a new file, called %2$s in the root directory of your site. Click in the field and press %3$s to select all. Then insert this code into the %2$s file.'=>'اگر آپ کی سائٹ کی روٹ ڈائریکٹری <a href="%1$s">قابل تحریر</a> تھی، ہم خود کار طریقے سے ایسا کر سکتے ہیں، لیکن ایسا نہیں ہے، تو یہ یوآرایل دوبارہ لکھنے کے اصول ہیں جو آپ کی %2$s فائل میں ہونا چاہیں۔ نئی فائل بنائیں، آپ کی سائٹ کی روٹ ڈائریکٹری میں %2$s کہا جاتا ہے۔ خانے میں کلک کریں اور تمام کو منتخب کرنے کے لیے %3$s دبائیں۔ پھر اس کوڈ کو%2$s فائل میں داخل کریں۔','If your %1$s file was <a href="%2$s">writable</a>, we could do this automatically, but it isn&#8217;t so these are the mod_rewrite rules you should have in your %1$s file. Click in the field and press %3$s to select all.'=>'اگر آپ کی %1$s فائل <a href="%2$s">قابل تحریر</a> تھی، ہم خود کار طریقے سے ایسا کر سکتے ہیں، لیکن ایسا نہیں ہے، تو یہ mod_rewrite قوانین ہیں جن کو آپ کی %1$s فائل میں ہونا چاہیں۔ خانے میں کلک کریں اور تمام کو منتخب کرنے کے لیے %3$s دبائیں۔','If you absolutely have to make direct edits to this plugin, use a file manager to create a copy with a new name and hang on to the original. That way, you can re-enable a functional version if something goes wrong.'=>'اگر آپ بالکل اس پلگ ان میں براہ راست ترمیم کرنا چاہتے ہیں تو، ایک نیا نام سے ایک کاپی تخلیق کرنے یا ہنگ کرنے کے لیے فائل مینیجر استعمال کریں۔ اسی طرح، اگر آپ سے کچھ غلط ہو جاتا ہے تو آپ ایک فعال ورژن کو دوبارہ سے فعال کر سکتے ہیں۔','If you decide to go ahead with direct edits anyway, use a file manager to create a copy with a new name and hang on to the original. That way, you can re-enable a functional version if something goes wrong.'=>'اگر آپ کسی بھی طرح براہ راست ترمیم کے ساتھ آگے بڑھنے کا فیصلہ کرتے ہیں تو، نئے نام کے ساتھ کاپی بنائیں اور اصل پر ہینگ کرنے کے لیے فائل مینیجر کا استعمال کریں۔ اسی طرح، اگر آپ کچھ غلط ہو جاتا ہے تو آپ ایک فعال ورژن کو دوبارہ سے فعال کر سکتے ہیں۔','There&#8217;s no need to change your CSS here &mdash; you can edit and live preview CSS changes in the <a href="%s">built-in CSS editor</a>.'=>'یہاں آپ کو سی ایس ایس کو تبدیل کرنے کی ضرورت نہیں ہے &mdash; آپ <a href="%s">پہلے سے موجود سی ایس ایس ایڈیٹر</a> میں سی ایس ایس کی تبدیلیوں میں ترمیم اور براہ راست پیش منظر دیکھ سکتے ہیں۔','Default template'=>'پہلے سے طے شدہ سانچے','This changeset cannot be further modified.'=>'اس چینج سیٹ مزید ترمیم نہیں کی جا سکتی۔','An email will be sent to the user at this email address asking them to verify the request.'=>'اس ای میل ایڈریس پر ایک ای میل صارف کو بھیجا جائے گا کہ وہ درخواست کی تصدیق کریں.','Username or email address'=>'اسم رکنیت یا ای میل','Send Request'=>'درخواست بھیجیں','Sorry, you are not allowed to erase data on this site.'=>'معاف کیجیے گا، آپ کو اس ویب سائٹ پر ڈیٹا حذف کرنے کی اجازت نہیں ہے۔','Add Data Erasure Request'=>'ڈیٹا حذف کرنے کی درخواست جمع  کروائیں','Privacy Policy Guide'=>'پرائیویسی پالیسی گائیڈ','CSS Font Family for Editor FontNoto Serif'=>'Noto Serif','The 1st Freedom'=>'پہلی آزادی','To run the program for any purpose.'=>'کسی بھی مقصد کےلیے پروگرام کو چلائیں۔','The 2nd Freedom'=>'دوسری آزادی','To study how the program works and change it to make it do what you wish.'=>'مطالعہ کرنے کے لیے کہ کس طرح پروگرام کام کرتا ہے اور اسے اپنی مرضی کے مطابق بنانے کے لیے تبدیل کریں۔','The 3rd Freedom'=>'تیسری آزادی','To redistribute.'=>'دوبارہ تقسیم کرنے کے لیے۔','The 4th Freedom'=>'چوتھی آزادی','To distribute copies of your modified versions to others.'=>'دوسروں کو اپنا نظر ثانی شدہ ورژن کی کاپیاں تقسیم کرنے کے 