u items public.'=>'مینو کو محفوظ کرنے کے بٹن پر کلک کریں تاکہ زیرالتوا آئٹمز کو عوامی کیا جائے۔','Current Page'=>'موجودہ صفحہ','postsSticky <span class="count">(%s)</span>'=>'چسپاں <span class="count">(%s)</span>' . "\0" . 'چسپاں <span class="count">(%s)</span>','Search Sites'=>'ویب سائٹس تلاش کریں','Create a New User'=>'ایک نیا صارف بنائیں','You have %1$s and %2$s.'=>'آپ کے پاس %1$s اور %2$s  ہے۔','%s site'=>'%s ویب سائٹ' . "\0" . '%s ویب سائٹس','%s user'=>'%s صارف' . "\0" . '%s صارفین','To perform the requested action, WordPress needs to access your web server.'=>'درخواست کردہ عمل انجام دینے  کے لیے WordPress کو اپ کے ویب سرور تک رسائی حاصل کرنے کی ضرورت ہے۔','https://wordpress.org/news/'=>'https://wordpress.org/news/','https://wordpress.org/news/feed/'=>'http://wordpress.org/news/feed/','No themes match your request.'=>'کوئی تھیم  آپ کی درخواست کے مطابق نہیں ہے۔','By %s.'=>'منجانب %s۔','You must be a member of at least one site to use this page.'=>'یہ صفحہ  استعمال کرنے کے لیے آپ کا کم از کم ایک سائٹ کا رکن ہونا ضروری ہے۔','Global Settings'=>'گلوبل ترتیبات','Visual Editor RTL Stylesheet'=>'بصری ایڈیٹر RTL اسٹائل شیٹ','%1$s rating based on %2$s rating'=>'%1$s ریٹنگ %2$s ریٹنگ پر مبنی ہے' . "\0" . '%1$s ریٹنگ %2$s ریٹنگز پر مبنی ہیں','Activity'=>'سرگرمی','Update Plugin'=>'پلگ ان اپڈیٹ کریں','sample-page'=>'نمونہ صفحہ','Sample Page'=>'نمونہ صفحہ','Any edits to files from this screen will be reflected on all sites in the network.'=>'فائلوں میں اس اسکرین کے ذریعے کی گئی کوئی بھی ترمیم نیٹ ورک کی تمام سائٹس پر ظاہر ہو گی۔','You cannot delete a plugin while it is active on the main site.'=>'آپ اس پلگ ان کو حذف نہیں کر سکتے جبکہ یہ مرکزی سائٹ پہ فعال ہو۔','paging%1$s of %2$s'=>'%1$s کا %2$s','%s Page Template'=>'%s صفحے کا ٹمپلیٹ','You are using an insecure browser!'=>'آپ غیر محفوظ براؤزر استعمال کر رہے ہیں!','Your browser is out of date!'=>'آپ کا براؤزر بہت پرانا ہے!','The WordPress team is willing to help you. Forward this email to %s and the team will work with you 