le to register themselves, as opposed to by the site administrator, check the membership box. A default user role can be set for all new users, whether self-registered or registered by the site admin.'=>'اگر آپ چاہتے ہیں کہ آپ کی سائٹ کے وزٹر رجسٹر ہو سکیں تو ممبر شپ کے باکس کو چیک کریں۔ اس کے علاوہ نئے صارفین کے لیے ایک رول بھی پہلے سے مقرر کیا جا سکتا ہے، پھر چاہے اسے ایڈمن رجسٹر کرے یا پھر وہ خود ہوں۔','Customize Your Site'=>'اپنی سائٹ کو مرضی کے مطابق بنائیں','%s plugins'=>'%s پلگ انز','%s plugin'=>'%s پلگ ان','The package could not be installed.'=>'یہ پیکج انسٹال نہ کیا جا سکا۔','Plugin Homepage &#187;'=>'پلگ ان سرورق &#187;','No comments awaiting moderation.'=>'موڈریشن کے لیے کوئی بھی تبصرہ نہیں ہے۔','Plugin installer section titleChangelog'=>'چینج لاگ','The primary site you chose does not exist.'=>'آپ نے جو بنیادی سائٹ منتخب کی وہ موجود نہیں ہے۔','Plugin installer section titleOther Notes'=>'دیگر نوٹ','Plugin installer section titleFAQ'=>'اکثر پوچھے جانے والے سوالات','Plugin installer section titleInstallation'=>'انسٹالیشن','Plugin installer section titleDescription'=>'تفصیل','Plugin installer section titleScreenshots'=>'اسکرین شاٹس','Add new Comment'=>'نیا تبصرہ شامل کریں','Keyword'=>'کی ورڈز','Preview:'=>'پیش منظر:','Collapse Sidebar'=>'سائیڈ بار کو بند کریں','Select All'=>'تمام منتخب کریں','Edit Link'=>'لنک میں ترمیم کریں','Search for themes by keyword.'=>'کی ورڈذ سے تھیمز تلاش کریں','Find a theme based on specific features.'=>'مخصوص خصوصیات کی بنیاد پر ایک تھیم کو تلاش کریں۔','Preview %s'=>'پیش منظر %s','This theme is already installed and is up to date'=>'تھیم پہلے سے انسٹال ہے، اور جدید ہے۔','Collapse'=>'بند کریں','Skip Cropping, Publish Image as Is'=>'تصویر کو کراپ نہ کریں جیسی ہے شائع کر دیں۔','Search Engines Discouraged'=>'سرچ انجن بند ہیں','Welcome to WordPress!'=>'WordPress پر خوش آمدید!','We&#8217;ve assembled some links to get you started:'=>'آپ کی شروعات کو آسان کرنے لیے ہم نے کچھ لِنک اکھٹے کیے ہیں:','Get Started'=>'شروعات کریں','or, <a