>'WordPress %s اپڈیٹ کیا جا رہا ہے۔','WordPress %s'=>'WordPress %s','The checksum of the file (%1$s) does not match the expected checksum value (%2$s).'=>'فائل (%1$s) کا چیک سم فائل (%2$s) کے چیک سم ویلیو سے میل نہیں کھاتا۔','This password will not be stored on the server.'=>'یہ پاسورڈ سرور پر محفوظ نہیں کیا جائے گا۔','Upgrading to a newer version of the same theme will override changes made here. To avoid this, consider creating a <a href="%s">child theme</a> instead.'=>'اگر آپ موجودہ تھیم کے نئے ورژن پر اپگریڈ ہونگے تو اس میں کی گئی تبدیلیاں ختم ہو جائیں گی۔ اس صورتحال سے بچنے کے لیے ایک <a href="%s">چائلڈ تھیم</a> بنائیں۔','Some of your translations need updating. Sit tight for a few more seconds while we update them as well.'=>'کچھ تراجم کو اپڈیٹ کی ضرورت ہے، آپ کچھ سیکنڈ کے لیے آرام سے بیٹھیں جب تک ہم ان کو اپڈیٹ کر لیں۔','Translation update failed.'=>'ترجمے کو اپڈیٹ کرنے میں ناکامی۔','Translation updated successfully.'=>'ترجمہ کامیابی سے اپڈیٹ ہو چکا ہے۔','Updating theme: %s'=>'تھیم کو اپڈیٹ کیا جا رہا ہے: %s','Updating plugin: %s'=>'پلگ ان %s کو اپڈیٹ کیا جا رہا ہے۔','Update Translations'=>'تراجم اپڈیٹ کریں','Updating translations for %1$s (%2$s)&#8230;'=>'%1$s (%2$s) کے لیے تراجم کو اپڈیٹ کیا جا رہا ہے&#8230;','Translations for %s'=>'تراجم برائے %s','[%1$s] Your site has updated to WordPress %2$s'=>'[%1$s] آپ کی سائٹ WordPress %2$s پر اپڈیٹ ہو چکی ہے۔','[%1$s] WordPress %2$s is available. Please update!'=>'[%1$s] WordPress %2$s دستیاب ہے۔ براہ مہربانی اپڈیٹ کریں!','[%1$s] URGENT: Your site may be down due to a failed update'=>'[%1$s] اشد ضروری: آپ کی ویب سائٹ اپڈیٹ ناکام ہونے کی وجہ سے ڈاؤن ہو سکتی ہے۔','Howdy! Your site at %1$s has been updated automatically to WordPress %2$s.'=>'کیسے ہیں! آپ کی سائٹ %1$s سے خودبخود WordPress %2$s پر اپڈیٹ ہو جائے گئی۔','No further action is needed on your part.'=>'آپکی طرف سے مزید کارروائی کی ضرورت نہیں ہے۔','For more on version %s, see the About WordPress screen:'=>'ورژن %s کے بارے میں مزید جاننے کے لیے WordPress کی متع