 upload your PHP file change by some other means, such as by using SFTP.'=>'مہلک خرابیوں کی جانچ پڑتال کے لیے سائٹ کے ساتھ تعلق قائم کرنے میں ناکامی، تو پی ایچ پی کی تبدیلی واپس کردی گئی ہے۔ آپ کو اپنی دوسری پی ایچ پی فائل میں تبدیلی کرنے کی ضرورت ہو گی، جیسا کہ ایس ایف ٹی پی استعمال کرتے ہوئے۔','Customization Draft'=>'حسب ضرورت ڈرافٹ','Likely direct inclusion of %1$s in order to use %2$s. This is very wrong. Hook the %2$s call into the %3$s action instead.'=>'%2$s کو استعمال کرنے کے لیے %1$s کو شامل شاید شامل کیا گیا ہے۔ یہ بہت غلط ہے۔ %2$s  کی کال کو %3$s  ایکشن کے ساتھ ہُک کریں۔ ','Downloading translation from %s&#8230;'=>'%s&#8230; سے ترجمہ ڈاؤن لوڈ کیا جا رہا ہے','From time to time, your WordPress site may send data to WordPress.org &#8212; including, but not limited to &#8212; the version of WordPress you are using, and a list of installed plugins and themes.'=>'وقتاً فوقتاً، آپ کی WordPress سائٹ WordPress.org کو ڈیٹا بھیج سکتی ہے۔ بشمول، لیکن WordPress کے ورژن تک محدود نہیں ہے جو آپ استعمال کر رہے ہیں، اور انسٹال شدہ پلگ انز اور تھیمز کی فہرست۔','We take privacy and transparency very seriously. To learn more about what data we collect, and how we use it, please visit <a href="%s">WordPress.org/about/privacy</a>.'=>'ہم رازداری اور شفافیت کو بہت سنجیدگی سے لیتے ہیں۔ ہم جس ڈیٹا کو جمع کرتے ہیں اور ہم اسے کیسے استعمال کرتے ہیں کے بارے میں مزید جاننے کے لیے، براہ مہربانی <a href="%s">WordPress.org/about/privacy</a> پر جائیں۔','Enter the address here if you <a href="%s">want your site home page to be different from your WordPress installation directory</a>.'=>'یہاں ایڈریس درج کریں اگر آپ <a href="%s">اپنی سائٹ کے سرورق کو اپنی WordPress انسٹالیشن ڈائریکٹری سے مختلف کرنا چاہتے ہیں</a>۔','Requires PHP Version:'=>'پی ایچ پی ورژن کی ضرورت ہے:','Invalid email address in request.'=>'درخواست مین ای میل درست نہیں ہے','Eraser index cannot be less than one.'=>'ایرزر انڈیکس ایک سے کم نہیں ہوسکتی ہے.','Page index cannot be less than one.'=>'صفحہ انڈیکس ایک سے کم نہیں ہوسکتا ہے.','Expected an array describing the eraser at index %d.'=>'فہرست %d پر ایک ایرے متوقع ہے جو مٹانے کی وضاحت کرے۔','This data is used to provide general enhancements to WordPress, which includes helping to protect your site by finding and automatically installing new updates. It is also used to calculate statistics, such as those shown on the <a href="%s">WordPress.org stats page</a>.'=>'یہ ڈیٹا WordPress میں بہتریاں لانے کے لیے استعمال ہوتا ہے، اس میں خودبخود نئی اپڈیٹس انسٹال کر کے آپ کی سائٹ کو محفوظ بنانا بھی شامل ہے۔ یہ <a href="%s"> کے اعداد و شمار WordPress.org </a> والے صفحے کی طرح اعدادوشمار کرنے میں بھی مدد دیتا ہے۔','Eraser array at index %d does not include a friendly name.'=>'انڈیکس %d میں ایرزر صف میں دوستانہ نام شامل نہیں ہے.','Did not receive array from %1$s eraser (index %2$d).'=>'(فہرست %2$d) پر  %1$s مٹانے والے کی جانب سے کوئی ایرے موصول نہیں ہوئی۔','Expected items_removed key in response array from %1$s eraser (index %2$d).'=>'%1$s مٹانے والے (فہرست %2$d) سے جوابی ایرے میں متوقع items_removed کی کنجی۔','Expected items_retained key in response array from %1$s eraser (index %2$d).'=>'مٹانے والی %1$s (فہرست %2$d) کی جانب سے جوابی ایرے میں باقی رہ جانے والی items_retained متوقع کنجیاں۔','Expected messages key in response array from %1$s eraser (index %2$d).'=>'مٹانے والی %1$s (فہرست %2$d) کی جانب سے جوابی ایرے میں متوقع جوابی کنجیاں۔','Expected messages key to reference an array in response array from %1$s eraser (index %2$d).'=>'مٹانے والی %1$s (فہرست %2$d) کی جانب سے جوابی ایرے کے حوالے سے ایرے کا متوقع جوابی کنجی۔','Expected done flag in response array from %1$s eraser (index %2$d).'=>'%1$s مٹانے والے (فہرست  %2$d) کی جانب سے جوابی ایرے میں متوقع تکمیل کا علم','Invalid request ID.'=>'غلط درخواست آئی ڈی۔','Force Erase Personal Data'=>'ذاتی مواد زبردستی مٹا دیں','A valid email address must be given.'=>'ایک درست ای میل ایڈریس لازمی ہے.','The suggested privacy policy content should be added only in wp-admin by using the %s (or later) action.'=>'تجویز کردہ آپ کی پرائیویسی پالیسی کا مواد صرف %s (یا بعد میں) کارروائی کا استعمال کرتے ہوئے صرف wp-admin میں شامل کیا جانا چاہیے۔','privacy-policy'=>'پرائیویسی پالیسی','Invalid request type.'=>'درخواست کی غلط قسم۔','Missing exporter index.'=>'برآمدی فہرست غائب ہے۔','Missing page index.'=>'صفے کی فہرست غائب ہے۔','An exporter has improperly used the registration filter.'=>'ایک برآمد کنندہ نے رجسٹریشن فلٹر کو غلط استعمال کیا ہے.','Exporter index cannot be negative.'=>'برآمد کنندہ انڈیکس منفی نہیں ہو سکتا۔','Exporter index is out of range.'=>'برآمد کنندہ انڈیکس رینج سے باہر ہے۔','Expected an array describing the exporter at index %s.'=>'برآمد کنندہ نے انڈیکس٪ s پر برآمد کی توقع کی%s.','Exporter does not include a callback: %s.'=>'برآمد کنندہ میں کال بیک بیک شامل نہیں ہے:%s.','Exporter callback is not a valid callback: %s.'=>'برآمد کنندہ کال بیک درست کال بیک نہیں ہے: %s.','Expected response as an array from exporter: %s.'=>'برآمد کنندہ سے ایک صف کے طور پر متوقع جواب:%s.','Expected data in response array from exporter: %s.'=>'برآمد کنندہ سے جوابی صف میں متوقع ڈیٹا.%s','Expected data array in response array from exporter: %s.'=>'برآمد کنندہ کی جانب سے جوابی ایرے میں متوقع ڈیٹا ایرے : %s.','Expected done (boolean) in response array from exporter: %s.'=>'برآمدکنندہ کی جانب سے جوابی ایرے میں ممکنہ مکمل (بولین) : %s.','Missing eraser index.'=>'مٹانے والی انڈیکس گمشدہ ہے۔','Eraser index is out of range.'=>'مٹانے والی فہرست پہنچ سے باہر ہے۔','Exporter array at index %s does not include a friendly name.'=>'فہرست %s میں برآمد کنندہ ایرے میں کوئی آسان نام نہیں شامل نہیں۔','Force Erasure has failed.'=>'جبرا حذف کرنے میں ناکامی۔','Erasing Data...'=>'ڈیٹا حذف ہو رہا ہے۔۔۔','The suggested privacy policy content should be added by using the %s (or later) action. Please see the inline documentation.'=>'تجویز کردہ پرائیویسی پالیسی کے مواد کو %s (یا بعد میں) کارروائی کا استعمال کرتے ہوئے شامل کیا جانا چاہیے۔ براہ مہربانی آن لائن دستاویزات دیکھیں۔','Privacy Policy Page'=>'پرائیویسی پالیسی کا صفحہ','Privacy Policy'=>'پرائیویسی پالیسی','Welcome to WordPress. This is your first post. Edit or delete it, then start writing!'=>'WordPress میں خوش آمدید۔ یہ آپ کی پہلی پوسٹ ہے۔ اس میں ترمیم کریں یا حذف کریں، پھر لکھنا شروع کریں!','This meta box, from the %s plugin, isn\'t compatible with the block editor.'=>'اس میٹا باکس کی، %s پلگ ان سے، بلاک ایڈیٹر کے ساتھ مطابقت نہیں ہے۔','Export &#8220;%s&#8221; as JSON'=>'JSON کے طور پر &#8220;%s&#8221; برآمد کریں','Export as JSON'=>' JSON کے طور پر برآمد کریں','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:'=>'یہ ایک مثالی صفحہ ہے۔ بلاگ پوسٹ سے مختلف ہے کیونکہ یہ ایک ہی جگہ پر رہیں گے اور آپ کی سائٹ نیویگیشن (زیادہ تر موضوعات میں) دکھایا جائے گا۔ زیادہ تر لوگوں ایک صفحے کے ساتھ شروع کرتے ہیں جو انہیں ممکنہ سائٹ کے زائرین کے ساتھ متعارف کراتا ہے۔ یہ اس طرح کچھ کہہ سکتا ہے:','Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)'=>'سلام! میں بائیک بائیک مسینجر ہوں، رات کا خواہش مند اداکار، اور یہ میری ویب سائٹ ہے۔ میں لاس اینجلس میں رہتا ہوں، جیک نامی میرا کتا ہے، اور مجھے کولا پینا پسند ہے. (اور بارش میں پکڑا جاتا ہوں)۔','...or something like this:'=>'۔۔۔ یا اس طرح کچھ:','The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.'=>' XYZ Doohickey کمپنی کو 1971 میں قائم کیا گیا تھا اور اس وقت سے عوام کو معیاری doohickeys فراہم کر رہی ہے۔ گوتھم شہر میں واقع ہے، XYZ دو ہزار سے زائد لوگوں کو ملازمت دیتا ہے اور گوتھم کمیونٹی کے لیے تمام اقسام کی بہتری کرتا ہے۔','As a new WordPress user, you should go to <a href="%s">your dashboard</a> to delete this page and create new pages for your content. Have fun!'=>'نئے WordPress صارف کے طور پر، آپ کو اس صفحے کو حذف کرنے اور اپنے مواد کے لیے نئے صفحات بنانے کے لیے <a href="%s">اپنے ڈیش بورڈ</a> پر جانا چاہیے۔ مزے کریں!','This meta box isn\'t compatible with the block editor.'=>'یہ میٹا باکس بلاک ایڈیٹر کے ساتھ مطابقت نہیں رکھتا۔','Please install the <a href="%s">Classic Editor plugin</a> to use this meta box.'=>'اس میٹا باکس کو استعمال کرنے کے لیے براہ مہربانی <a href="%s">کلاسک ایڈیٹر پلگ ان</a> انسٹال کریں۔','Please activate the <a href="%s">Classic Editor plugin</a> to use this meta box.'=>'اس میٹا باکس کو استعمال کرنے کے لیے براہ مہربانی <a href="%s">کلاسک ایڈیٹر پلگ ان</a> فعال کریں۔','Please open the <a href="%s">classic editor</a> to use this meta box.'=>'اس میٹا باکس کو استعمال کرنے کے لیے براہ مہربانی <a href="%s">کلاسک ایڈیٹر پلگ ان</a> کو کھولیں۔','Add to: %s'=>'شامل کریں از: %s','Add widget: %s'=>'ویجٹ شامل کریں از: %s','<a href="%s" target="_blank">Click here to learn more about updating PHP</a>.'=>'<a href="%s" target="_blank">پی ایچ پی کو اپڈیٹ کرنے کے بارے میں مزید جاننے کے لیے یہاں کلک کریں</a>۔','<strong>Error:</strong> This plugin <strong>requires a newer version of WordPress</strong>.'=>'<strong>خرابی:</strong> اس پلگ ان کو <strong>ورڈپریس کے نئے ورژن کی ضرورت ہے</strong>۔','<a href="%s" target="_parent">Click here to update WordPress</a>.'=>'<a href="%s" target="_parent">اپنے WordPress کو اپڈیٹ کرنے کے لیے یہاں کلک کریں</a>۔','Removing the old version of the translation&#8230;'=>'ترجمے کا پرانا ورژن حذف کیا جا رہا یے','Could not remove the old translation.'=>'پرانے ترجمے کو حذف نہیں کیا جا سکتا۔','Custom PHP error message.'=>'مرضی کے ڈیٹا بیس میں خرابی کا پیغام۔','Could not resume the plugin.'=>'پلگ اِن کو دوبارہ شروع نہیں کیا جا سکتا۔','You can find more details and make changes on the Plugins screen.'=>'آپ مزید معلومات تلاش کر سکتے ہیں اور پلگ ان اسکرین پر تبدیلیاں کر سکتے ہیں۔','PHP Update Re