نتخب کرنے کے لیے آپ کو جاوا اسکرپٹ کی ضرورت ہے۔','Images of exactly <strong>%1$d &times; %2$d pixels</strong> will be used as-is.'=>'صرف <strong>%1$d &times; %2$d پکسلز</strong> والی تصویر استعمال کی جا سکتی ہے۔','Update Theme'=>'تھیم اپڈیٹ کریں','<strong>Random:</strong> Show a different image on each page.'=>'<strong>بے ترتیب:</strong> ہر صفحے پہ مختلف تصویر دکھائیں۔','Uploaded Images'=>'اپلوڈ کی گئی تصاویر','You can use one of these cool headers or show a random one on each page.'=>'آپ دلکش ہیڈرز میں کوئی استعمال کر سکتے ہیں یا ہر صفحے پر بغیر ترتیب کے کوئی بھی دکھا سکتے ہیں۔','If you don&lsquo;t want to upload your own image, you can use one of these cool headers, or show a random one.'=>'اگر آپ اپنی تصویر اپ لوڈ نہیں کرنا چاہتے توآپ ان میں سے کسی زبردست ہیڈر کو استعال کریں یا کوئی سا بھی ایک استعمال کریں۔','You can choose one of your previously uploaded headers, or show a random one.'=>'آپ پہلے سے اپ لوڈ کسی ہیڈرکا انتخاب کریں یا کوئی سا بھی ایک استعمال کریں۔','start of week1'=>'1','Hi,
