%%s','Confirm Deletion'=>'حذف کرنے کی تصدیق کریں','Audio, Video, or Other File'=>'آڈیو، ویڈیو، یا دوسری فائل','View'=>'دیکھیں','Super Admin'=>'سپر ایڈمن','Scale images to match the large size selected in %1$simage options%2$s (%3$d &times; %4$d).'=>'تصاویر کا سائز تبدیل کر کے %1$s تصویر کے آپشن %2$s میں منتخب کیے گئے بڑے سائز کے مطابق کریں۔ (%3$d &گنا; %4$d)۔','Role'=>'کردار','Insert media from another website'=>'دوسری ویب سائٹ سے تصویر شامل کریں','Welcome to WordPress %1$s. <a href="%2$s">Learn more</a>.'=>'WordPress %1$s پر خوش آمدید۔ <a href="%2$s">مزید جانیے</a>۔','default GMT offset or timezone string0'=>'0','Attachment Post URL'=>'منسلکہ پوسٹ یوآرایل','Image could not be processed. Please go back and try again.'=>'آپ کے تصویر پر عملدرآمد فی الحال ممکن نہیں۔ براہ مہربانی واپس جائیں اور دوبارہ کو شش کریں۔','Visit Dashboard'=>'ڈیش بورڈ پر جائیں','Your Sites'=>'آپ کی سائٹس','If you reached this screen by accident and meant to visit one of your own sites, here are some shortcuts to help you find your way.'=>' اگر آپ حادثاتی طور پہ اس اسکرین پر آئے ہیں، اور آپ اپنی کسی اور سائٹ پر جانا چاہتے تھے، یہ شارٹ کٹس آپ کی رہنمائی کر سکتے ہیں۔','You attempted to access the "%1$s" dashboard, but you do not currently have privileges on this site. If you believe you should be able to access the "%1$s" dashboard, please contact your network administrator.'=>'آ پ نے "%1$s"  ڈیش بورڈ کو استعمال کرنے کی کوشش کی ہے لیکن آپ کے پاس اس سائٹ کے اختیارات نہیں ہیں۔ 
اگر آپ کو یقین ہے کہ "%1$s" ڈیش بورڈ تک رسائی ہونی چاہیے توبراہ مہربانی اپنے نیٹ ورک منتضم سے رابطہ کریں۔','MB (Leave blank for network default)'=>'ایم بی (طےشدہ نیٹ ورک کے لیے خالی چھوڑ دیں)','British English'=>'برٹش انگلش','View Site'=>'ویب سائٹ دیکھیں','American English'=>'امریکن انگلش','Primary Site'=>'بنیادی سائٹ','Detach'=>'علیحدہ کریں','Add Comment'=>'تبصرہ شامل کریں ','Header Text'=>'ہیڈر متن','Show header text with your image.'=>'اپنی تصویر کے ساتھ ہیڈر متن دکھائیں۔','Restore'=>'بحال کریں','Actions'=>'عوامل','&uarr; Return to Top'=>'&uarr; واپس اوپر جائیں','No comments yet.'=>'ابھی تک کوئی تبصرہ نہیں ہے۔','Link URL'=>'یوآرایل لنک','Enter a link URL or click above for presets.'=>'لنک یوآرایل ڈالیں یا پری سیٹس کے لیے اوپر کلک کریں۔','<strong>Error</strong>: Please enter a nickname.'=>'<strong>خرابی</strong>: براہ مہربانی عرف درج کریں۔','Customize &#8220;%s&#8221;'=>'مرضی کے مطابق بنائیں &#8220;%s&#8221;','Set as header'=>'بطور ہیڈر لگائیں','Revision by %s'=>'نظرثانی منجانب %s','Could not copy files. You may have run out of disk space.'=>'فائلیں کاپی نہیں ہو سکیں۔ ہو سکتا ہے آپ کی ہارڈ ڈسک میں جگہ نہ ہو۔','This screen is used to customize the header section of your theme.'=>'یہ اسکرین آپ کی تھیم کے ہیڈر سیکشن کو مرضی کے مطابق کرنے کے لیے استمعال ہوتی ہے۔','You can choose from the theme&#8217;s default header images, or use one of your own. You can also customize how your Site Title and Tagline are displayed.'=>'آپ تھیم &#8217;s سے موجودہ ہیڈر یا خود اپنی تصاویر کا انتخاب کر سکتے ہیں۔ آپ اپنی سائٹ کے عنوان اور ٹیگ لائن کی ظاہری شکل بھی تبدیل کر سکتے ہیں۔','Some themes come with additional header images bundled. If you see multiple images displayed, select the one you&#8217;d like and click the &#8220;Save Changes&#8221; button.'=>'کچھ تھیم میں ہیڈر کے لیے پہلے سے اضافی تصاویر موجود ہوتی ہیں۔ اگر آپ کو ایک سے زیادہ تصاویر نظر آئیں تو آپ جس تصویر کو پسند کرتے ہوں منتخب کریں اور &#8220;تبدیلیاں محفوظ کریں&#8221 کے بٹن پر کلک کریں۔','If your theme has more than one default header image, or you have uploaded more than one custom header image, you have the option of having WordPress display a randomly different image on each page of your site. Click the &#8220;Random&#8221; radio button next to the Uploaded Images or Default Images section to enable this feature.'=>'اگر آپ کی تھیم میں ایک سے زیادہ ہیڈر تصاویر ہیں یا آپ نے ایک سے زیادہ ہیڈر تصاویر اپلوڈ کی ہیں تو آپ کے پاس اختیارات ہوتے ہیں کہ WordPress میں مختلف صفحات پر مختلف تصاویر دکھا سکیں۔ ایسا کرنے کے لیے اپلوڈ کردہ تصاویر یا طے شدہ تصاویر کے آگے موجود &#8220;بے ترتیب&#8221;  کے اختیار کا انتخاب کریں۔','For most themes, the header text is your Site Title and Tagline, as defined in the <a href="%s">General Settings</a> section.'=>'زیادہ تر تھیمز میں ہیڈر کا متن آپ کی سائٹ کا نام اور ٹیگ لائین ہوتی ہے، جیسے کہ <a href="%s">عمومی ترتیبات</a> کے سیکشن میں واضع کیا گیا ہے۔','You are using the browser&#8217;s built-in file uploader. The WordPress uploader includes multiple file selection and drag and drop capability. <a href="#">Switch to the multi-file uploader</a>.'=>'آپ براؤزر کا طےشدہ اپلوڈر استعمال کر رہے ہیں۔ آپ WordPress کا اپلوڈر بھی استعمال کر سکتے ہیں جس میں ایک سے زیادہ فائل اپلوڈنگ کے ساتھ ساتھ ڈریگ اور ڈراپ کی صلاحیت بھی ہے۔ <a href="#">ملٹی پل فائل اپلوڈر پر منتقل ہوں۔</a>','pluginInstalled'=>'انسٹال شدہ','If you don&#8217;t want a header image to be displayed on your site at all, click the &#8220;Remove Header Image&#8221; button at the bottom of the Header Image section of this page. If you want to re-enable the header image later, you just have to select one of the other image options and click &#8220;Save Changes&#8221;.'=>'اگر آپ چاہتے ہیں کہ آپ کے ہیڈر پر تصویر دکھائی نہ دے تو ہیڈر تصویر کے سیکشن کے نیچے موجود &#8220;ہیڈر تصویر حذف کریں&#8221; والے بٹن پر کلک کریں۔ اور اگر آپ اس ترتیبات کو بعد میں تبدیل کرنا چاہتے ہیں تو آپ کو صرف ایک تصویر منتخب کرنی ہے اور &#8220;تبدیلیاں محفوظ کریں&#8221; والے بٹن پر کلک کرنا ہے۔','Plugin InstallerFavorites'=>'پسندیدہ','You can set a custom image header for your site. Simply upload the image and crop it, and the new header will go live immediately. Alternatively, you can use an image that has already been uploaded to your Media Library by clicking the &#8220;Choose Image&#8221; button.'=>'آپ اپنی سائٹ پہ اپنی مرضی کی تصویر والا ہییڈر لگا سکتے ہیں۔ بس تصویر اپلوڈ کریں، سائز ٹھیک کریں اور ہیڈر فوراً براہ راست ہو جائے گا۔ متبادل کے طور پہ آپ &#8220;تصویر منتخب کریں&#8221; والے بٹن پر کلک کر کے میڈیا لائبریری میں پہلے سے اپلوڈڈ تصویر کو بھی منتخب کر سکتے ہیں۔','File URL:'=>'فائل کا یوآرایل:','Welcome to WordPress %1$s. You will be redirected to the About WordPress screen. If not, click <a href="%2$s">here</a>.'=>'WordPress %1$s میں خوش آمدید۔ ابھی آپ WordPress کی معلوماتی اسکرین پر چلے جائیں گے۔ اگر نہ جا پائیں تو <a href="%2$s">یہاں</a> کلک کریں۔','Used: %1$s%% of %2$s'=>'استعمال ہو چکا ہے: %1$s%% of %2$s','Choose a Custom Header'=>'مرضی کا ہیڈر منتخب کریں','column nameUploaded to'=>'اپ لوڈ کیا گیا از','colorDefault: %s'=>'طےشدہ: %s','You are using the multi-file uploader. Problems? Try the <a href="%1$s" %2$s>browser uploader</a> instead.'=>'آپ ملٹی فائل اپلوڈر استعمال کر رہے ہیں۔ مسئلے کی صورت میں <a href="%1$s" %2$s>براؤزر کا اپلوڈر</a> استعمال کریں۔ ','Don&#8217;t forget to click &#8220;Save Changes&#8221; when you&#8217;re done!'=>'جب کام مکمل ہو جائے تو &#8220;تبدیلیاں محفوظ کریں&#8221; پر کلک کرنا نہ بھولیں۔','In the Header Text section of this page, you can choose whether to display this text or hide it. You can also choose a color for the text by clicking the Select Color button and either typing in a legitimate HTML hex value, e.g. &#8220;#ff0000&#8221; for red, or by choosing a color using the color picker.'=>'اس صفحے کے ہیڈر کے متن سیکشن میں منتخب کر سکتے ہیں کہ آپ متن ظاہر کرنا چاہتے ہیں یا نہیں۔ آپ اس کا رنگ بھی ایک HTML ہیکس نمبر جیسا کہ &#8220;#ff0000&#8221; جو کہ سرخ رنگ ہے، کے ذریعے سے منتخب کر سکتے ہیں۔اس کے علاوہ آپ اس مقصد کے لیے کلر پِکر کا استعمال بھ