nation'=>'صفحہ بندی','View Mode'=>'دیکھیے کا موڈ','No role'=>'کوئی کردار نہیں','no user rolesNone'=>'کوئی بھی نہیں','Invalid image URL.'=>'تصویر کا یوآرایل درست نہیں ہے۔','You have chosen to delete the user from all networks and sites.'=>'آپ نے تمام نیٹ ورکس اور ویب سائٹس سے صارف کو حذف کرنے کے لیے منتخب کیا ہے۔','You have chosen to delete the following users from all networks and sites.'=>'آپ نے تمام نیٹ ورکس اور ویب سائٹس سے مندرجہ ذیل صارفین کو حذف کرنے کے لیے منتخب کیا ہے۔','Warning! User %s cannot be deleted.'=>'انتباہ! صارف %s کو حذف نہیں کیا جا سکتا۔','Warning! User cannot be deleted. The user %s is a network administrator.'=>'انتباہ! صارف کو حذف نہیں کیا جا سکتا۔ صارف %s ایک نیٹ ورک ایڈمنسٹریٹر ہے۔','What should be done with content owned by %s?'=>'%s کے مواد کے ساتھ کیا کرنا چاہیے؟','Select a user'=>' صارف کو منتخب کریں','Site: %s'=>'سائٹ: %s','User has no sites or content and will be deleted.'=>'صارف کے پاس  کوئی سائٹس یا مواد نہیں ہے اور اسکو حذف کر دیا جائے گا۔','Once you hit &#8220;Confirm Deletion&#8221;, the user will be permanently removed.'=>'ایک بار جب آپ حذف کرنے کی تصدیق پر کلک کریں گے تو یہ صارف مستقل طور پر حذف ہو جائے گا۔','Once you hit &#8220;Confirm Deletion&#8221;, these users will be permanently removed.'=>'ایک بار جب آپ &#8220;حذف کرنے کی تصدیق&#8221; کو کلک کریں گے تو یہ صارفین مستقل طور پر حذف ہو جائیں گے۔','Warning'=>'انتباہ','Edit permalink'=>'پرما لنکس میں ترمیم کریں','Saving revision&hellip;'=>'نظرِ ثانی محفوظ کی جا رہی ہے&hellip;','You are about to delete %s.'=>'آپ %s کو حذف کرنے والے ہیں۔','Images should be at least %s wide.'=>'تصاویر کم از کم %s چوڑا ہونی چاہییں۔','%d pixels'=>'%d پکسلز','Images should be at least %s tall.'=>'تصاویر کم از کم %s لمبی ہونی چاہییں۔','Suggested width is %s.'=>'تجویز کردہ چوڑائی %s ہے۔','Suggested height is %s.'=>'تجویز کردہ اونچائی %s ہے۔','The ssh2 PHP extension is available, however, we require the PHP5 function %s'=>'PHP کا ssh2 ایکسٹنشن دستیاب ہے، تاہم php 5 کا %s فنکشن ضروری ہے۔','attachment filterTrash'=>'ردی کی ٹوکری','&#8220;%s&#8221; (Edit)'=>'&#8220;%s&#8221; (ترمیم کریں)','Detach from &#8220;%s&#8221;'=>' &#8220;%s&#8221; سے جدا کریں','Attach &#8220;%s&#8221; to existing content'=>'&#8220;%s&#8221; کو موجودہ مواد کے ساتھ منسلک کریں','Move &#8220;%s&#8221; to the Trash'=>'&#8220;%s&#8221; کو ردی کی ٹوکری میں منتقل کریں','Delete &#8220;%s&#8221; permanently'=>'&#8220;%s&#8221; کو مستقل طور پر حذف کریں','Restore &#8220;%s&#8221; from the Trash'=>'&#8220;%s&#8221; کو ردی کی ٹوکری سے بحال کریں','Quick edit &#8220;%s&#8221; inline'=>'فوری ترمیم &#8220;%s&#8221; inline','Delete &#8220;%s&#8221;'=>'&#8220;%s&#8221; حذف کریں','View &#8220;%s&#8221; archive'=>'دیکھیں &#8220;%s&#8221; آرکائیو','Another update is currently in progress.'=>'ایک اور اپڈیٹ فی الحال جاری ہے۔','Click the image to edit or update'=>'تصویر میں ترمیم  یا اپڈیٹ کے لیے کلک کریں','Excerpts are optional hand-crafted summaries of your content that can be used in your theme. <a href="%s">Learn more about manual excerpts</a>.'=>'اقتباسات آپ کے مواد کے خود سے بنائے گئے وہ خلاصے ہوتے ہیں جو آپ اپنی تھیم میں دیکھا سکتے ہیں۔ <a href="%s">خود بنائے گئے خلاصوں کے بارے میں مزید جانیے</a>۔','Trackbacks are a way to notify legacy blog systems that you&#8217;ve linked to them. If you link other WordPress sites, they&#8217;ll be notified automatically using <a href="%s">pingbacks</a>, no other action necessary.'=>'ٹریک بٰیکس میراث بلاگ سسٹم کو مطلع کرنے کا ایک طریقہ  ہے کہ آپ ان سے جوڑے ہوئے ہیں ۔ اگر آپ دیگر WordPress سائٹ لنک کرتے ہیں تو، انکو خود بخود مطلع کیا جائے گا <a href="%s">pingbacks</a> استعمال کرتے ہوئے، کوئی دیگر عمل ضروری نہیں۔','Custom fields can be used to add extra metadata to a post that you can <a href="%s">use in your theme</a>.'=>'مرضی کے فیلڈز پوسٹ کو اضافی میٹا ڈیٹا شامل کرنے کے لیے استعمال کیا جا سکتا ہے جو آپ اپنی <a href="%s">تھیم میں استعمال کر سکتے ہیں</a>۔','Allow <a href="%s">trackbacks and pingbacks</a> on this page'=>'اس صفحے پر <a href="%s">ٹریک بیکس اور پنگ بیکس</a> کی اجازت دیجیے۔','(Private post)'=>'(نجی پوسٹ)','pluginActive'=>'فعال','Need help? Use the Help tab above the screen title.'=>'مدد کی ضرورت ہے؟ اسکرین کے عنوان کے اوپر مدد کے ٹیب کو استعمال کریں۔','Info'=>'معلومات','%s theme successfully updated.'=>'%s تھیم کامیابی سے اپڈیٹ کر دی گئی۔','%s plugins successfully updated.'=>'%s پلگ انز کامیابی سے اپڈیٹ کر دیئے گئے۔','%s themes successfully updated.'=>'%s تھیمز کامیابی سے اپڈیٹ کر دی گئیں۔ ','theme%s was successfully deleted.'=>'%s  کامیابی سے حذف کر دیا گیا تھا۔','plugin%s was successfully deleted.'=>'%s کامیابی سے حذف کر دیا گیا۔','%s update failed.'=>'%s اپڈیٹ میں ناکامی۔','%s updates failed.'=>'%s اپڈیٹس میں ناکامی۔','Active plugin installationsLess Than 10'=>'10 سے کم','Set status'=>'اسٹیٹس لگائیں','Invalid API response code (%d).'=>'اے پی آئی کا نا مناسب ریسپانس کوڈ (%d)۔','Unknown API error.'=>'اے پی آئی کی نامعلوم خرابی۔','l, M j, Y'=>'l، M j، Y','Get help resolving this issue.'=>'اس مسئلے کے حل کے لیے مدد لیں۔','%s Active Installations'=>'%s فعال انسٹالیشنز','No description'=>'کوئی تفصیل نہیں','View posts by %s'=>' %s کے لحاظ سے پوسٹس دیکھیں','nameUnknown'=>'نامعلوم','The menu is for editing information specific to individual sites, particularly if the admin area of a site is unavailable.'=>'مینو انفرادی سائٹس کے لیے مخصوص ترمیم کی معلومات کے لیے ہے، خاص طور پر اگر کسی ویب سائٹ کا منتظم ایریا دستیاب نہیں ہو۔','<strong>Info</strong> &mdash; The site URL is rarely edited as this can cause the site to not work properly. The Registered date and Last Updated date are displayed. Network admins can mark a site as archived, spam, deleted and mature, to remove from public listings or disable.'=>'<strong> معلومات</strong> &mdash; سائٹ کا یوآرایل بہت کم طور پر ترمیم کرتا ہے کیونکہ اس وجہ سے سائٹ کو مناسب طریقے سے کام نہیں کرسکتی ہے۔ رجسٹرڈ تاریخ اور آخری اپڈیٹ کی تاریخ ظاہر کی گئی ہے۔ عوامی فہرستوں حذف یا غیر فعال کرنے کے لیے نیٹ ورک منتظم سائٹ کو محفوظات، غیر متعلقہ، حذف شدہ اور بلوغت کے طور پر نشان زد کر سکتے ہیں۔','<strong>Users</strong> &mdash; This displays the users associated with this site. You can also change their role, reset their password, or remove them from the site. Removing the user from the site does not remove the user from the network.'=>'<strong>صارفین</strong> &mdash; یہ اس سائٹ سے متعلق صارفین کو دکھاتا ہے۔ آپ ان کے کردار کو بھی تبدیل کر سکتے ہیں، ان کے پاسورڈ دوبارہ منتخب کر سکتے ہیں، یا انہیں سائٹ سے نکال سکتے ہیں۔ سائٹ سے صارف کو حذف کرنے سے صارف نیٹ ورک سے حذف نہیں ہوتا ہے۔','<strong>Themes</strong> &mdash; This area shows themes that are not already enabled across the network. Enabling a theme in this menu makes it accessible to this site. It does not activate the theme, but allows it to show in the site&#8217;s Appearance menu. To enable a theme for the entire network, see the <a href="%s">Network Themes</a> screen.'=>'<strong>تھمیز</strong> &mdash; یہ علاقہ ایسی تھیمز کو ظاہر کرتا ہے جو نیٹ ورک میں پہلے سے فعال نہیں ہیں۔ اس مینو میں تھیم کو فعال کرنے سے اسے سائٹ تک رسائی حاصل ہو جاتی ہے۔ یہ تھیم کو فعال نہیں کرتا، لیکن اس سائٹ کی ظاہری شکل مینو میں ظاہر کرنے کی اجازت دیتا ہے۔ پورے نیٹ ورک کے لیے تھیم کو فعال کرنے کے لیے، <a href="%s">نیٹ ورک تھیمز</a> اسکرین دیکھیں۔','<strong>Settings</strong> &mdash; This page shows a list of all settings associated with this site. Some are created by WordPress and others are created by plugins you activate. Note that some fields are grayed out and say Serialized Data. You cannot modify these values due to the way the setting is stored in the database.'=>'<strong>ترتیبات</strong> &mdash; یہ صفحہ اس سائٹ سے منسلک تمام ترتیبات کی ایک فہرست ظاہر کرتا ہے۔ کچھ WordPress نے بنائی ہیں اور دیگر پلگ انز نے بنائی ہیں جو جنہیں آپ فعال کرتے ہیں۔ نوٹ کریں کہ کچھ خانے بھورے ہوئے ہوتے ہیں اور سیریلائزڈ ڈیٹا کہتے ہیں۔ آپ ان ویلیوز میں ترمیم نہیں کر سکتے، جس طرح کی ترتیب سے ڈیٹا بیس میں محفوظ ہیں۔','folder'=>'فولڈر','This draft comes from your <a href="%s">unpublished customization changes</a>. You can edit, but there&#8217;s no need to publish now. It will be published automatically with those changes.'=>'یہ ڈرافٹ آپ کے <a href="%s">غیر شائع شدہ کسٹمائزیشن تبدیلیوں</a> سے آتا ہے۔ آپ ترمیم کر سکتے ہیں، لیکن ابھی شائع کرنے کی کوئی ضرورت نہیں۔ یہ ان تبدیلیوں کے ساتھ خود کار طریقے سے شائع کیا جائے گا۔','Uploaded on: %s'=>'اپ لوڈ کردہ: %s','Copy suggested policy text from %s.'=>'%s سے تجویز کردہ پالیسی کا متن نقل کریں.','Hello,'=>'آداب,','This text template will help you to create your web site&#8217;s privacy policy.'=>'یہ سانچہءِ متن آپ کو آپ کی ویب سائٹ کا ظابطہ رازداری بنانے میں معاون ہو گا۔','Please edit your privacy policy content, making sure to delete the summaries, and adding any information from your theme and plugins. Once you publish your policy page, remember to add it to your navigation menu.'=>'براہ کرم آپ اپنی ضابطہ رازداری کے مواد میں ترمیم کریں، خلاصہ جات کو ختم کرنے، آپ کے تھیم اور پلگ ان سے کسی بھی معلومات کو شامل کرنے کو بھی یقینی بنائیں.ضابطہ رازداری کا صفحہ شائع کرنے کے بعد، اسے نیویگیشن مینو میں شامل کرنا یاد رکھیں.','It is your responsibility to write a comprehensive privacy policy, to make sure it reflects all national and international legal requirements on privacy, and to keep your policy current and accurate.'=>'یہ آپ کی ذمہ داری ہے کہ ایک جامع ضابطہ رازداری تحریر کریں، اس بات کی یقین دہانی کیجئےضابطہ تمام قومی اور بین الاقوامی قانونی ضروریات کو ظاہر کرتا ہے، اور اپنی پالیسی کو بالکل درست اور ٹھیک رکھیں.','Who we are'=>'ہم کون ہیں','In this section you should note your site URL, as well as the name of the company, organization, or individual behind it, and some accurate contact information.'=>'اس سیکشن میں آپ کو آپ کے سائٹ کا URL، ساتھ ساتھ اس کے پیچھے کمپنی، تنظیم، یا انفرادی نام، اور کچھ درست رابطے کی معلومات کو نوٹ کرنا چاہئے.','The amount of information you may be required to show will vary depending on your local or national business regulations. You may, for example, be required to display a physical address, a registered address, or your company registration number.'=>'آپ کو کس قدر معلومات دکھانی پڑیں، اس بات کا انحصار آپ کی مقامی یا قومی کاروباری قواعد پر منحصر ہوگا. مثال کے طور پر، آپ کو آصلی ایڈریس، ایک رجسٹرڈ ایڈریس، یا آپ کی کمپنی کا رجسٹریشن نمبر ظاہر کرنا ہوگا.','Our website address is: %s.'=>'ہماری ویب سائٹ کا ایڈریس: %s۔','What personal data we collect and why we collect it'=>'ہم کونسا ذاتی ڈیٹا جمع کرتے ہیں اور کیوں جمع کرتے ہیں','You should also note any collection and retention of sensitive personal data, such as data concerning health.'=>'آپ کو حساس ذاتی ڈیٹا کے کسی بھی قسم کی حصول اور اسے برقرار رکھنے کو بھی یاد رکھنا ہوگا، مثلاً صحت کے متعلق ڈیٹا۔','In addition to listing what personal data you collect, you need to note why you collect it. These explanations must note either the legal basis for your data collection and retention or the active consent the user has given.'=>'ذاتی اعداد و شمار جمع کرنے کے علاوہ، آپ کو یہ نوٹ کرنا ہوگا کیوں کہ آپ اسے جمع کیوں کرتے ہیں. ان وضاحتوں کو نوٹ کرنا چاہیئے کہ ڈیٹا کو جمع کرنے اور برقرار رکھنے کے لئے آپ کی قانونی بنیادیں کیا ہیں یا صارف کی جانب سے دیئے جانے والے رضامندی کی اجازت کیا ہے۔','Personal data is not just created by a user&#8217;s interactions with your site. Personal data is also generated from technical processes such as contact forms, comments, cookies, analytics, and third party embeds.'=>'ذاتی ڈیٹا صرف آپ کے سائٹ کے ساتھ کسی صارف کی بات چیت کے ذریعہ نہیں بنایا جاتا ہے. ذاتی ڈیٹا تکنیکی عملوں سے بھی پیدا ہوتا ہے جیسے رابطے فارم، تبصرے، کوکیز، تجزیاتی، اورفریق ثالث کو سرایت کرنے سے.','Contact forms'=>'رابطہ فارم','When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.'=>'جب زائرین سائٹ پر تبصرے چھوڑتے ہیں تو ہم تبصرے فارم میں دیے گئے مواد، زائر کے آئی پی ایڈریس اور براؤزر صارف کے ایجنٹ کی سٹرنگ کو جمع کرتے ہیں تاکہ سپیم کا پتہ لگانے میں مدد ہو سکے۔','Cookies'=>'کوکیز','In this subsection you should list the cookies your web site uses, including those set by your plugins, social media, and analytics. We have provided the cookies which WordPress installs by default.'=>'اس ذیلی حصے میں آپکو کوکیز کی فہرست دینی چاہئے جو آپ کی ویب سائٹ کا استعمال کرتی ہے، بشمول آپ کے پلگ ان، سماجی میڈیا، اور تجزیات کے تحت. ہم نے وہ کوکیز فراہم کی ہیں جسے ورڈپریس خودبخود نصب کرتا ہے.','By default WordPress does not collect any personal data about visitors, and only collects the data shown on the User Profile screen from registered users. However some of your plugins may collect personal data. You should add the relevant information below.'=>'اصلاً ورڈپریس زائرین کے بارے میں کسی بھی ذاتی ڈیٹا کو جمع نہیں کرتا، اور رجسٹرڈ صارفین سے صارف کی پروفائل اسکرین پر دکھایا گیا اعداد و شمار کو صرف جمع کرتا ہے. تاہم آپ کے کچھ پلگ ان ذاتی ڈیٹا جمع کر سکتے ہیں. آپ کو متعلقہ معلومات کو مندرجہ ذیل جگہ پر شامل کرنا چاہئے.','If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.'=>'اگر آپ ویب سائٹ پر تصاویر اپ لوڈ کرتے ہیں، تو آپ کو سرایت کرنے والی ڈیٹا کی جگہ (EXIF GPS) کے ساتھ تصاویر اپ لوڈ کرنے سے بچنا چاہئے. زائرین، ویب سائٹ پر تصویروں سے کسی مقام کے ڈیٹا کو ڈھونڈ کر نکال سکتے اور ڈاؤن لوڈ کر سکتے ہیں.','By default, WordPress does not include a contact form. If you use a contact form plugin, use this subsection to note what personal data is captured when someone submits a contact form, and how long you keep it. For example, you may note that you keep contact form submissions for a certain period for customer service purposes, but you do not use the information submitted through them for marketing purposes.'=>'اصلاً ورڈپریس میں رابطہ فارم شامل نہیں ہے. اگر آپ رابطہ فارم پلگ ان کا استعمال کرتے ہیں تو، اس ذیلی حصے کا استعمال کریں تا کہ اس امر کو نوٹ کیا جاسکے کہ جب کوئی رابطہ فارم بھرتا ہے تو کس قسم کا ذاتی ڈیٹا اکٹھا کیا جاتا یے اور آپ کتنی دیر تک اسے برقرار رکھتے ہیں. مثال کے طور پر، آپ نوٹ کر سکتے ہیں کہ آپ کسٹمر سروس مقاصد کے لئے مخصوص مدت کے لئے رابطے فارم کے مندرجات محفوظ رکھتے ہیں ، لیکن آپ اس معلومات کو تشہیری مقاصد کے لئے انہیں استعمال نہیں کرتے.','An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.'=>'اس بات کو یقینی بنانے کے لیے کہ آپ گراوٹار کو استعمال کر رہے ہیں، آپ کے ای میل ایڈریس کے عوض ایک سٹرنگ بنا کر گراوٹار کی سروس میں محفوظ کر دی جاتی ہے۔ گراوٹار کی پرائیویسی پالیسی یہاں موجود ہے  https://automattic.com/privacy/ ۔ آپ کا تبصرہ اپروو ہونے کے بعد اس کے ساتھ آپ کی تصویر عیاں ہو جائے گی۔','If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.'=>'اگر آپ ہماری سائٹ پر ایک تبصرہ چھوڑ دیں تو آپ اپنا نام، ای میل ایڈریس اور ویب سائٹ کو کوکیز میں محفوظ کرنے کے لئے حامی بھر سکتے ہیں. یہ آپ کی سہولت کے لئے ہیں لہذا آپ کو ایک اور تبصرہ چھوڑنے پر آپ کو اپنی تفصیلات دوبارہ بھرنے کی ضرورت نہیں ہے. یہ کوکیز ایک سال تک برقرار رہیں گی.','Embedded content from other websites'=>'دوسری ویب سائٹ سے ایمبیڈڈ مواد','Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.'=>'اس سائٹ پر مضامین ایمبیڈ شدہ مواد پر مشتمل ہیں (مثال کے طور پر ویڈیو، تصاویر، مضامین وغیرہ)۔ دیگر ویب سائٹس سے ایمبیڈ شدہ مواد اسی طرح سے چلتا ہے جیسے ملاحظہ کرنے والے نے دوسری ویب سائٹ کا دورہ کیا ہے۔','Analytics'=>'تجزیات','Who we share your data with'=>'ہم آپ کا ڈیٹا کس کے ساتھ شیئر کرتے ہیں ','By default WordPress does not share any personal data with anyone.'=>'طےشدہ WordPress کسی کے ساتھ کسی بھی ذاتی ڈیٹا شئیر نہیں کرتا۔','If you visit our login page, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.'=>'اگر آپ کے پاس ایک اکاؤنٹ ہے اور آپ اس سائٹ میں لاگ ان کرتے ہیں تو، ہم آپ کے براؤزر میں کوکیز کو قبول کرتے ہیں اس بات کا تعین کرنے کے لیے ایک عارضی کوکی مقرر کریں گے۔ یہ کوکی کسی ذاتی ڈیٹا پر مشتمل نہیں ہے اور جب آپ اپنے براؤزر کو بند کر دیتے ہیں تو ان کو ختم کردیا جاتا ہے.','When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.'=>'جب آپ لاگ ان کرتے ہیں تو، آپ لاگ ان کی معلومات اور اسکرین ڈسپلے کے انتخاب کو بچانے کیلئے کئی کوکیز بھی قائم کریں گے. لاگ ان کوکیز دو دن کے لئے باقی رہتی ہیں، اور سکرین کے اختیارات کوکیز ایک سال کے لئے باقی رہتی ہیں. اگر آپ " مجھے یاد رکھیں" کو منتخب کریں گے تو آپ کا لاگ ان دو ہفتوں تک جاری رہے گا. اگر آپ اپنے اکاؤنٹ سے لاگ آؤٹ کریں گے تو لاگ ان کوکیز کو ہٹا دیا جائے گا.','If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.'=>'اگر آپ کسی مضمون میں ترمیم یا شائع کرتے ہیں تو، آپ کے براؤزر میں اضافی کوکیز محفوظ کی جائے گئی۔ یہ کوکی میں کوئی ذاتی ڈیٹا شامل نہیں ہے اور صرف اس مضمون کی پوسٹ کی شناخت کا اشارہ ہے جسے آپ نے ابھی ترمیم کیا تھا۔ یہ ایک دن کے بعد ختم ہو جاتا ہے۔','These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.'=>'یہ ویب سائٹ آپ کے بارے میں اعداد و شمار جمع کر سکتی ہیں، کوکیز کا استعمال کر سکتی ہیں، اضافی فریق ثالث کو باخبر رکھ سکتی ہیں اور اس ایمبیڈ کردہ مواد کے ساتھ آپ کے تعامل کی نگرانی کر سکتی ہیں، بشمول ایمبیڈ کردہ مواد کے ساتھ آپ کی بات چیت، اگر اس ویب سائٹ پر آپ کا اکاؤنٹ ہے اور آپ ان میں لاگ ان ہیں تو۔','By default WordPress does not collect any analytics data. However, many web hosting accounts collect some anonymous analytics data. You may also have installed a WordPress plugin that provides analytics services. In that case, add information from that plugin here.'=>'ورڈپریس کی طرف سے خودبخود کسی بھی تجزیاتی ڈیٹا کو جمع نہیں کیا جاتا. تاہم، بہت سے ویب ہوسٹنگ اکاؤنٹس کچھ گمنام تجزیاتی ڈیٹا جمع کرتے ہیں۔
آپ ایک ورڈپریس پلگ ان انسٹال کر سکتے ہیں جو تجزیاتی خدمات فراہم کرتا ہو. اس صورت میں، یہاں اس پلگ ان سے متعلق معلومات شامل کریں.','How long we retain your data'=>' ہم کتنےعرصے تک آپ کے ڈیٹا کو برقرار رکھتے ہیں','What rights you have over your data'=>' اپنے مواد پر آپ کے کیا حقوق ہیں','In this section you should explain what rights your users have over their data and how they can invoke those rights.'=>'اس سیکشن میں آپ کو اس بات کی وضاحت کرنا چاہئے کہ آپ کے صارفین نے ان کے اعداد و شمار پر کیا حق حاصل کیا ہے اور وہ ان حقوق کو کس طرح مدعو کرسکتے ہیں.','Where we send your data'=>'جہاں ہم آپ کے ڈیٹا بھیجتےہیں','Your contact information'=>'آپ کی رابطہ کی معلومات','In this section you should provide a contact method for privacy-specific concerns. If you are required to have a Data Protection Officer, list their name and full contact details here as well.'=>'اس سیکشن میں آپ کو پرائیویسی کے مخصوص خدشات کے لیے ایک رابطہ کا طریقہ فراہم کرنا چاہیے۔ اگر آپ کو ڈیٹا پروٹیکشن آفیسر ہونا ضروری ہے، تو اس کے ساتھ ساتھ ان کا نام اور مکمل رابطے کی تفصیلات درج کریں۔','In this section you should name and list all third party providers with whom you share site data, including partners, cloud-based services, payment processors, and third party service providers, and note what data you share with them and why. Link to their own privacy policies if possible.'=>'اس سیکشن میں آپ کو سبھی تیسرے فریق ثالث کے نام اور فہرست درج کرنا چاہئے جن کے ساتھ آپ سائٹ کے اعداد و شمار کا اشتراک کرتے ہیں، بشمول پارٹنرز، کلاؤڈ پر مبنی خدمات، ادائیگی کے پروسیسرز، اور خدمات فراہم کرنے والے فریق ثالث شامل ہیں، اور نوٹ کریں کہ آپ ان کے ساتھ کون سے اعداد و شمار کا اشتراک کرتے ہیں اور کیوں۔ اگر ممکن ہو تو ن کے ضابطہ رازداری سے ان کا لنک بھی کر دیں.','In this section you should explain how long you retain personal data collected or processed by the web site. While it is your responsibility to come up with the schedule of how long you keep each dataset for and why you keep it, that information does need to be listed here. For example, you may want to say that you keep contact form entries for six months, analytics records for a year, and customer purchase records for ten years.'=>'اس سیکشن میں آپ کو یہ بتانا چاہئے کہ آپ ویب سائٹس کے ذریعہ جمع کردہ یا عملدرآمد کے بارے میں کتنا عرصہ برقرار رکھتے ہیں. یہ آپ کی ذمہ داری ہے کہ شیڈول کے ساتھ آنے کے لۓ آپ ڈیٹا بیس کو کتنی دیر تک برقرار رکھیں اور آپ اسے کیوں رکھیں، اس معلومات کو یہاں درج کیا جانا چاہئے. مثال کے طور پر، آپ یہ کہنا چاہتے ہیں کہ آپ کو چھ ماہ کے لئے رابطے فارم اندراجات، ایک سال کے تجزیاتی ریکارڈ، اور دس سال کے لئے کسٹمر خریداری کے ریکارڈ رکھنے.','If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.'=>'اگر آپ ایک تبصرہ چھوڑ دیں تو، تبصرہ اور اس کے میٹا ڈیٹا کو غیر یقینی طور پر برقرار رکھا جاتا ہے. لہذا ہم کسی اعتدال پسند قطار میں خود کو پکڑنے کے بجائے خود کار طریقے سے کسی بھی تعقیب تبصرے کو تسلیم اور منظور کرسکتے ہیں.','For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.'=>'صارفین کے لئے جو ہماری ویب سائٹ پر رجسٹر ہو (اگر کوئی ہے)، ہم ان کی ذاتی پروفائل کو بھی ان کی صارف پروفائل میں فراہم کرتے ہیں. تمام صارفین اپنی ذاتی معلومات کو کسی بھی وقت دیکھ سکتے ہیں، ترمیم کرسکتے ہیں، یا حذف کر سکتے ہیں (اس کے علاوہ وہ اپنا صارف نام تبدیل نہیں کرسکتے ہیں). ویب سائٹ ایڈمنسٹریٹر اس معلومات کو بھی دیکھ سکتے ہیں اور اس میں ترمیم کرسکتے ہیں.','If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.'=>'اگر آپ کے پاس اس سائٹ پر کوئی اکاؤنٹ موجود ہے یا چھوڑ دیا ہے تو، آپ اپنے ذاتی اعداد و شمار کی برآمد کردہ فائل وصول کرنے کی درخواست کر سکتے ہیں، بشمول آپ کے ذریعہ کسی بھی اعداد و شمار سمیت. آپ اس درخواست کی بھی درخواست کرسکتے ہیں کہ ہم آپ کے بارے میں کسی ذاتی ڈیٹا کو حذف کر دیں. اس میں کوئی بھی ڈیٹا شامل نہیں ہے جو ہم انتظامی، قانونی، یا سیکورٹی کے مقاصد کے لۓ ذمہ دار ہیں.','Additional information'=>'اضافی معلومات','How we protect your data'=>'ہم آپ کےڈیٹا کی حفاظت کیسے کریں گے','What data breach procedures we have in place'=>'کیا ڈیٹا کی خلاف ورزی کا طریقہ کار ہماری جگہ میں ہے','In this section you should explain what procedures you have in place to deal with data breaches, either potential or real, such as internal reporting systems, contact mechanisms, or bug bounties.'=>'اس سیکشن میں آپ کو اس بات کی وضاحت کرنا چاہیے کہ آپ کے اعدادوشمار کے ماتحت معاملات، یا تو ممکنہ یا حقیقی، جیسے اندرونی رپورٹنگ کے نظام، رابطہ میکنیزم، یا بگ باؤنس کے ساتھ نمٹنے کے لیے آپ کے پاس کیا طریقہ کار موجود ہیں۔','In this section you should list all transfers of your site data outside the European Union and describe the means by which that data is safeguarded to European data protection standards. This could include your web hosting, cloud storage, or other third party services.'=>'اس سیکشن میں آپ کو یورپی یونین کے باہر اپنے سائٹ کے اعداد و شمار کے تمام ٹرانسفروں کو فہرست کرنا چاہیے اور اس کے ذریعہ وضاحت کریں کہ جس ڈیٹا کو یورپی ڈیٹا کے تحفظ کے معیار سے محفوظ کیا جاتا ہے. اس میں آپ کی ویب ہوسٹنگ، کلاؤڈ سٹوریج، یا دوسری تیسری پارٹی کی خدمات شامل ہوسکتی ہے.','European data protection law requires data about European residents which is transferred outside the European Union to be safeguarded to the same standards as if the data was in Europe. So in addition to listing where data goes, you should describe how you ensure that these standards are met either by yourself or by your third party providers, whether that is through an agreement such as Privacy Shield, model clauses in your contracts, or binding corporate rules.'=>'یورپی ڈیٹا حفاظتی قانون یورپی باشندوں کے بارے میں اعداد و شمار کی ضرورت ہوتی ہے جو یورپی یونین کے باہر منتقل کرنے کے لۓ اسی معیار کے مطابق منتقل کیا جاتا ہے جیسے ڈیٹا یورپ میں تھا. لہذا ڈیٹا منتقل کرنے کے علاوہ، آپ کو یہ بتانا چاہئے کہ آپ اس بات کو یقینی بنانا چاہتے ہیں کہ یہ معیار خود یا آپ کے تیسرے فریق فراہم کرنے والے کے ذریعہ سے ملاقات کی جاتی ہیں، چاہے یہ ایک معاہدے کے ذریعہ جیسے رازداری کی شیلڈ، آپ کے معاہدے میں ماڈل کے فقدان، یا پابند کارپوریٹ قوانین','If you use your site for commercial purposes and you engage in more complex collection or processing of personal data, you should note the following information in your privacy policy in addition to the information we have already discussed.'=>'اگر آپ اپنی سائٹ کو تجارتی مقاصد کے لیے استعمال کرتے ہیں اور آپ ذاتی ڈیٹا کے زیادہ پیچیدہ مجموعہ یا پروسیسنگ میں مشغول ہوتے ہیں، تو آپ کو ان کی معلومات کے علاوہ اپنی اپنی پرائیویسی پالیسی میں درج ذیل معلومات پر غور کرنا چاہیے۔','In this section you should explain what measures you have taken to protect your users&#8217; data. This could include technical measures such as encryption; security measures such as two factor authentication; and measures such as staff training in data protection. If you have carried out a Privacy Impact Assessment, you can mention it here too.'=>'اس سیکشن میں آپ کو اپنے صارفین کے اعداد و شمار کی حفاظت کے لۓ کیا اقدامات کئے جانے کی وضاحت کرنا چاہئے۔اس میں خفیہ کاری جیسے تکنیکی اقدامات شامل ہوسکتے ہیں؛ حفاظتی اقدامات جیسے دہرے عوامل کی تصدیق؛ اور اعداد و شمار کے تحفظ میں اسٹاف تربیت کے طور پر اقدامات. اگر آپ نے رازداری کے اثرات کا تعین کیا ہے تو، آپ یہاں بھی اس کا ذکر کرسکتے ہیں.','What third parties we receive data from'=>'ہم کون سی تھرڈ پاڑٹیوں سے ڈیٹا وصول کرتے ہیں','If your web site receives data about users from third parties, including advertisers, this information must be included within the section of your privacy policy dealing with third party data.'=>'اگر آپ کی ویب سائٹ صارفین سے متعلق مواد کیسی تیسرے فریق کی طرف سے وصول کرتی ہے، جس میں مشتہرین شامل ہیں، تو اس بات کی آگاہی آپ کے \'ضابطہ رازداری اور تیسرے فریق\' والے حصے میں شامل ہونی چاہئیے۔','What automated decision making and/or profiling we do with user data'=>'ہم خود کار طریقے سے فیصلہ ساز بنانے اور/یا پروفائلنگ کرتے ہیں ہم صارف کے ڈیٹا کے ساتھ کرتے ہیں','Industry regulatory disclosure requirements'=>'انڈسٹری ریگولیٹری افشاء کی ضروریات','If you are a member of a regulated industry, or if you are subject to additional privacy laws, you may be required to disclose that information here.'=>'اگر آپ کسی منظم تنظیم کا رکن ہیں، یا اگر آپ اضافی رازداری کے قوانین کے تابع ہیں، تو آپ اس معلومات کو ظاہر کرنے کی ضرورت ہوسکتی ہے.','If your web site provides a service which includes automated decision making - for example, allowing customers to apply for credit, or aggregating their data into an advertising profile - you must note that this is taking place, and include information about how that information is used, what decisions are made with that aggregated data, and what rights users have over decisions made without human intervention.'=>'اگر آپ کی ویب سائٹ ایک سروس فراہم کرتی ہے جس میں خودکار فیصلہ سازی شامل ہے - مثال کے طور پر، صارفین کو کریڈٹ کے لئے درخواست دینے کی اجازت دی جاتی ہے، یا اشتھاراتی پروفائل میں اپنا ڈیٹا جمع کروانا - 
آپ کو یہ یاد رکھنا چاہیے کہ یہ ہو رہا ہے، اور اس معلومات کے بارے میں تفصیلات شامل ہیں، اس مجموعی ڈیٹا کے ساتھ کیا فیصلے کئے جاتے ہیں، اور حقوق کے صارفین کو کونسل کے حقوق کے بغیر انسانی مداخلت کے بغیر بنایا گیا ہے.','Introduction'=>'تعارف ','Removed %s.'=>'%s حذف کر دیا۔','You deactivated this plugin on %s and may no longer need this policy.'=>'آپ نے اس پلگ ان کو%s پر غیر فعال کر دیا ہے اور اب اس پالیسی کی ضرورت نہیں ہے۔','Updated %s.'=>'اپڈیٹڈ %s۔','Source: %s'=>'ماخذ: %s','We have suggested the sections you will need. Under each section heading you will find a short summary of what information you should provide, which will help you to get started. Some sections include suggested policy content, others will have to be completed with information from your theme and plugins.'=>'ہم نے ایسے حصوں کو تجویز کیا ہے جو آپ کو ضرورت ہو گی. ہر حصے کے تحت آپ کو آپ کو کون سی معلومات فراہم کرنا چاہئے کا مختصر خلاصہ ملے گا، جو آپ کو شروع کرنے میں مدد کرے گا. کچھ حصوں میں تجویز کردہ پالیسی کے مواد شامل ہیں، باقیوں کو آپ کے تھیم اور پلگ ان کی معلومات کے ساتھ مکمل کرنا ہوگا.','Suggested text:'=>'تجویزکردہ متن:','In this section you should note what personal data you collect from users and site visitors. This may include personal data, such as name, email address, personal account preferences; transactional data, such as purchase information; and technical data, such as information about cookies.'=>'اس سیکشن میں آپ کو یاد رکھنا چاہئے کہ آپ کو صارفین اور سائٹ کے زائرین سے کتنے ذاتی ڈیٹا جمع کرتے ہیں. اس میں ذاتی ڈیٹا، جیسے نام، ای میل پتہ، ذاتی اکاؤنٹ کی ترجیحات شامل ہوسکتی ہیں؛ ٹرانزیکشن ڈیٹا، جیسے خریداری کی معلومات؛ اور تکنیکی ڈیٹا، جیسے کوکیز کے بارے میں معلومات.','In this subsection you should note what information is captured through comments. We have noted the data which WordPress collects by default.'=>'اس ذیلی سیکشن میں آپ کو یہ نوٹ کرنا چاہئے کہ تبصرے کے ذریعے کیا معلومات حاصل کی جاتی ہیں. ہم ورڈ پریس جو مواد طے شدہ طور پر جمع کرتا ہے، وہ ہم نے نوٹ کر لیا ہے۔','In this subsection you should note what information may be disclosed by users who can upload media files. All uploaded files are usually publicly accessible.'=>'اس سب سکیشن میں آپ کو یہ یاد رکھنا چاہیے کہ صارفین کو جو میڈیا فائلز کو اپلوڈ کرسکتے ہیں ان کی معلومات کو ظاہر کیا جا سکتا ہے۔ تمام اپ لوڈ شدہ فائلیں عام طور پر قابل رسائی ہیں۔','In this subsection you should note what analytics package you use, how users can opt out of analytics tracking, and a link to your analytics provider&#8217;s privacy policy, if any.'=>'اس ضمنی حصے میں آپ کو یہ یاد رکھنا چاہیے کہ آپ کونسے تجزیاتی پیکیج کا استعمال کرتے ہیں، صارفین  تجزیاتی ٹریکنگ سے کیسے نکل سکتے ہیں، اور آپ کے تجزیہ کار کی نجی معلومات کے ضابطہ رازداری کا لنک، اگر کوئی ہے.','Visitor comments may be checked through an automated spam detection service.'=>'وزیٹر کے تبصرے خود کار اسپام کا پتہ لگانے کی خدمت کے ذریعہ چیک کی جا سکتی ہے۔','The suggested privacy policy text has changed. Please <a href="%s">review the guide</a> and update your privacy policy.'=>'پرائیویسی پالیسی تبدیل ہوگئی ہے۔ براہ مہربانی <a href="%s">یہ گائیڈ دیکھیں</a> اور اپنی پالیسی اپڈیٹ کریں۔','%s (Draft)'=>'%s (مسودہ)','Common Blocks'=>'عام بلاک','Layout Elements'=>'وضع قطع کے عناصر ','A post ID mismatch has been detected.'=>'پوسٹ آئی ڈی کی خرابی کا سراغ لگایا گیا ہے۔','pluginCannot Install'=>'انسٹال نہیں کیا جا سکا','This plugin doesn&#8217;t work with your versions of WordPress and PHP.'=>'یہ پلگ ان آپ کے WordPress اور پی ایچ پی کے ورژنز کے ساتھ کام نہیں کرتا۔','<a href="%1$s">Please update WordPress</a>, and then <a href="%2$s">learn more about updating PHP</a>.'=>'<a href="%1$s">براہ مہربانی WordPress کو اپڈیٹ کریں</a>، اور <a href="%2$s">پی ایچ پی کو اپڈیٹ کرنے کے بارے میں مزید جانیے</a>۔','<a href="%s">Please update WordPress</a>.'=>'<a href="%s">براہ مہربانی WordPress کو اپڈیٹ کریں</a>۔','<a href="%s">Learn more about updating PHP</a>.'=>'<a href="%s">پی ایچ پی کو اپڈیٹ کرنے کے بارے میں مزید جانیے</a>۔','This plugin doesn&#8217;t work with your version of WordPress.'=>'یہ پلگ ان آپ کے WordPress ورژن کے ساتھ کام نہیں کرتا۔','This plugin doesn&#8217;t work with your version of PHP.'=>'یہ پلگ ان آپ کے پی ایچ پی کے ورژن کے ساتھ کام نہیں کرتا۔','My Network'=>'میرا نیٹ ورک','Copy this section to clipboard'=>'اس سیکشن کو کلپ بورڈ پر کاپی کریں','Track %s.'=>'ٹریک %s۔','Learn more about updating PHP'=>'پی ایچ پی کو اپڈیت کے بارے میں مزید جانیں','Check for updates manually'=>'دستی طور پر اپ ڈیٹس کی جانچ پڑتال کریں','A new version of WordPress is available.'=>'اک نیا ورڈپریس کا ورژن دستیاب ہے','A new minor update is available for your site. Because minor updates often address security, it&#8217;s important to install them.'=>'آپ کی سائٹ کے لئے ایک نیا معمولی اپ ڈیٹ دستیاب ہے. کیونکہ معمولی اپ ڈیٹس اکثر سیکورٹی سے متعلق ہوتے  ہیں، اس لیے ان کو انسٹال کرنا ضروری ہے.','Your plugins are all up to date'=>'آپ کے تمام پلگ انز اپڈیٹڈ ہیں','Your site has %d inactive plugin.'=>'آپ کی سائٹ پے %d ان ایکٹو پلگ ان ہے ' . "\0" . 'آپ کی سائٹ پے %d ان ایکٹو پلگ ان ہیں','Error'=>'مسئلہ','UTF8MB4 is supported'=>'UTF8MB4 کی سپورٹ موجود ہے','Could not reach WordPress.org'=>'ورڈپریس.org تک نہیں پہنچ سکا','Update your site addresses'=>'اپنی سائٹ کے ایڈرسسز کو اپڈیٹ کریں','Your site does not use HTTPS'=>'آپکی سائٹ ایچ ٹی ٹی پی ایس استعمال نہیں کرتی','Scheduled events are running'=>'شیڈول تہوار چل رہے ہیں','It was not possible to check your scheduled events'=>'آپ کے  شیڈول تہوارکو چیک کرنا ناممکن تھا','A scheduled event has failed'=>'ایک شیڈول تہوارناکام ہو گیا ہے','Passed'=>'پاس ہو گیا','HTTP requests are blocked'=>'HTTP ریکویسٹ بند ہے','HTTP requests are partially blocked'=>'کچھ HTTP ریکویسٹ بند ہے','The REST API is available'=>'REST API دستیاب ہے','The REST API did not behave correctly'=>'ریسٹ اے پی آئی نے ٹھیک سے کام نہیں کیا ','WordPress Version'=>' ورڈ پرس ورژن','Plugin Versions'=>'پلگ ان ورژنز','Theme Versions'=>'تھیم کے ورژنز','PHP Version'=>'PHP ورژن','Database Server version'=>'ڈیٹا بیس سرور ورژن','PHP Extensions'=>'PHP ایکسٹینشن','MySQL utf8mb4 support'=>'MySQL utf8mb4 سپورٹ','HTTPS status'=>'HTTPS سٹیٹس','Secure communication'=>'محفوظ مواصلات','Scheduled events'=>'تہوار کا شیڈول بنائیں','HTTP Requests'=>'HTTP ریکویسٹس','Debugging enabled'=>'ڈیبگنگ بحال ہو گئ ہے','Loopback request'=>'لوپ بیک ریکویسٹ','REST API availability'=>'REST API  کی دستیابی','No scheduled events exist on this site.'=>'اس سائٹ پر کویٔ شیڈول تہوار نہیں','View Privacy Policy Guide.'=>'پرائیویسی پالیسی گائیڈ دیکھیں۔','pluginCannot Update'=>'اپ ڈیٹ نہیں کر سکتا','Security'=>'سیکیورٹی','Your site has %d inactive theme.'=>'آپ کی سائٹ پے%d ان ایکٹو تھیم ہے' . "\0" . 'آپ کی سائٹ پے %d ان ایکٹو تھیمز ہیں','Performance'=>'کارکردگی','https://make.wordpress.org/hosting/handbook/handbook/server-environment/#php-extensions'=>'https://make.wordpress.org/hosting/handbook/handbook/server-environment/#php-extensions','Your site has 1 active plugin, and it is up to date.'=>'آپ کی سائٹ پر 1 پلگ ان فعال ہے، اور یہ جدید ہے۔','Your site has 1 installed theme, and it is up to date.'=>'آپ کی سائٹ پر 1 تھیم انسٹال ہے، اور یہ جدید ہے ','You should remove inactive themes'=>' آپ کو غیر فعال تھیم کو حذف کر دینا چاہیے','Manage your plugins'=>'اپنے پلگ انز کو منظم کریں','Update your plugins'=>'اپنے پلگ انز کو اپڈیٹ کریں','Manage inactive plugins'=>'غیر فعال پلگ انز کو منظم کریں','Manage your themes'=>'اپنی تھیمز کو منظم کریں','PHP modules perform most of the tasks on the server that make your site run. Any changes to these must be made by your server administrator.'=>'پی ایچ پی کے موڈیول زیادہ تر کام سرور پر کرتے ہیں۔ اس کے لیے اپنےسرور ایڈمن سے رابطہ کریں۔','The SQL server is a required piece of software for the database WordPress uses to store all your site&#8217;s content and settings.'=>'ورڈپریس جو ڈیٹابیس آپ کی سائٹ &#8217;s کا ڈیٹا اور سیٹنگ سٹور کرنے کے لیے استعمال کرتا ہے اس کے لیے SQL server ایک اہم چیز ہے۔','https://wordpress.org/about/requirements/'=>'https://wordpress.org/about/requirements/','Learn more about what WordPress requires to run.'=>'WordPress کو چلانے کے لیے کیا چاہیے کے بارے میں مزید جانیے۔','WordPress&#8217; utf8mb4 support requires MySQL version %s or greater. Please contact your server administrator.'=>'ورڈپریس &#8217; utf8mb4 کی سپورٹ کے لیے آپ کو MySQL  کا ورژن %s یا اس سے زیادہ چاییئے۔ برائے مہربانی اپنے سرور ایڈمن سے رابطہ کریں۔','WordPress&#8217; utf8mb4 support requires MariaDB version %s or greater. Please contact your server administrator.'=>'ورڈپریس &#8217; utf8mb4 کی سپورٹ کے لیے آپ کو MariaDB  کا ورژن %s یا اس سے زیادہ چاییئے۔ برائے مہربانی اپنے سرور ایڈمن سے رابطہ کریں۔','WordPress&#8217; utf8mb4 support requires MySQL client library (%1$s) version %2$s or newer. Please contact your server administrator.'=>'ورڈپریس &#8217; utf8mb4 کی سپورٹ کے لیے آپ کو MySQL کی کلائنٹ لائبرئر (%1$s) کا ورژن %2$s یا اس سے زیادہ چاییئے۔ برائے مہربانی اپنے سرور ایڈمن سے رابطہ کریں۔','publish box date formatM j, Y'=>'M j، Y','PHP default timezone is valid'=>'پی ایچ پی کا طے شدہ ٹائم زون درست ہے','PHP default timezone is invalid'=>'پی ایچ پی کا طے شدہ ٹائم زون غلط ہے','PHP Default Timezone'=>'پی ایچ پی طے شدہ ٹائم زون','Sorry, you are not allowed to edit comments on this post.'=>'معاف کیجیے گا، آپ کو اس پوسٹ کے تبصرے میں ترمیم کرنے کی اجازت نہیں ہے۔','Custom Background'=>'مرضی کا پس منظر','Background updated. <a href="%s">Visit your site</a> to see how it looks.'=>' پس منظر کی تجدید کر دی گئی۔ <a href="%s">دیکھنے کے لیے اپنی سائٹ پر جائیں</a>۔','Choose an image from your computer:'=>'اپنے کمپیوٹر سے ایک تصویر منتخب کریں:','Custom Header'=>'مرضی کا ہیڈر','Edit &#8220;%s&#8221;'=>'ترمیم کریں &#8220;%s&#8221;','This <a href="%1$s">child theme</a> requires its parent theme, %2$s.'=>'اس <a href="%1$s">اندرونی تھیم</a> کو بنیادی تھیم %2$s کی ضرورت ہے۔','The update process is starting. This process may take a while on some hosts, so please be patient.'=>'اپڈیٹ کا عمل شروع ہو رہا ہے، یہ عمل کچھ ہوسٹس پر تھوڑا وقت لے سکتا ہے، براہ مہربانی اطمینان سے رہیں۔','Filter'=>'فلٹر','The &#8220;slug&#8221; is the URL-