و مندرجہ ذیل خانے پُر کرنے ہونگے: ','You can use categories to define sections of your site and group related posts. The default category is &#8220;Uncategorized&#8221; until you change it in your <a href="%s">writing settings</a>.'=>'آپ زمروں کو اپنی سائٹ کے سیکشن اور گروپ کی متعلق پوسٹیں واضع کرنے کے لیے استعمال کر سکتے ہیں۔ پہلے سے طے شدہ قسم متفرق ہے۔ آپ اس کو اپنی <a href="%s">لکھنے کی ترتیبات</a> میں تبدیل کر سکتے ہیں۔','What&#8217;s the difference between categories and tags? Normally, tags are ad-hoc keywords that identify important information in your post (names, subjects, etc) that may or may not recur in other posts, while categories are pre-determined sections. If you think of your site like a book, the categories are like the Table of Contents and the tags are like the terms in the index.'=>'زمرے اور ٹیگ میں کیا فرق ہے؟ عام طور پر ٹیگ وہ الفاظ ہوتے ہیں جو کہ آپ کی پوسٹ کی اہم معلومات کو عیاں کرنے کے لیے استعمال ہوتے ہیں (نام، چیز وغیرہ) جو دوسری پوسٹس میں موجود ہو بھی سکتی ہے اور نہیں بھی ہو سکتی۔ جب کہ زمرہ جات پہلے سے طے شدہ سیکشن ہوتے ہیں۔ اگر آپ اپنی ویب سائٹ کو ایک کتابچہ کے طور پر سوچیں تو زمرے اس کی فہرست کی مانند ہوتے ہیں اور ٹیگ اس میں موجود اصطلاحات۔','You can change the display of this screen using the Screen Options tab to set how many items are displayed per screen and to display/hide columns in the table.'=>'آپ اسکرین اختیار کے ذریعے اس اسکرین کا ڈسپلے تبدیل کر سکتے ہیں تا کہ تعین کیا جائے کہ کتنے آئٹم دکھائے جائیں یا ٹیبل کے کالم دکھائیں یا چھپائیں جائیں۔','<strong>Description</strong> &mdash; The description is not prominent by default; however, some themes may display it.'=>'<strong>تفصیل</strong> تفصیل عام طور پر نمایاں نہیں ہوتا مگر کچھ تھیم اس کو ظاہر کریں گی۔','<strong>Name</strong> &mdash; The name is how it appears on your site.'=>'<strong>نام</strong> &mdash; سائٹ پر آپ کا نام اس طرح ظاہر ہو گا۔','When adding a new category on this screen, you&#8217;ll fill in the following fields:'=>'اس اسکرین پر نیا زمرہ شامل کرنے کے لیے آپ کو مندرجہ ذیل فیلڈز پر کرنے ہونگے:','All updates have been completed.'=>'تمام اپڈیٹس مکمل ہو چکی ہیں۔','This screen contains the settings that affect the display of your content.'=>'اس اسکرین پر ترتیبات آپ کے مواد کی نمائش کو متاثر کرتی ہیں۔','You must click the Save Changes button at the bottom of the screen for new settings to take effect.'=>'ترامیم کو قابلِ عمل بنانے کے لیے اسکرین کے نچلے حصے میں \'ترامیم کو محفوظ کریں\' کے بٹن پر کلک کرنا ضروری ہے۔','Categories can be selectively converted to tags using the <a href="%s">category to tag converter</a>.'=>'زمرے کو ٹیگز میں یہاں تبدیل کیا جا سکتا ہے۔ <a href="%s">زمروں کو ٹیگز میں تبدیل کریں</a>۔','Return to Importers'=>'امپورٹر پر واپس جائیں','Activate Plugin &amp; Run Importer'=>'پلگ ان کو فعال کریں &amp; امپوٹر چلائیں','You can add links here to be displayed on your site, usually using <a href="%s">Widgets</a>. By default, links to several sites in the WordPress community are included as examples.'=>'آپ اپنی سائٹ پر لنک ظاہر کرنے کے لیے یہاں لنک درج کر سکتے ہیں، اس مقصد کے لیے  <a href="%s">ویجٹ</a> کا استعمال کریں۔ طے شدہ طریقے کے مطابق، WordPress کمیونٹی کی سائٹس کے بہت سارے لنکس مثال کے طور پر درج کیے گئے ہیں۔','If you delete a link, it will be removed permanently, as Links do not have a Trash function yet.'=>'اگر آپ کوئی لنک ہٹا دینگے  تو وہ مستقل طور پر حذف ہو جائیگا، لنکس کے لیے ردی کی ٹوکری میسر نہیں۔','You can customize the look of your site without touching any of your theme&#8217;s code by using a custom background. Your background can be an image or a color.'=>'آپ مرضی کے پس منظرکے زریعے تھیم کے کوڈ  کو چھوئے بغیر اپنی سائٹ کو کسٹمائز کر سکتے ہیں۔ آپ پس منظر کوئی تصویر یا کوئی رنگ ہو سکتا ہے.','<strong>Slug</strong> &mdash; The &#8220;slug&#8221; is the URL-friendly version of the name. It is usually all lowercase and contains only letters, numbers, and hyphens.'=>'<strong>سلگ</strong>- سلگ کسی بھی نام کا یوآرایل دوست ورژن ہوتا ہے۔ عمومی طور پر یہ انگلش میں تمام چھوٹے الفاظ پر مشتمل ہوتا ہے اور اس میں حروف، نمبر اور ہائفن وغیرہ شامل ہوتے ہیں۔','There is a new version of %1$s available. <a href="%2$s" %3$s>View version %4$s details</a>.'=>'نیا ورژن%1$s موجود ہے۔ <a href="%2$s" %3$s>ورژن %4$s کی  تفصیل دیکھیں</a>۔','Editor Style'=>'ایڈیٹر اسٹائل','Plugin updated successfully.'=>'پلگ ان کامیابی سے اپڈیٹ کردیا گیا۔','You only have one theme enabled for this site right now. Visit the Network Admin to <a href="%1$s">enable</a> or <a href="%2$s">install</a> more themes.'=>'آپ کے پاس اس وقت اس سائٹ کے لیے صرف ایک ہی تھیم فعال ہے۔ نیٹ ورک ایڈمن کے پاس <a href="%1$s">فعال</a> کرنے جائیں یا اور تھیمز<a href="%2$s">انسٹال</a> کریں۔','There is a new version of %1$s available. <a href="%2$s" %3$s>View version %4$s details</a>. <em>Automatic update is unavailable for this plugin.</em>'=>'%1$s کا نیا ورژن دستیاب ہے۔ <a href="%2$s" %3$s>%4$s ورژن تفصیلات دیکھیے</a>۔ <em> اس تھیم کی خودکار اپڈیٹ دستیاب نہیں ہے۔</em>','Plugin update failed.'=>'پلگ ان کرنے میں ناکامی۔','Theme update failed.'=>'تھیم اپڈیٹ کرنے میں ناکامی۔','Theme updated successfully.'=>'تھیم کامیابی سے اپڈیٹ کردی گئی۔','There is a new version of %1$s available. <a href="%2$s" %3$s>View version %4$s details</a>. <em>Automatic update is unavailable for this theme.</em>'=>'%1$s کا نیا ورژن دستیاب ہے۔ <a href="%2$s" %3$s>ورژن %4$s  کی تفصیلات دیکھیں</a>۔ <em>اس تھیم کی آٹومیٹک اپڈیٹ دستیاب نہیں ہے۔</em>','Update package not available.'=>'اپڈیٹ پیکج موجود نہیں ہے۔','Default Post Format'=>'پوسٹ کی پہلے سے طے شدہ شکل','You only have one theme enabled for this site right now. Visit the Network Admin to <a href="%s">enable</a> more themes.'=>'اس سائٹ پر ابھی صرف ایک تھیم فعال ہے۔ مزید تھیمز <a href="%s">فعال</a> کرنے کے لیے نیٹ ورک ایڈمن پر جائیں۔','You only have one theme installed right now. Live a little! You can choose from over 1,000 free themes in the WordPress Theme Directory at any time: just click on the <a href="%s">Install Themes</a> tab above.'=>'ابھی آپ نے صرف ایک تھیم انسٹال کیا ہوا ہے۔ آپ کسی بھی وقت 1000 فری تھیم کی ڈائریکٹری سے تھیم منتخب کر سکتے ہیں: صرف اوپر موجود ٹیب میں پر موجود <a href="%s">انسٹال تھیم</a> کے بٹن پر کلک کریں۔','Full Width Template'=>'پوری چوڑائی کا ٹیمپلیٹ ','Lead Developer'=>'لیڈ ڈیولپر','Translate this to be the equivalent of English Translators in your language for the credits page Translators sectionTranslators'=>'مترجمین','Layout'=>'لےآؤٹ','Want to see your name in lights on this page? <a href="%s">Get involved in WordPress</a>.'=>'آپ اس صفحہ پر اپنا نام روشن دیکھنا چاہتے ہیں؟ <a href="%s">WordPress میں شامل ہو جائیں</a>۔','Credits'=>'کریڈٹس','Cofounder, Project Lead'=>'شریک بانی، پروجیکٹ لیڈ','Core Contributors to WordPress %s'=>'WordPress کے بنیادی شراکت کار%s','Freedoms'=>'آزادیاں','WordPress is created by a <a href="%1$s">worldwide team</a> of passionate individuals. <a href="%2$s">Get involved in WordPress</a>.'=>'WordPress کو پرجوش لوگوں پر مشتمل <a href="%1$s">عالمگیر ٹیم</a> نے بنایا ہے۔ <a href="%2$s">آپ بھی WordPress میں شامل ہوں</a>۔','Project Leaders'=>'منصوبے کے لیڈران','term nameName'=>'نام','Post Formats'=>'پوسٹ فارمیٹس','External Libraries'=>'بیرونی لائبریری','Featured Image Header'=>'نمایاں تصویر کا ہیڈر ','Featured Images'=>'نمایاں تصاویر','Note: Neither of these options blocks access to your site &mdash; it is up to search engines to honor your request.'=>'نوٹ: ان میں سے کوئی بھی اختیار آپ کی سائٹ تک رسائی کو نہیں روک سکتا۔  &mdash;  سرچ انجنز پر ہے کہ آپ کی تجویز کا احترام کریں۔','Site Language'=>'سائٹ کی زبان','Update Available <span class="count">(%s)</span>'=>'اپڈیٹ دستیاب ہے  <span class="count">(%s)</span>' . "\0" . 'اپڈیٹ دستیاب ہیں  <span class="count">(%s)</span>','Deactivate'=>'غیر فعال','Version %s'=>'ورژن %s','By %s'=>'منجانب %s','Overview'=>'مجموعی جائزہ','For more information:'=>'مزید معلومات کے لیے:','Delete'=>'حذف کریں','Install'=>'انسٹال','%1$s (%2$s)'=>'%1$s (%2$s)','You can submit content in several different ways; this screen holds the settings for all of them. The top section controls the editor within the dashboard, while the rest control external publishing methods. For more information on any of these methods, use the documentation links.'=>'آپ مختلف طریقوں سے مواد جمع کروا سکتے ہیں؛ اس اسکرین پر ان سب کے لیے ترتیبات موجود ہے۔ اوپر والا حصہ ڈیش بورڈ کے ایڈیٹر کو کنٹرول کرتا ہے جب کہ باقی بیرونی اشاعتی طریقوں کو۔ ان کی مزید تفصیل کے لیے دستاویزات کے لنکس کو فالو کریں۔','Post Via Email'=>'ای میل کے ذریعے پوسٹ بھیجیں','You can create groups of links by using Link Categories. Link Category names must be unique and Link Categories are separate from the categories you use for posts.'=>'آپ لنک زمرے کے ذریعے لنکس کے گروپس بنا سکتے ہیں۔ لنک زمروں کے نام منفرد ہونے چاہیے اور یہ پوسٹ کے زمروں سے مختلف ہوتی ہیں۔','You can assign keywords to your posts using <strong>tags</strong>. Unlike categories, tags have no hierarchy, meaning there&#8217;s no relationship from one tag to another.'=>'آپ اپنی پوسٹس کے ساتھ کی ورڈز جوڑنے کے لیے <strong>ٹیگز</strong> کا استعمال کر سکتے ہیں۔ زمروں کے برعکس ٹیگز میں تنظیمی ڈھانچہ نہیں ہوتا۔ جس کا مطلب ہے کہ ایک ٹیگ کا دوسرے سے کوئی تعلق نہیں ہوتا۔','Deleting Links'=>'لنکس کو حذف کیا جا رہا ہے','If desired, WordPress will automatically alert various services of your new posts.'=>'اگر ضرورت پیش آئی تو WordPress آپ کی نئی پوسٹس کی سروسز کو خودبخود تبدیل کر دے گا۔','Links may be separated into Link Categories; these are different than the categories used on your posts.'=>'لنکس کو لنک زمرے کے ذریعے جدا کر سکتے ہیں، یہ پوسٹ کے زمروں سے مختلف ہوتے ہیں۔','Adding Categories'=>'زمرے شامل کرنا ','Adding Tags'=>'ٹیگز شامل کرنا','What&#8217;s New'=>'نیا کیا ہے','The plugin contains no files.'=>'پلگ انز میں کوئی فائلز نہیں ہیں۔','No valid plugins were found.'=>'کوئی درست پلگ انز نہیں ملے۔','WordPress is created by a worldwide team of passionate individuals.'=>'WordPress کو پرجوش لوگوں پر مشتمل عالمگیر ٹیم نے بنایا ہے۔','Core Developer'=>'کور ڈیوپلپر','There are unsaved changes that will be lost. \'OK\' to continue, \'Cancel\' to return to the Image Editor.'=>'کچھ ترامیم ابھی محفوظ نہیں ہوئیں اور ضائع ہو جائیں گی۔ جاری رکھنے کے لیے \'ٹھیک ہے\'، واپیس تصویری ایڈیٹر میں جانے کے لیے \'منسوخ کریں\' پر کلک کریں۔','Post via email settings allow you to send your WordPress installation an email with the content of your post. You must set up a secret email account with POP3 access to use this, and any mail received at this address will be posted, so it&#8217;s a good idea to keep this address very secret.'=>'ای میل کے ذریعے پوسٹ کرنے کے آپشن کے ذریعے سے آپ ای میل کی مدد سے اپنی سائٹ پر پوسٹ کر سکتے ہیں۔ اس کے لیے آپ کو POP3  ایکسس کے ساتھ ایک ای میل اکاؤنٹ مقرر کرنا پڑے گا، اور اس سے کی گئی ہر ای میل پوسٹ کر دی جائے گی، لہذا ضروری ہے کہ آپ اس کے خفیہ رکھیں۔ ','Database name'=>'ڈیٹا بیس کا نام','Database username'=>'ڈیٹا بیس اسم رکنیت','Database host'=>'ڈیٹابیس ہوسٹ','Paused <span class="count">(%s)</span>'=>'روک دی گئی <span class="count">(%s)</span>' . "\0" . 'روک دی گئیں <span class="count">(%s)</span>','Disabled'=>'غیر فعال شدہ','Hello Dolly'=>'ہیلو ڈولی','This is not just a plugin, it symbolizes the hope and enthusiasm of an entire generation summed up in two words sung most famously by Louis Armstrong: Hello, Dolly. When activated you will randomly see a lyric from <cite>Hello, Dolly</cite> in the upper right of your admin screen on every page.'=>'یہ محض ایک پلگ ان نہیں ہے بلکہ اس نے پوری نسل کے حوصلے اور امید کو دو لفظوں میں سمو دیا ہے، جسے مشہورِگلوکار لوئس آرمسٹرانگ نے گنگنایا ہے: ہیلو ڈولی۔ جب آپ اس کو موثر بناتے ہیں تو آپ ایڈمن اسکرین کی مختلف اسکرینوں پر دائیں جانب اوپر کونے میں <cite>Hello, Dolly</cite>  کے مختلف بول دیکھیں گے۔','http://ma.tt/'=>'http://ma.tt/','There is a new version of %1$s available. <a href="%2$s" %3$s>View version %4$s details</a> or <a href="%5$s" %6$s>update now</a>.'=>'%1$s کا نیا ورژن دستیاب ہے۔ <a href="%2$s" %3$s>%4$s ورژن کی تفصیلات دیکھیں</a>  یا   <a href="%5$s" %6$s>ابھی اپڈیٹ کریں</a>۔','This theme requires a parent theme. Checking if it is installed&#8230;'=>'اس تھیم کو بنیادی تھیم کی ضرورت ہے۔ چیک کریں کہ یہ انسٹال ہے &#8230;','Preparing to install <strong>%1$s %2$s</strong>&#8230;'=>'انسٹال کرنے کے لیے تیار کیا جا رہا ہے <strong>%1$s %2$s</strong>&#8230;','The parent theme, <strong>%1$s %2$s</strong>, is currently installed.'=>'بنیادی تھیم، <strong>%1$s %2$s</strong> ابھی انسٹال ہے۔','Successfully installed the parent theme, <strong>%1$s %2$s</strong>.'=>'بنیادی تھیم کامیابی سے انسٹال ہو گئی، <strong>%1$s %2$s</strong>۔','<strong>The parent theme could not be found.</strong> You will need to install the parent theme, %s, before you can use this child theme.'=>'<strong>بنیادی تھیم نہیں مل سکی۔</strong> آپ کو بنیادی تھیم انسٹال کرنے کی ضرورت ہے، %s، اس سے پہلے کے آپ چائلڈ تھیم استمعال کریں۔','Plugin'=>'پلگ ان','Version:'=>'ورژن:','Scale'=>'پیمانہ','Set as background'=>'بطور پس منظر لگائیں','Select Image'=>'تصویر منتخب کریں','Or choose an image from your media library:'=>'یا میڈیا لائبریری سے ایک تصویر کو منتخب کریں:','Next Steps'=>'اگلے اقدامات','Search Engine Visibility'=>'سرچ انجن کے لیے نمائش','Allow search engines to index this site'=>'سرچ انجنز کو اجازت دیں کہ سائٹ کو انڈکس کریں','Discourage search engines from indexing this site'=>'سرچ انجنز کو اجازت نہ دیں کہ اس سائٹ کو انڈیکس کریں','It is up to search engines to honor this request.'=>'یہ سرچ انجنز پر ہے کہ اس درخواست کی قدر کرے۔','You can choose whether or not your site will be crawled by robots, ping services, and spiders. If you want those services to ignore your site, click the checkbox next to &#8220;Discourage search engines from indexing this site&#8221; and click the Save Changes button at the bottom of the screen. Note that your privacy is not complete; your site is still visible on the web.'=>'آپ منتخب کر سکتے ہیں کہ آیا کہ روبوٹس، پنگ سروسز اور اسپائڈر آپ کی سائٹ کرال کریں گے یا نہیں۔  اگر آپ چاہتے ہیں کہ یہ سروسز آپ کی سائٹ کو نظرانداز کریں تو &#8220; سرچ انجن کی حوصلہ شکنی &#8221; کے سامنے موجود چیک باکس پر کلک کریں اور اس ترتیبات کو محٖفوظ کر لیں۔ نوٹ کریں کہ آپ کی پرائیویسی ابھی بھی ادھوری ہے، آپ کی سائٹ ابھی بھی ویب پر موجود ہے۔','You can also choose a background color by clicking the Select Color button and either typing in a legitimate HTML hex value, e.g. &#8220;#ff0000&#8221; for red, or by choosing a color using the color picker.'=>'رنگ کے بٹن پر کلک کرنے سے آپ پس منظر کا رنگ تبدیل کر سکتے ہیں یا  آپ درست HTML ہیکس نمبر کے ذریعے سے بھی کر سکتے ہیں مثال کےطور پر: لال رنگ کے لیے #8220;& #ff0000 & #8221;، یا تو رنگ منتخب کرنے والے ٹول سے رنگ منتخب کر سکتے ہیں۔','The uploaded file is not a valid image. Please try again.'=>'اپ لوڈ کی گئی تصویر درست نہیں ہے۔ دوبارہ کوشش کریں۔','To use a background image, simply upload it or choose an image that has already been uploaded to your Media Library by clicking the &#8220;Choose Image&#8221; button. You can display a single instance of your image, or tile it to fill the screen. You can have your background fixed in place, so your site content moves on top of it, or you can have it scroll with your site.'=>'پس منظر کی تصاویر کو استعمال کرنے کے لیے، بآسانی اسے اپلوڈ کریں یا اپنی میڈیا لائبریری میں پہلے سے موجود تصویر کے لیے &#8220;تصویر منتخب کریں&#8221; کے بٹن پر کلک کریں۔ آپ اپنی تصویر کو ایک بار دکھا سکتے ہیں، یا اس کو دہرا کر کے پوری اسکرین پر دکھا سکتے ہیں یا تصویر کو ایک جگہ مقرر کر سکتے ہیں، اور آپ کی سائٹ کی چیزیں اس پر موجود ہوتی ہیں۔','<strong>Parent</strong> &mdash; Categories, unlike tags, can have a hierarchy. You might have a Jazz category, and under that have child categories for Bebop and Big Band. Totally optional. To create a subcategory, just choose another category from the Parent dropdown.'=>'<strong>بنیادی</strong> &mdash; زمرہ جات کی ٹیگز کے برعکس ہیرارکی (ترتیب) ہوتی ہے۔ آپ کی ایک جاز زمرہ ہو سکتی ہے اور اس کے اندر آپ سب زمرے، جیسا کہ بی پاپ اور بگ بینڈ بنا سکتے ہیں، یہ مکمل طور پر اختیاری ہے۔ ایک ثانوی زمرہ بنانے کے لیے، صرف ڈراپ ڈاؤن سے بنیادی زمرے منتخب کرنا ضروری ہے۔','If you are looking to use the link manager, please install the <a href="%s">Link Manager</a> plugin.'=>'اگر آپ لنک منیجر استمعال کرنے کے بارے میں سوچ رہے ہیں، <a href="%s">لنک منیجر</a> کا پلگ ان انسٹال کریں۔','Image rotation is not supported by your web host.'=>'آپ تصویر کو گھما نہیں سکتے کیونکہ آپ کا ویب ہوسٹ اس کی اجازت نہیں دیتا۔','Client version'=>'کلائنٹ ورژن','To crop the image, click on it and drag to make your selection.'=>'تصویر کو کراپ کرنے کے لیے، اس پر کلک کریں اوراپنے انتخاب کے لیے ڈریگ کریں۔','Loading&hellip;'=>'لوڈ کیا جا رہا ہے&hellip;','The theme contains no files.'=>'تھیم میں کوئی فائلز نہیں ہے','http://wordpress.org/plugins/hello-dolly/'=>'http://wordpress.org/plugins/hello-dolly/','WordPress %1$s running %2$s theme.'=>'WordPress %1$s پر تھیم %2$s چل رہی ہے۔','Update Available'=>' اپڈیٹ دستیاب ہے','Show previous theme'=>'گذشتہ تھیم دکھائیں','Show next theme'=>'اگلی تھیم دکھائیں','When this setting is in effect, a reminder is shown in the At a Glance box of the Dashboard that says, &#8220;Search Engines Discouraged,&#8221; to remind you that your site is not being crawled.'=>'جب آپ اس ترتیب کو فعال کریں گے تو آپ کو اپنے ڈیش بورڈ میں ایک باکس نظر آئے گا جس میں لکھا ہوگا کہ &#8220;سرچ انجن کی حوصلہ شکنی&#8221; جو کہ آپ کو اس بات کی یاد دہانی کروائے گا کہ آپ کی سائٹ کرال نہیں کی جا رہی۔ ','Accessibility Ready'=>'رسائی پذیری کے لیے تیار','This is a child theme of %s.'=>'یہ %s کی چائلڈ تھیم ہے','https://make.wordpress.org/'=>'https://make.wordpress.org/','You can proportionally scale the original image. For best results, scaling should be done before you crop, flip, or rotate. Images can only be scaled down, not up.'=>'آپ تناسبی پیمانوں سے اصل تصویرکو تبدیل کر سکتے ہیں۔ اچھے نتائج کے لیے یہ کام تصویر کو کاٹنے، موڑنے یا گھمانے سے پہلے کریں۔ تصویر کو صرف چھوٹا کیا جا سکتا ہے، بڑا نہیں۔','The aspect ratio is the relationship between the width and height. You can preserve the aspect ratio by holding down the shift key while resizing your selection. Use the input box to specify the aspect ratio, e.g. 1:1 (square), 4:3, 16:9, etc.'=>'پہلو 